INSERT INTO "users" VALUES ('2', 'edkatz@andrew.cmu.edu', 'ed.katz@sv.cmu.edu', '2008-08-15 18:05:29', '2012-10-02 17:19:38.594527', 't', 'f', 'f', 'EdKatz', 'Edward', 'Katz', 'Ed Katz', '/images/staff/EdKatz.jpg', '', '', '', 'f', 'f', '2012-06-29 17:02:13.881199', 't', 'Edward P.', 'Carnegie Mellon Silicon Valley ', 'Senior Systems Scientist, Associate Professor of the Practice ', 'Moffett Field', 'CA', 'USA', '650-335-2839 ', 'e_p_katz ', 'e_p_katz ', 'edward.katz@sv.cmu.edu', 'Unknown', '<p style="text-align: justify;">Edward Katz is both a Senior Systems Scientist and an Associate Professor of the Practice at Carnegie Mellon Silicon Valley. Prior to joining Carnegie Mellon Silicon Valley, he was a Senior Software Researcher at Hewlett-Packard Laboratories for more than two decades. Involved in a wide variety of technical areas, he participated in R&amp;D efforts including object-oriented language design and implementation, industrial robotic software systems, CAM-based factory automation, automated generative process planning, agent-based factory automation, enterprise-level manufacturing automation, manufacturing process simulation, and software agents applied as personal assistants. Prior to joining Hewlett-Packard Laboratories, he was on the faculty of the Computer Science Department at the University of Wisconsin-Oshkosh.</p>
<p style="text-align: justify;">He earned a B.S. in Mathematics, with an emphasis in Education, from Purdue University; an M.S. in Computer Science from the University of Missouri-Columbia, and a Ph.D. in Computer Science, with a specialization in Artificial Intelligence and Software Systems, from the University of Louisiana-Lafayette.</p>
<p style="text-align: justify;">While a Visiting Scholar at Stanford University Computer Science Department&rsquo;s Robotics Laboratory, Dr. Katz collaborated with Prof. Nils J. Nilsson, enhancing the Prof. Nilsson&rsquo;s reactive middleware paradigm for robotic agent, goal-directed control. During this collaboration, Dr. Katz invented the Fuzzy Teleo-Reactive extended paradigm for software agent and autonomous robot control.</p>
<p style="text-align: justify;">Dr. Katz has published technical papers in several international  conferences, has been awarded two US Patents and has authored several  pending patent applications. His professional memberships include Senior  Member, Association for the Advancement of Artificial Intelligence  (AAAI), Senior Member, Association for Computing Machinery (ACM), and  Senior Member, Institute of Electrical and Electronics Engineers (IEEE).  He is the IEEE Robotics and Automation Society Santa Clara  Valley/Oakland East-Bay/San Francisco Joint Chapter Program Chair  (former Chair person) and member of the IEEE Computational Intelligence  Society Chapter and the IEEE Computer Society Chapter.</p>
<p style="text-align: justify;">His research interests include Computational Intelligence  (primarily fuzzy logic) theory and application, smart environment and  robotic software systems (primarily autonomous mobile robotics),  software agents (both immobile and mobile), multi-agent systems,  (rule-based, knowledge-based, and model-based) computation, reactive  software systems, traditional Artificial Intelligence, visual and  diagrammatic programming languages, and distributed sensor networks.</p>', '<p>&nbsp;</p>
<p><input id="gwProxy" type="hidden" /><input id="jsProxy" onclick="jsCall();" type="hidden" /></p>', 'Building 23, Room 105b', 'By appointment.', 'Work', '', '', '', '', '', '', '2', '121', 'f', '', null, null, null, null, '206', '2012-10-02 17:19:38.586672', '2012-10-02 05:22:40.212411', '99.90.66.28', '209.129.244.250', null, null, null, null, null, null, null, null, null, 'e-p-katz', 'links', 'hjbUhp5kzozdpj77L2Cm', '2012-10-02 05:22:37.373725', null, 'length');
INSERT INTO "users" VALUES ('3', 'reedl@andrew.cmu.edu', 'reed.letsinger@sv.cmu.edu', '2008-08-15 18:05:29', '2011-07-19 21:22:52.708657', 't', 'f', 'f', 'ReedLetsinger', 'Reed', 'Letsinger', 'Reed Letsinger', '/images/staff/ReedLetsinger.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon Silicon Valley ', 'Professor of the Practice', 'Moffett Field', 'CA', 'USA', '650-335-2851', 'reedletsinger', '', 'rletsinger@sbcglobal.net ', 'Local', '', '', 'Building 23, Room 121', 'Wednesdays 2:30 - 3:30 PM (Pacific time) every week, Wednesdays 1:00 - 3:30 every other week, or by appointment ', 'Work', '650-856-1361', 'Home', '650-815-9711 ', 'Mobile', '', '', '1', '2', 'f', '', null, null, null, null, '11', '2011-07-06 21:14:06.487505', '2011-05-26 20:07:13.09852', '209.129.244.250', '75.36.173.228', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('4', 'mradley@andrew.cmu.edu', 'martin.radley@sv.cmu.edu', '2008-08-15 18:05:29', '2012-03-01 22:23:39.823299', 't', 'f', 'f', 'MartinRadley', 'Martin', 'Radley', 'Martin Radley', '/images/staff/MartinRadley.jpg', '2009', 'SM', '', 't', 't', null, 'f', '', 'Carnegie Mellon Silicon Valley ', 'Senior Lecturer ', 'Louisville', 'CO', 'USA', '720-379-5559 ', 'mrr0153', 'mradley', 'martinrradley@yahoo.com', 'Remote', '<p>Born in England. Mother Born in Scotland. Father born in India. Married to Mimi since 1983. Two daughters, Megan and Bridget. Played 3 years varsity soccer at UC Santa Barbara. 30+ years of software development experience, starting as a programmer and moving into project management and management. CMU faculty since 2004.</p>', '', '', 'By appt (via email or Google Calendar) ', 'Work', '303-818-3283', 'Mobile', '', '', '', '', '348', '3', 't', '', null, null, null, null, '11', '2011-05-25 08:02:23.854762', '2011-03-12 03:37:48.118042', '71.196.220.93', '75.71.74.100', null, null, null, null, null, null, null, null, null, '', null, null, null, null, null);
INSERT INTO "users" VALUES ('5', 'gmercier@andrew.cmu.edu', 'gladys.mercier@sv.cmu.edu', '2008-08-15 18:05:29', '2012-10-02 19:05:52.369535', 't', 'f', 'f', 'GladysMercier', 'Gladys', 'Mercier', 'Gladys Mercier', '/images/staff/GladysMercier.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon University Silicon Valley', 'Director of the Software Management Program ', 'Moffett Field', 'CA', 'USA', '650-335-2820', 'coolest_game ', '', '', 'Local', '<p>Gladys M. Mercier is the Director of the Software Management program  at Carnegie Mellon Silicon Valley and a certified Project Management  Professional (PMP). Gladys has 12 years of software engineering  experience with a focus on industrial automation systems for steel  manufacturing. She has served in the roles of developer,  designer/architect, tester, trainer, team lead and project manager. She  has developed and taught software project management courses, been a  teaching mentor, and developed repeatable mentoring processes.</p>
<p>Ms. Mercier earned her bachelor''s degree in computer science from the  University of Pittsburgh and both her M.S. in software engineering as  well as her M.B.A. from Carnegie Mellon University.</p>', '', 'Bldg 23 - 122', '', 'Work', '', '', '', '', '', '', '5', '62', 'f', '', null, null, null, null, '126', '2012-10-02 19:05:52.363602', '2012-09-25 07:29:28.733434', '209.129.244.250', '108.235.116.182', null, null, null, null, null, null, null, null, null, '', null, 'fMZQ5TL5Mh9iJVNnvsWw', '2012-10-02 19:05:52.340669', null, 'length');
INSERT INTO "users" VALUES ('6', 'aiw@andrew.cmu.edu', 'tony.wasserman@sv.cmu.edu', '2008-08-15 18:05:29', '2012-10-03 19:03:35.198264', 't', 'f', 'f', 'TonyWasserman', 'Tony', 'Wasserman', 'Tony Wasserman', '/images/staff/TonyWasserman.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon  Silicon Valley', 'Executive Director COSI and Professor of Software Management Practice ', 'Moffett Field', 'CA', 'USA', '650-335-2807', 'tony.wasserman ', '', '', 'Local', '<p>Anthony I. (Tony) Wasserman is a Professor of Software Management  Practice at Carnegie Mellon Silicon Valley, and the Executive Director  of the Center for Open Source Investigation.</p>
<p>Previously, Tony was Director of Mobile Middleware Labs for  Hewlett-Packard&rsquo;s Middleware Division, where he managed a development  team working on software infrastructure for mobile web services. Before  it was acquired by HP, Tony was Vice President of Bluestone Software,  responsible for its West Coast Labs, where he led the creation of the  award-winning, J2EE-based, Total-e-Mobile toolkit. During the dot-com  boom, he was VP of Engineering for a startup in San Francisco.</p>
<p>As Founder and CEO of Interactive Development Environments, Inc.  (IDE) from 1983-1993, Tony built IDE to $25M in revenue, earning it a  place on the Inc. 500 list and making IDE a recognized leader in  computer-aided software engineering. As CEO, he raised venture funding,  created international subsidiaries, and contributed to the architecture  of IDE''s innovative Software through Pictures (StP) software modeling  environment.&nbsp; IDE was one of the first 100 dot-coms and was among the first software product companies to include open source software in its product.</p>
<p>Prior to starting IDE, Tony was a Professor at U.C. San Francisco and  a Lecturer in the computer science division at U.C. Berkeley. His  research areas included software engineering, software development  environments, database management, programming languages, and  human-computer interaction.</p>
<p>Dr. Wasserman earned his Ph.D. in computer sciences from the  University of Wisconsin - Madison and his B.A. in mathematics and  physics from UC Berkeley.</p>
<p>Tony has been selected as both a Fellow of the Association for  Computing Machinery (ACM) and a Life Fellow of the Institute of Electrical  and Electronic Engineers and is often invited to speak at both  industrial and research conferences. He has published dozens of  technical papers, edited nine books, and is the recipient of several  awards for his contributions. He gave the inaugural Stevens Lecture on  Software Development Methods, and was the first recipient of the ACM  SIGSOFT Distinguished Service Award.&nbsp; He is&nbsp; a Board Member of the Open Source Initiative (OSI).</p>
<p>Tony enjoys travel, and often posts his photos on his Flickr page at http://www.flickr.com/photos/tony_wasserman.</p>', '', '', '', 'Work', '415-612-0600', 'Mobile', '415-641-1130', 'Home', '', '', '812', '33', 'f', '', null, null, null, null, '41', '2012-10-02 23:01:18.697622', '2012-09-29 22:17:28.656335', '208.185.179.196', '50.131.57.147', null, null, null, null, null, null, null, null, null, '', null, 'qBp6pdFEiRpspBkd9WjS', '2012-10-02 23:01:18.656842', null, 'length');
INSERT INTO "users" VALUES ('7', 'pcollins@andrew.cmu.edu', 'patricia.collins@sv.cmu.edu', '2008-08-15 18:05:29', '2012-10-01 18:00:12.667465', 't', 'f', 'f', 'PatriciaCollins', 'Patricia', 'Collins', 'Patricia Collins', '/images/staff/PatriciaCollins.jpg', '', '', '', 'f', 'f', null, 't', 'Patricia', 'Carnegie Mellon Silicon Valley ', 'Assistant Professor of the Practice ', 'Moffett Field', 'CA', 'USA', '650-335-2833', 'parhelia94085', 'parhelia', 'patricia.collins@sv.cmu.edu', 'Local', '<p>Patricia Collins is an Assistant Professor of the Practice at  Carnegie Mellon Silicon Valley. Before joining the faculty, she was at  Agilent Laboratories where she conducted research in bio-informatics,  employing knowledge discovery and data mining techniques. Prior to  Agilent, Patricia worked at Hewlett-Packard Laboratories conducting  computer science research in speech recognition, knowledge discovery,  and data mining. She also led internal teams of consultants in advancing  software engineering and business management process practices within  Hewlett-Packard worldwide, specializing in the area of software reuse  methods.</p>
<p>Patricia completed her undergraduate studies at Dickinson College and  obtained her master&rsquo;s degree from Stanford University. She has recently  completed studies in anthropology and ethnography and has partially completed an MFA in creative nonfiction. She is a member of the Phi Kappa Phi honor society.</p>', '<p>&nbsp;</p>
<p><input id="gwProxy" type="hidden" /><input id="jsProxy" onclick="if(typeof(jsCall)==''function''){jsCall();}else{setTimeout(''jsCall()'',500);}" type="hidden" /></p>', 'Bldg 23 121B', 'by arrangement', 'Work', '650-669-2099', 'Mobile', '408-747-0130 ', 'Home', '', '', '7', '32', 'f', '', null, null, null, null, '92', '2012-10-01 18:00:12.660652', '2012-09-13 22:36:14.035207', '209.129.244.250', '50.0.16.116', null, '8', '17', '27', '25', '16', null, null, null, null, null, 'RzEftFusy6bBYaGPmu6i', '2012-10-01 18:00:12.635472', null, null);
