INSERT INTO "users" VALUES ('8', 'bareiss@andrew.cmu.edu', 'ray.bareiss@sv.cmu.edu', '2008-08-15 18:05:29', '2012-08-22 20:58:19.37915', 't', 'f', 'f', 'RayBareiss', 'Ray', 'Bareiss', 'Ray Bareiss', '/images/staff/RayBareiss.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon  Silicon Valley', 'Professor of the Practice and Director of Educational Development ', 'Moffett Field', 'CA', 'USA', '650-335-2801', 'rbareiss ', '', '', 'Local', '<p>Dr. Ray Bareiss is a Professor of the Practice at Carnegie Mellon  Silicon Valley. Ray was formerly Executive Vice President and Senior  Design Architect at Cognitive Arts, in charge of its New York office.  Prior to joining Cognitive Arts, Ray was Assistant Director of the  Institute for the Learning Sciences (ILS) and an Associate Professor of  computer science and education at Northwestern University.</p>
<p>Before joining ILS, he was on the faculty of Vanderbilt University.  As a specialist in computer-based learning environments, corporate  memory and computer-based performance support, cased-based reasoning and  multimedia computing, Ray served as a senior software designer for many  academic and corporate training courses.</p>
<p>Ray holds a Ph.D. in computer sciences and a B.S. in communications  from the University of Texas at Austin. He has worked on academic  e-learning courses for Columbia University in the fields of ESL,  information technology, economics, physics, and psychology, and on  courses for Northwestern University. Ray is the author of a number of  books and articles.</p>', '', 'Bldg 23 - 104', 'Monday 9-7 (in my office) Tuesday 9-7 (in my office) Wednesday-Thursday 9-5 with some exceptions (in my office) and 6-8 pm (by phone) Friday 9-3 with some exceptions (in my office) Saturday and Sunday 9-10 am (by phone) (We have switched to Google Calenda', 'Work', '408-838-9369', 'Mobile', '408-927-7488 ', 'Home', '', '', '1', '14', 'f', '', null, null, null, null, '70', '2012-08-22 20:58:19.370128', '2012-08-16 14:31:19.86402', '24.23.164.134', '24.23.164.134', null, null, null, null, null, null, null, null, null, null, null, 'rCpU3XJWAD7sX8JEe2Kb', '2012-08-22 20:58:19.348315', null, null);
