INSERT INTO "users" VALUES ('12', 'jhm@andrew.cmu.edu', 'jim.morris@sv.cmu.edu', '2008-08-15 18:05:29', '2011-12-04 15:40:49.283812', 't', 'f', 'f', 'JimMorris', 'Jim', 'Morris', 'Jim Morris', '/images/staff/JamesMorris.jpg', '', '', '', 'f', 'f', null, 't', 'James', 'Carnegie Mellon University', 'Professor of the Practice', 'Pittsburgh', 'PA', 'USA', '412-609-5000 ', '', '', '', 'Remote', '<p>Dr. James Morris is a Professor of Computer Science at Carnegie  Mellon&rsquo;s Silicon Valley campus. From 1992 to 2004, he served as  department head and then Dean of the School of Computer Science. He held  the Herbert A. Simon Chaired Professorship of Human Computer  Interaction from 1997 to 2000.</p>
<p>For ten years, Jim worked at the Xerox Palo Alto Research Center  where he was part of the team that developed the Alto System, a  precursor to today&rsquo;s personal computer. From 1983 to 1988, he directed  the Information Technology Center at Carnegie Mellon, a joint project  with IBM, which developed the prototype university computing system,  Andrew. He has been the principal investigator of several NSF and DARPA  projects aimed at computer-mediated communication, and he is a founder  of the MAYA Design Group, a consulting firm specializing in interactive  product design. He consults for Google and Silicon Valley venture  capital firms.</p>
<p>Professor Morris earned his bachelor''s degree from Carnegie Mellon  University, his M.S. in management from MIT, and his Ph.D. in computer  science from MIT. He taught at the University of California at Berkeley  where he developed important underlying principles of programming  languages: Inter-module protection and lazy evaluation. He was a  co-discoverer of the Knuth-Morris-Pratt string searching algorithm.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '5', 'f', '', null, null, null, null, '1', '2011-12-04 15:40:49.281641', '2011-12-04 15:40:49.281641', '24.131.94.171', '24.131.94.171', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('13', 'griss@andrew.cmu.edu', 'martin.griss@sv.cmu.edu', '2008-08-15 18:05:29', '2012-10-01 16:04:51.71779', 't', 'f', 'f', 'MartinGriss', 'Martin', 'Griss', 'Martin Griss', '/images/staff/MartinGriss.jpg', '', '', '', 'f', 'f', '2012-06-29 17:02:13.019776', 't', '', 'Carnegie Mellon Silicon Valley', 'Director', 'Moffett Field', 'CA', 'USA', '650-335-2805', 'reuserabbi', '', '', 'Local', '<p>Dr. Martin L. Griss is the Director of Carnegie Mellon Silicon Valley. With over 35 years of experience in software development, education, and research, Martin spent two decades as Principal Laboratory Scientist at Hewlett-Packard and as Director of HP''s 70-person Software Technology Laboratory. Martin is a leading authority on software reuse and component-based development and led HP&rsquo;s corporate reuse program. Also at HP Labs, where he was widely known as HP&rsquo;s &ldquo;Reuse Rabbi,&rdquo; Martin spearheaded work on software agents, software tools and process, UML standards, and component-based software engineering.</p>
<p>Previously at the University of Utah for nine years as a tenured Associate Professor of computer science, Martin taught software engineering and led research in software engineering, software portability, symbolic computation and compiler development; supervised M.S. and Ph.D. students; and developed and distributed Portable Standard LISP. More recently, he was an Adjunct Professor of computer science at U.C. Santa Cruz, leading research on context-aware intelligent software agent systems.</p>
<p>Martin earned his B.Sc. in mathematics and physics from the Technion in 1967 and a Ph.D. in physics from the University of Illinois in 1971. He has served on the ACM SIGSOFT Executive Committee, a joint ACM/IEEE &ldquo;Software Engineering as Profession&rdquo; taskforce, and numerous program, workshop and tutorial committees. He is co-author of the popular book Software Reuse: Architecture, Process and Organization for Business Success and has published over fifty papers, 60 technical reports, and numerous columns, panels, and tutorials on software reuse, components and agents. He is co-authoring a new book on active software with software agents, and he is a sought-after speaker and consultant, delivering invited talks and tutorials on reuse, software engineering, and software agents at academic, professional, and industry conferences and workshops.</p>', '<p>&nbsp;</p>
<p>&nbsp;</p>
<h2>Hobbies:</h2>
<ul>
<li> Metal work and Jewelry: see <a href="http://info.sv.cmu.edu/twiki/bin/view/Main/%5C%5Cwww.rocks-n-rags.com" target="_top">http:\\www.rocks-n-rags.com</a> </li>
<li> Reading science fiction </li>
</ul>
<p>http://info.sv.cmu.edu/twiki/bin/view/Main/MartinGrissCalendar</p>
<p>http://info.sv.cmu.edu/twiki/bin/view/Main/MartinGrissTaskList</p>', 'Bldg 23 - 216', 'By appointment', 'Work', '650-269-4842', 'Mobile', '650-603-7032', 'Fax', '650-254-1256', 'Home', '348', '11', 'f', '', null, null, null, null, '22', '2012-10-01 16:04:51.619223', '2012-09-22 18:25:31.797723', '209.129.244.250', '76.102.13.18', null, null, null, null, null, null, '2011-12-15 17:05:29.827823', null, null, null, null, 'zzz3w8Q4gPV89cDCAnRX', '2012-10-01 16:04:51.43389', null, null);
