INSERT INTO "users" VALUES ('70', 'schevtts@andrew.cmu.edu', 'sergei.chevtsov@sv.cmu.edu', '2008-08-20 18:35:29', '2008-08-20 18:35:29', 'f', 't', 'f', 'SergeiChevtsov', 'Sergei', 'Chevtsov', 'Sergei Chevtsov', '/images/students/mascot.jpg', '2010', 'SE', 'Tech', 't', null, null, 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', null, null, null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('71', 'gfw@andrew.cmu.edu', 'gary.walters@sv.cmu.edu', '2008-08-20 18:35:29', '2010-10-23 04:18:16.250173', 'f', 't', 'f', 'GaryWalters', 'Gary', 'Walters', 'Gary Walters', '/images/students/2010/SE/GaryWalters.jpg', '2010', 'SE', 'Tech', 't', null, '2010-09-03 17:06:10.257592', 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', '12', null, null, null, null, null, null, '2', '2010-10-23 03:32:54.84324', '2010-08-03 05:48:26.614612', '67.199.180.244', '74.93.0.217', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('72', 'dmiyamot@andrew.cmu.edu', 'daniel.miyamoto@sv.cmu.edu', '2008-08-20 18:35:29', '2010-08-25 05:22:42.000634', 'f', 't', 'f', 'DanielMiyamoto', 'Daniel', 'Miyamoto', 'Daniel Miyamoto', '/images/students/2010/SE/DanielMiyamoto.jpg', '2010', 'SE', 'DM', 't', 'f', null, 'f', '', 'The Boeing Company', 'Software Engineer', 'Seattle', 'WA', 'USA', '425.998.6686', 'autophotomoto', 'dmiyamoto', 'photomoto@gmail.com', 'Remote', '<p>I live in seattle. I''ve grown up in Seattle most of my life, but I did  get my undergrad CE degree from GMI/Kettering in Flint Michigan.</p>
<p>I work at the Boeing Company on defense projects. Currently, I work on  unclassified simulation software, in a windowless TEMPEST shielded  building, so you will need to call my work number during the day if you  want to reach me.</p>
<p>As for fun, I like to play with cars and motorcycles. Taking them apart,  attempting to make them go faster, and spending too much money on them.  I drive a riced out Subaru Impreza and a trick Honda CBR-1000RR  motorcycle. I actively participate in local track days. I also like  photograpy, check out my flickr page to see what ive been upto.</p>', '', null, null, 'Google Voice', '206.544.0883', 'Work', '206.795.0880', 'Mobile', '', '', '72', '4', 'f', '', null, null, null, null, '7', '2010-08-25 05:22:41.744874', '2010-08-03 04:52:02.329184', '76.104.133.155', '76.104.133.155', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('73', 'dxc@andrew.cmu.edu', 'dean.chen@sv.cmu.edu', '2008-08-20 18:35:29', '2010-09-03 17:06:10.809222', 'f', 't', 'f', 'DeanChen', 'Dean', 'Chen', 'Dean Chen', '/images/students/2010/SE/DeanChen.jpg', '2010', 'SE', 'Tech', 't', null, '2010-09-03 17:06:10.708024', 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', '12', null, null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('74', 'nbriggs@andrew.cmu.edu', 'nick.briggs@sv.cmu.edu', '2008-08-20 18:35:29', '2010-09-03 17:06:06.565101', 'f', 't', 'f', 'NickBriggs', 'Nick', 'Briggs', 'Nick Briggs', '/images/students/2010/SE/NickBriggs.jpg', '2010', 'SE', 'Tech', 't', 'f', '2010-09-03 17:06:06.55714', 'f', '', 'TIBCO Software Inc', 'Senior Member Technical Staff', 'Palo Alto', 'CA', 'USA', '650-846-5788', 'nbriggs94301', '', 'Nick.Briggs@sv.cmu.edu', 'Local', '<p>I grew up in Sebastopol, California where I graduated from Analy High  School in 2000.  For my undergrad I attended Stanford University where I  received a BS in computer science in 2004.  I was hired as an intern at  TIBCO Software after graduation and was hired fulltime in December of  2004.  Since then I have worked in the QA department developing a  testing platform, and then as a developer for our Active Matrix SOA  product.</p>', '', null, null, 'Work', '650-454-6719', 'Mobile', '', '', '', '', '74', '13', 'f', '', null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('75', 'aretelle@andrew.cmu.edu', 'andrew.retelle@sv.cmu.edu', '2008-08-20 18:35:29', '2011-12-13 04:39:30.895821', 't', 'f', 'f', 'AndrewRetelle', 'Andrew', 'Retelle', 'Andrew Retelle', '/images/students/2010/SE/AndrewRetelle.jpg', '2010', 'SE', 'Tech', 't', 'f', '2010-09-03 17:06:08.150471', 't', '', 'RSA, the Security Division of EMC', 'Sr. Software Engineer', 'Santa Clara', 'CA', 'USA', '650-823-2754', '', null, 'aretelle@gmail.com', 'Unknown', '', '<p>I graduated from UC Davis with a BS in Computer Science and a BA in Economics.</p>
<p>I graduated from Carnegie Mellon with a MS in Software Engineering in 2010.</p>
<p>For the last 6 years, I have been employed as a Software Engineer in Developer Support at RSA, the Security Division of EMC.&nbsp; In this role, I help customers add security to their applications by using RSA''s various cryptography toolkits.&nbsp; During my time at RSA, I also served briefly as a Sales Engineer.</p>
<p>Previously, I worked as:</p>
<p>a Software Engineer in Quality Support at C-Cube Microsystems, a digital video company that was later aquired by LSI Logic.</p>
<p>a Software Engineer at two failed Internet start-ups.</p>
<p>a Software Engineer in Continuing Engineering at Business Objects, a company that helps customers organize and understand their data.</p>
<p>In my various roles, I have seen a lot of failed projects and bad metrics, so at least I have some idea of what not to do.</p>
<p>In my spare time, I enjoy playing various sports, computer/console games, and board/card games.&nbsp; I''m always looking for a lively game of poker.&nbsp; I have a California real estate license and worked for a while as a agent.&nbsp; I''m currently working on developing my skills as an Android and iOS developer, with the goal of making some interesting phone and tablet games.</p>', '', '', 'Mobile', '', '', '', '', '', '', '75', '19', 't', '', '2011-08-24 00:11:44.18212', null, null, null, '46', '2011-12-13 04:39:30.894764', '2011-12-08 02:14:53.728744', '69.181.139.11', '209.129.244.250', null, null, null, null, null, null, null, null, null, '', null, null, null, null, null);
