INSERT INTO "users" VALUES ('77', 'cme@andrew.cmu.edu', 'chris.ellison@sv.cmu.edu', '2008-08-20 18:35:29', '2011-12-22 17:32:27.493297', 't', 'f', 'f', 'ChrisEllison', 'Chris', 'Ellison', 'Chris Ellison', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/77/profile/cme_dreamliner_rollout.png', '2010', 'SE', 'Tech', 't', 'f', '2010-09-03 17:06:12.14077', 't', '', 'Boeing Commercial Airplanes', 'Software Engineer', 'Everett', 'WA', 'USA', '425-923-6867', 'cmelliso', 'cmelliso', 'cmelliso@ieee.org', 'Remote', '<p><span id="internal-source-marker_0.8816896677017212" style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">I graduated from the University of Illinois with a B.S. in Computer Engineering. &nbsp;I received my M.S. in Software Engineering from Carnegie Mellon Silicon Valley in 2010. &nbsp;My wife and I live in Everett, WA, where I have been working as a software engineer for Boeing Commercial Airplanes since 2004.</span></p>
<p><br /><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: normal; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Since graduating from CMU, I have been spending more time away from my computer screen. &nbsp;In my free time, I have taken up kayaking, biking, and target shooting. &nbsp;When the weather is less pleasant, I spend a lot of time watching movies. &nbsp;I am also trying to return to my more hardware-ish roots by playing with the Arduino and Android platforms.</span></p>', '', '', '', 'Mobile', '425-610-6687', 'Google Voice', '', '', '', '', '77', '19', 't', '', '2011-08-24 00:16:51.508938', null, null, null, '66', '2011-12-22 17:32:27.476291', '2011-12-17 18:06:40.54046', '72.102.118.236', '67.183.94.192', null, null, null, null, null, null, null, 'cme_dreamliner_rollout.png', 'image/png', 'cmelliso', null, null, null, null, null);
INSERT INTO "users" VALUES ('78', 'slray@andrew.cmu.edu', 'steve.l.ray@sv.cmu.edu', '2008-08-20 18:35:29', '2012-03-01 22:25:38.287529', 't', 'f', 'f', 'SteveLRay', 'Steve', 'Ray', 'Steve L. Ray', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/78/profile/steve.jpg', '2010', 'SE', 'Tech', 't', 'f', '2010-09-03 17:06:07.623324', 'f', '', 'Aptina Imaging', 'Sr. Software Engineer', 'San Jose', 'California', 'United States', '585-899-0178', 'Steve.L.Ray', null, '', 'Unknown', '<p>I graduated from the Rochester Institute of Technology&nbsp;with a B.S. in Computer Engineering. &nbsp;I received my M.S. in Software Engineering from Carnegie Mellon Silicon Valley in 2010.</p>
<p>Currenlty I am working at Aptina Imaging as a Sr. Software Engineer, supporting their R&amp;D efforts with CMOS image sensors.</p>', '', '', '', '', '', '', '', '', '', '', '348', '21', 't', '', '2011-08-24 00:16:57.81962', null, null, null, '37', '2011-12-06 04:13:23.017638', '2011-12-01 04:06:40.04453', '71.202.146.246', '209.129.244.250', null, null, null, null, null, null, null, null, null, '', null, null, null, null, null);
INSERT INTO "users" VALUES ('79', 'mgildenh@andrew.cmu.edu', 'matthias.gildenhaar@sv.cmu.edu', '2008-08-20 18:35:29', '2010-09-03 17:06:07.13353', 'f', 't', 'f', 'MatthiasGildenhaar', 'Matthias', 'Gildenhaar', 'Matthias Gildenhaar', '/images/students/2010/SE/MatthiasGildenhaar.jpg', '2010', 'SE', 'Tech', 't', null, '2010-09-03 17:06:07.125015', 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', '12', null, null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('80', 'bagrawal@ANDREW.CMU.EDU', 'bharti.agrawal@sv.cmu.edu', '2008-08-20 18:35:29', '2010-09-03 17:06:08.725321', 'f', 't', 'f', 'BhartiAgrawal', 'Bharti', 'Agrawal', 'Bharti Agrawal', '/images/students/2010/SE/BhartiAgrawal.jpg', '2010', 'SE', 'Tech', 't', 'f', '2010-09-03 17:06:08.712504', 'f', 'Bharti', 'Yahoo!', 'Techincal Yahoo! Senior', 'Sunnyvale', 'CA', 'USA', '650-391-8452', 'bharti.agrawal', 'bagrawal', 'bhartiag@yahoo.com', 'Local', '', '', null, null, 'Mobile', '', '', '', '', '', '', '80', '14', 'f', '', null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('81', 'agrant@andrew.cmu.edu', 'adam.grant@sv.cmu.edu', '2008-08-20 18:35:29', '2011-08-07 06:05:35.758753', 'f', 't', 'f', 'AdamGrant', 'Adam', 'Grant', 'Adam Grant', '/images/students/2010/SE/AdamGrant.jpg', '2010', 'SE', 'Tech', 't', 'f', '2011-01-14 17:06:23.642679', 'f', '', 'Tintri', 'Member of Technical Staff', 'Mountain View', 'CA', 'United States', '510-449-3910', 'djhistrionic', 'cheeseinvert', 'adammgrant@me.com', 'Local', '<p>I was born and raised in Cupertino, CA and attended Cupertino High School, later attending UC Santa Barbara for two years studying Electrical Engineering before transferring to and graduating from UC Berkeley EECS in 2000. Since college I have worked at Network Equipment Technologies (N.E.T.),&nbsp;<span style="border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-color: #d7dbe4; border-style: solid;"><a style="text-decoration: none; color: #b7351e; background-color: transparent; border-top-style: none; border-right-style: none; border-bottom-style: dotted; border-left-style: none; border-width: 1px; border-color: #b7351e;" title="McData (this topic does not yet exist; you can create it)" rel="nofollow" href="http://info.sv.cmu.edu/do/edit/Main/McData?topicparent=Main.AdamGrant">McData</a></span>&nbsp;Corporation,NetApp and now a small startup named Tintri. I live in the Bernal Heights neighborhood of San Francisco and I am passionate about my hobbies of drumming for several bands that play public shows frequently, mountain biking and golf. I love animals and have the pleasure of belonging to two of the greatest European Burmese cats!</p>', '', null, null, 'Mobile', '415-932-6026', 'Home', '', '', '', '', '81', '17', 'f', '', null, null, null, null, '10', '2011-08-07 06:05:35.451084', '2011-05-27 21:21:35.935656', '67.169.44.247', '157.22.22.66', null, '18', '30', '22', '20', '25', null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('82', 'ghilton@andrew.cmu.edu', 'greg.hilton@sv.cmu.edu', '2008-08-20 18:35:29', '2010-09-03 17:06:11.733196', 'f', 't', 'f', 'GregHilton', 'Greg', 'Hilton', 'Greg Hilton', '/images/students/2010/SE/GregHilton.jpg', '2010', 'SE', 'Tech', 't', 'f', '2010-09-03 17:06:11.720527', 'f', '', 'SanDisk Corporation', 'Verification Engineer II', 'Milpitas', 'California', 'USA', '650-430-7646', 'greg.hilton', 'ghilton', 'greg.hilton@sbcglobal.net', 'Local', '<p>I was born and raised in the Bay Area. I go my undergraduate degrees at  Cogswell Polytechnical College in Sunnyvale.  Cogswell was originally in  San Francisco and was founder in 1887; same year as Stanford.  I  majored in Software Engineering and Electrical Engineering.  For a  career I am working a <span>SanDisk</span> as a Verification Engineer for the 3D  memory development team.  Being a Verification Engineer may not sound  like a software development, but my responsibilities are most  programming related using languages line C, C++, Perl, JAVA, SKILL, and <span>SystemVerilog</span>.  As a hobby I do video game  development and weapon practice with friends who are part of a German  renaissance guild.</p>', '', null, null, 'Mobile', '650-383-7646', 'Google Voice', '408-801-2355', 'Work', '', '', '82', '13', 'f', '', null, null, null, null, '7', '2010-08-06 17:08:17.566188', '2010-08-01 04:01:14.868932', '63.163.107.100', '70.231.241.249', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('83', 'gmccreig@andrew.cmu.edu', 'gordon.mccreight@sv.cmu.edu', '2008-08-20 18:35:29', '2009-08-07 18:02:45', 'f', 't', 'f', 'GordonMcCreight', 'Gordon', 'McCreight', 'Gordon McCreight', '/images/students/2009/SE/GordonMcCreight.jpg', '2009', 'SE', 'Tech', 'f', null, null, 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', null, 't', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('84', 'wmcdonal@andrew.cmu.edu', 'will.mcdonald@sv.cmu.edu', '2008-08-20 18:35:29', '2012-08-10 17:02:48.58774', 'f', 't', 'f', 'WillMcDonald', 'Will', 'McDonald', 'Will McDonald', '/images/students/2012/SE/WilliamMcDonald.jpg', '2012', 'SE', 'DM', 't', 'f', '2012-08-10 17:02:48.565934', 't', 'William', 'Audax Health', 'Senior Data Visualization Engineer', 'Washington', 'DC', 'USA', '650-452-8935', 'wmcdon20', 'wmcdonald', '', 'Remote', '<p>I currently work in the Washington DC area at Audax Health, a technology start-up focusing on integrating concepts from gaming and social media into the health and medical field. &nbsp;Before working at Audax Health - I worked within the film/entertainment industry at both ILM and Pixar Animation Studios in the Bay Area. &nbsp;I am currently a graduate student at Carnegie Mellon University - pursuing an MS in Software Engineering at a CMU satellite campus at NASA Ames Research Park in Silicon Valley. Before enrolling at CMU, I have had the privilege of studying at New York University, Savannah College of Art + Design, and the Corcoran College of Art - allowing for a diverse mix of technical and aesthetical study. <br /><br />My past endeavors and current expertise includes work spanning across the medium of computer graphics; with an emphasis on data visualization, fluid simulation / effects, pipeline development, and graphics programming for both film and real-time use. I have additionally conducted research in computer vision, data visualization, usability, and software management.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '84', '13', 'f', '', null, null, null, null, '15', '2012-04-16 04:55:08.642521', '2011-05-26 17:38:35.569034', '50.136.132.230', '66.208.14.74', null, null, null, null, null, null, null, null, null, null, null, 'yWhPzpyrpKBP1Y3yJUDy', '2012-04-16 04:55:08.635945', null, null);
INSERT INTO "users" VALUES ('85', 'kmwalker@andrew.cmu.edu', 'keith.walker@sv.cmu.edu', '2008-08-20 18:35:29', '2010-07-06 00:51:14.41522', 'f', 't', 'f', 'KeithWalker', 'Keith', 'Walker', 'Keith Walker', '/images/students/2010/SE/KeithWalker.jpg', '2010', 'SE', 'DM', 't', 'f', null, 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', null, null, null, null, null, null, null, '1', '2010-07-06 00:51:14.260281', null, '64.134.225.88', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('90', 'jmedford@andrew.cmu.edu', 'jeremy.medford@sv.cmu.edu', '2008-08-20 18:35:29', '2010-09-03 17:06:09.831267', 'f', 't', 'f', 'JeremyMedford', 'Jeremy', 'Medford', 'Jeremy Medford', '/images/students/2010/SE/JeremyMedford.jpg', '2010', 'SE', 'Tech', 't', 'f', '2010-09-03 17:06:09.823126', 'f', '', 'Dolby Laboratories, Inc.', 'Design Engineer', 'San Francisco', 'CA', 'USA', '510-289-6437', 'team.medford', 'jmedford', '', 'Near', '<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li> Improve software development skills as part of a team </li>
<li> Improve writing skills, particularly in expressing ideas more concisely </li>
<li> Develop my leadership and management skills </li>
</ol>
<p>What I''m looking forward to about my educational experience is..... Interacting with a variety of people in the software industry. Getting some exposure to practices and tools that aren''t used in my current workplace. And just being around the buzz of the educational environment...very inspiring and motivating!</p>
<p>&nbsp;</p>
<p>I have been working at Dolby Laboratories, Inc. in San Francisco for a little over two years now. I am part of the Software Test Group in Professional Products. It is quite challenging, but I am looking to get into a development role and in order to fully expand my creative and technical skills.</p>
<p>I have always had a passion for music and art. I played saxophone all through high school as part of the jazz band. During college I took up dj''ing, playing mostly electronic music on vinyl (yep!). I enjoy drawing and painting as well.</p>', '', null, null, 'Mobile', '', '', '', '', '', '', '90', '13', 'f', '', null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
