INSERT INTO "users" VALUES ('114', 'dlcheung@andrew.cmu.edu', 'desmond.cheung@sv.cmu.edu', '2008-08-20 18:35:29', '2008-10-22 00:50:57', 'f', 't', 'f', 'DesmondCheung', 'Desmond', 'Cheung', 'Desmond Cheung', '/images/students/2010/SM/DesmondCheung.jpg', '2010', 'SM', '', 't', 'f', null, 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', null, null, null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('115', 'lsuryana@andrew.cmu.edu', 'lakshmanan.suryanarayanan@sv.cmu.edu', '2008-08-20 18:35:29', '2010-07-29 18:24:02.757316', 'f', 't', 'f', 'LakshmananSuryanarayanan', 'Lakshmanan', 'Suryanarayanan', 'Lakshmanan Suryanarayanan', '/images/students/2010/SM/LakshmananSuryanarayanan.jpg', '2010', 'SM', '', 't', 'f', null, 'f', '', 'Yahoo! Inc.', '', 'Burbank', 'California', 'U.S.A.', '818-524-3493', 'lakshmanan.suryanarayanan', 'lakshmanan', '', 'Remote', '<p>I was born in Chennai and brought up in Mumbai and Pune in India. I did my Bachelor''s in Electronics and Telecommunications Engineering from MIT (Maharashtra Institute of Technology). I worked on building email gateways between X.400, MSMail, CCMail and SMTP email systems for 2 years to launch India''s first X.400 email system, before moving to the US. I came to the US in July 1996 on a consulting assignment and had the first month to get accustomed to the US weather, culture, driving and everything else foreign (bill and checks, the reverse light switches, the wrong side driving, etc.) :-). I took that time to go to the Olympics (Atlanta, 1996) and watched a semifinal basketball game. Did consulting with EDS (Denver, CO), LDDS Worldcom (Jackson, Mississippi), MCI and finally ended up taking a full-time position with AOL in Dulles, VA, where I spent 8 years. While working for AOL, I did my Masters in Computer Science from Virginia Tech. (Go Hokies!). We moved to&nbsp;<a style="text-decoration: underline; color: #3366cc; background-color: transparent;" href="http://info.sv.cmu.edu/do/view/Main/SoCal">SoCal</a>&nbsp;in 2006 and I joined Yahoo!. I am married and have 2 beautiful daughters who are growing up faster than I want them to.:-)</p>', '', null, null, 'Work', '661-ALL-BUZZ', 'Home', '661-644-5681', 'Mobile', '', '', '115', '1', 'f', '', null, null, null, null, '2', '2010-07-29 18:23:16.498794', '2010-07-29 18:22:44.483738', '209.131.61.1', '209.131.61.1', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('116', 'emiranda@andrew.cmu.edu', 'ed.miranda@sv.cmu.edu', '2008-08-20 18:35:29', '2010-05-19 05:16:54', 'f', 't', 'f', 'EdMiranda', 'Ed', 'Miranda', 'Ed Miranda', '/images/students/2010/SM/EdMiranda.jpg', '2010', 'SM', '', 't', 'f', null, 'f', 'Edwin', 'The Boeing Company', 'System Design & Integration Specialist', 'Anaheim', 'CA', 'USA', '714-762-0370 ', 'edmiranda22 ', 'edmiranda', 'edwin.miranda@gmail.com', 'Remote', '<p>Ed Miranda is a System Design and Integration Specialist in the Architecture  &amp; Infrastructure group at Boeing Capital Corporation, a global provider of  innovative financing solutions. A wholly owned subsidiary of the Boeing Company,  Boeing Capital provides comprehensive customer financing support. Born June 22,  1964, Miranda has two children; his daughter is a sophomore at Chapman University  and his son is a junior at USC Viterbi School of Engineering. Miranda re-married on May 4, 2010 to an ER Nurse at Washington Hospital and has two step sons; one studying to be an EMT and the other son a Sonar Tech in the U.S. Navy.&nbsp; Miranda  attended public schools in the Los Angeles Unified School District. Upon high  school graduation, he entered the U.S. Naval Academy in Annapolis, MD. In his  second year, Miranda dropped out of Annapolis to pursue a BS degree in  IT/Quality Assurance from California State University Long Beach. During his  junior and senior years, Miranda interned at <span><a title="McDonnell (this topic does not yet exist; you can create it)" rel="nofollow" href="../../do/edit/Main/McDonnell?topicparent=Main.EdMiranda">McDonnell</a></span> Douglas Corporation, while serving as the  Chairman of the Society of Manufacturing Engineers, which led to a career in  Producibility Engineering. While at Douglas, his interests were steered toward  computing and 4GL programming. Subsequently, Miranda pursued computing  certifications (Microsoft, Novell, Cisco, HP-UX) and served in management and  consulting capacities at the City of Anaheim, Andersen Consulting and <span><a title="PeopleSoft (this topic does not yet exist; you can create it)" rel="nofollow" href="../../do/edit/Main/PeopleSoft?topicparent=Main.EdMiranda">PeopleSoft</a></span>. In 2002 while working at <span><a title="PeopleSoft (this topic does not yet exist; you can create it)" rel="nofollow" href="../../do/edit/Main/PeopleSoft?topicparent=Main.EdMiranda">PeopleSoft</a></span>, Miranda graduated from the University of  Phoenix with an MBA in Technology Management. Miranda left <span><a title="PeopleSoft (this topic does not yet exist; you can create it)" rel="nofollow" href="../../do/edit/Main/PeopleSoft?topicparent=Main.EdMiranda">PeopleSoft</a></span> (1995-2005), after helping transition the  company to Oracle Corporation. In addition to his passion for computing, Miranda  enjoys gardening, sporting/theater events, home improvement and automotive  projects.</p>', '', null, null, 'Work', '714-900-0469 ', 'Mobile', '714-389-0819 ', 'Home', '510-331-0072', 'Mobile', '116', '2', 'f', '', null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
