INSERT INTO "users" VALUES ('143', 'gpanelo@andrew.cmu.edu', 'gerry.panelo@sv.cmu.edu', '2008-09-12 18:52:53', '2012-10-03 00:53:08.308473', 't', 'f', 't', 'GerryPanelo', 'Gerry', 'Elizondo ', 'Gerry Panelo Elizondo', '/images/staff/GerryElizondo.jpg', '', '', '', 'f', 'f', null, 't', 'Geraldine', 'Carnegie Mellon Silicon Valley ', 'Director of Student Affairs ', 'Moffett Field', 'CA', 'USA', '650-335-2846', 'gerrycmusv', '', '', 'Local', '<p>A native Californian, Gerry was raised in Fresno and received her undergraduate degree in Psychology at the University of California at Davis. Interested in working in higher education and student affairs, she received her MEd in College Student Personnel at the University of Maryland and has worked in various institutions, including Holy Names University (Oakland, CA), Eastern Michigan University, and San Francisco Art Institute. Her professional research interests are diversity and multiculturalism and adult/commuter student affairs. She is a member of ACPA - College Student Educators International and serves as Chair for the Commission for Commuter Students and Adult Learners.&nbsp; In her spare time, you can catch Gerry knitting or crocheting or anything artsy!</p>', '', 'Bldg 23 214B', 'M-Th 10:30a - 6:30pm, F 9a - 5p ', 'Work', '415-370-9676 ', 'Mobile', '', '', '', '', '143', '64', 'f', 'Ell-ee-ZAHN-doe', null, null, null, null, '108', '2012-10-03 00:53:08.300995', '2012-10-02 20:51:13.49499', '209.129.244.250', '209.129.244.250', null, '1', '25', '15', '16', '28', null, null, null, '', null, '75bFQspLwBqzH9Bpaspx', '2012-10-03 00:53:08.266173', null, 'semester');
