INSERT INTO "users" VALUES ('182', 'shikhaa@andrew.cmu.edu', 'shikha.agrawal@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:54.808555', 'f', 't', 'f', 'ShikhaAgrawal', 'Shikha', 'Agrawal', 'Shikha Agrawal', '/images/students/2010/FTSE/ShikhaAgrawal.jpg', '2010', 'SE', 'DM', 'f', 'f', '2010-09-03 17:05:54.800503', 'f', '', 'Carnegie Mellon University', 'Graduate Student', 'Mountain View', 'CA', 'USA', '765-409-0108 ', 'shikha777 ', 'shikha777 ', 'shikha.ag@gmail.com', 'Local', '<p>Computers have fascinated me since I was a kid. My bachelors in computer science and engineering, introduced me to the fascinating software world. My first employer was Tata Consultancy Services - TCS (www.tcs.com ). TCS, gave me the opportunity to work as a software analyst in different parts of India and US. In 2008, I quit TCS and started working as a technical lead at Purdue University, Indiana. It was while managing a web portal at this university, that my desire to go back to school strengthened. <br /> <br /> So here I am at CMU Silicon Valley, studying with great talents and learning to be an efficient software manager.<br /> <br /> Hobbies &ndash; I love to play and watch basketball. When I am stressed I spend time with close ones or listen to good music.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '14', 'f', '', null, null, null, null, '1', '2010-07-04 06:49:31.420204', null, '98.248.40.177', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('183', 'mehjabee@andrew.cmu.edu', 'mehjabeen.awan@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:56.170896', 'f', 't', 'f', 'MehjabeenAwan', 'Mehjabeen', 'Awan', 'Mehjabeen Awan', '/images/students/2010/FTSE/MehjabeenAwan.jpg', '2010', 'SE', 'DM', 'f', null, '2010-09-03 17:05:56.162468', 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', '12', null, null, null, null, null, null, '5', '2010-08-01 22:56:54.074737', '2010-07-23 21:12:37.774614', '169.234.65.251', '169.234.114.148', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('184', 'sonac@andrew.cmu.edu', 'sona.chaudhuri@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:55.295824', 'f', 't', 'f', 'SonaChaudhuri', 'Sona', 'Chaudhuri', 'Sona Chaudhuri', '/images/students/2010/FTSE/SonaChaudhuri.jpg', '2010', 'SE', 'DM', 'f', 't', '2010-09-03 17:05:55.234869', 'f', '', 'IBM', 'Services Research Associate', 'San Jose', 'CA', 'USA', '650-388-0589', 'sona310', 'sona310', 'sona310@gmail.com', 'Local', '<p>In 2005, she joined UCLA as a undergraduate in the civil engineering department, but has since switched to computer science. Over the past several years, Sona has completed her B.S. in Computer Science with minors in Classical Civilization and Accounting, worked for the Nasa Ames Research Center, IBM Foster City, and IBM Almaden. This summer, she is working as part of the Extreme Blue Research program in San Jose, CA. In the 12 week duration of her internship, she will work with a team of four to develop a shared whiteboard tool for IBM''s internal chat client. Currently, she is working with IBM''s Services Research Group doing text analytics.</p>', '', null, null, 'Mobile', '925-480-7662', 'Google Voice', '', '', '', '', '184', '13', 'f', '', null, null, null, null, '2', '2010-07-05 19:04:57.296871', '2010-07-02 03:06:28.320592', '128.12.196.94', '67.188.112.85', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('185', 'wdayton@andrew.cmu.edu', 'will.dayton@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:54.234943', 'f', 't', 'f', 'WillDayton', 'Will', 'Dayton', 'Will Dayton', '/images/students/2010/FTSE/WillDayton.jpg', '2010', 'SE', 'DM', 'f', 't', '2010-09-03 17:05:54.091232', 'f', '', '', '', '', '', '', '650-387-2701', 'willdayton', 'willdayton', '', 'Unknown', '<p>I was born in Northern California and grew up in a small town near Lake  Tahoe.  As an undergraduate at Stanford University I studied psychology  and computer science.  Upon graduating in 2007, I became the Lab Manager  for the Stanford Psychophysiology Lab, helping graduate and  postdoctoral psychology students to program experiments that interface  with the lab''s physiology equipment.  Doing so helped me to realize my  love of programming, and I am now a full-time software engineering (DM)  master''s student at Carnegie Mellon Silicon Valley.  In my spare time I  enjoy playing tennis, chess, and am an avid tea enthusiast!</p>', '', null, null, 'Mobile', '', '', '', '', '', '', '185', '16', 'f', '', null, null, null, null, '3', '2010-07-24 03:17:41.689789', '2010-07-05 17:09:00.723396', '75.18.192.69', '209.129.244.250', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('186', 'akjha@andrew.cmu.edu', 'avinash.jha@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:56.608095', 'f', 't', 'f', 'AvinashJha', 'Avinash', 'Jha', 'Avinash Jha', '/images/students/2010/FTSE/AvinashJha.jpg', '2010', 'SE', 'DM', 'f', 'f', '2010-09-03 17:05:56.600162', 'f', '', '', '', '', '', '', '414-628-6596', 'avinashjha05', 'avinashjha05', 'avinashjha05@gmail.com', 'Local', '<p>Born and raised in India with an Army background. Graduated from Army college as a Electronics and Telecommunication Engineer in 2002 and decided against joining the Indian Army. <br />My final year project at Siemens Information Systems Ltd., on &lsquo;Fingerprint recognition systems&rsquo; exposed me to real business software and technological trends. There I worked on development of a biometric device based on fingerprint recognition using fuzzy logic. And after graduation I wanted put my efforts into transforming my project into a viable business product. However, after making consistent progress for six months, we ran out of finances to sustain and develop the business. Since I was a freshly minted engineer with little contacts, I found it difficult to meet our capital requirements. It was very disheartening but I had little options available. I realized the need to gain professional experience and work towards my goals with more intensity and maturity. With a view to achieving this, I joined Infosys Technologies Ltd. as a software engineer to gain real world experience and develop a network for my future aspirations. During my professional career in India and US since then, I worked extensively on challenging projects in wide range of companies and geography, involving different technologies and diverse teams and took responsibility to execute complex projects in a challenging and rich environment with different teams with a wide range of backgrounds and cultures. <br /><br />But the fascinating realm of business inside me never died. In May 2007, the entrepreneurial bug bit me again. This time I started an IT services company Profecialinks, with operations in India. These days i am working on couple more ideas with my friends and to come up with something new <br /><br />Here at CMU I intend to stay attuned with the latest principles and techniques of both technology and management along with making some friends for the lifetime</p>', '', null, null, 'Mobile', '', '', '', '', '', '', '186', '13', 'f', '', null, null, null, null, '1', '2010-07-02 20:45:40.316912', null, '209.129.244.250', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('187', 'fji@andrew.cmu.edu', 'feng.ji@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:57.041898', 'f', 't', 'f', 'FengJi', 'Feng', 'Ji', 'Feng Ji', '/images/students/2010/FTSE/FengJi.jpg', '2010', 'SE', 'DM', 'f', 'f', '2010-09-03 17:05:57.02189', 'f', '', 'Carnegie Mellon Silicon Valley', '', 'Mountain View', 'CA', 'USA', '408-646-3211', 'jifeng10617199', 'jojojifeng', 'feng.ji@sv.cmu.edu', 'Local', '', '', null, null, 'Mobile', '', '', '', '', '', '', '187', '14', 'f', '', null, null, null, null, '4', '2010-08-06 18:51:48.881039', '2010-07-16 20:48:29.637211', '69.181.139.148', '209.129.244.250', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
