INSERT INTO "users" VALUES ('189', 'cmaciel@andrew.cmu.edu', 'cejana.maciel@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:58.022478', 'f', 't', 'f', 'CejanaMaciel', 'Cejana', 'Maciel', 'Cejana Maciel', '/images/students/2010/FTSE/CejanaMaciel.jpg', '2010', 'SE', 'DM', 'f', 'f', '2010-09-03 17:05:58.014441', 'f', 'Cejana', 'Carnegie Mellon Silicon Valley', 'Graduate Student', 'Mountain View', 'CA', 'USA', '650-295-9911', 'cjlobo3', 'Cejana', 'cejanalobo@gmail.com', 'Local', '', '', null, null, 'Mobile', '', '', '', '', '', '', '189', '14', 'f', '', null, null, null, null, '3', '2010-07-31 04:51:34.090524', '2010-07-10 16:42:09.16662', '69.181.252.120', '69.181.252.120', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('190', 'spissaye@andrew.cmu.edu', 'sunilkumar.pissaye@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:57.5848', 'f', 't', 'f', 'SunilKumarPissaye', 'Sunil Kumar', 'Pissaye', 'Sunil Kumar Pissaye', '/images/students/2010/FTSE/SunilKumarPissaye.jpg', '2010', 'SE', 'DM', 'f', 't', '2010-09-03 17:05:57.526385', 'f', 'Sunil Kumar', 'Carnegie Mellon University', 'Research Assistant', 'Mountain View', 'California', 'US', '510-709-6893', 'sunil.kumar.p.v', 'maverick_03', 'sunilkumar.pissaye@sv.cmu.edu', 'Local', '<p>I was born and raised in Bangalore, India. My interest in computers goes back to the summer of 1997 when I first worked on a computer.. I did my Bachelor of Engineering in Computer Science from B.M.S college of engineering in Bangalore. I have close to 3 years of experience in web development. My technical strong points are in Java, <span><a title="J2EE (this topic does not yet exist; you can create it)" rel="nofollow" href="http://info.sv.cmu.edu/do/edit/Main/J2EE?topicparent=Main.SunilKumarPissaye">J2EE</a></span> and design.. If am working on something really interesting I can go days without sleep.. I am an aspiring entrepreneur, hope to start a company back in Bangalore.. I love reading, cycling, trekking, climbing, hiking, listening to music, learning something new.. I am interested in pastel sketching and charcoal sketching (yet to learn though)..</p>', '', null, null, 'Mobile', '', '', '', '', '', '', '190', '14', 'f', '', null, null, null, null, '2', '2010-07-05 05:51:37.885422', '2010-07-02 00:33:51.719328', '75.13.119.22', '209.129.244.250', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
