INSERT INTO "users" VALUES ('197', 'mtasnima@andrew.cmu.edu', 'tasnima.mallu@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:49.755957', 'f', 't', 'f', 'TasnimaMallu', 'Tasnima', 'Mallu', 'Tasnima Mallu', '/images/students/2010/FTSE/TasnimaMallu.jpg', '2010', 'SE', 'Tech', 'f', 'f', '2010-09-03 17:05:49.746616', 'f', '', 'Carnegie Mellon', 'Student', '', '', '', '650-454-5350', 'tmallu', '', '', 'Unknown', '', '', null, null, 'Mobile', '', '', '', '', '', '', '197', '15', 'f', '', null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('198', 'epayzer@andrew.cmu.edu', 'eliezer.payzer@sv.cmu.edu', '2009-08-17 16:48:45', '2009-10-29 03:44:03', 'f', 't', 'f', 'EliezerPayzer', 'Eliezer', 'Payzer', 'Eliezer Payzer', '/images/students/mascot.jpg', '2010', 'SE', 'Tech', 'f', 'f', null, 'f', '', '', '', '', '', '', 'xxx-xxx-xxxxx', '', '', '', 'Unknown', '', '', '', '', '', '', '', '', '', '', '', '1', '1', null, null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('199', 'rpreed@andrew.cmu.edu', 'russel.reed@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:50.812289', 'f', 't', 'f', 'RusselReed', 'Russel', 'Reed', 'Russel Reed', '/images/students/2010/FTSE/RusselReed.jpg', '2010', 'SE', 'Tech', 'f', 't', '2010-09-03 17:05:50.804336', 'f', '', '', '', 'Mountain View ', 'California', 'USA', '501-680-1371', 'fahorblingrads', 'rreed', '', 'Unknown', '<p>I was born and raised in a small town in Arkansas. I attended college at Hendrix College in Conway, Arkansas, and graduated in 2007. After that, I interned at Google through a partner, Friedrich Software Resources. Now, here I am. My life in four/five sentences.<br /> <br /> For fun, I''m a big musician, music fan, and gamer. If you want to recommend me music (and I''ll listen to anything you say, if I haven''t heard it), go ahead; if you want to play something with me (current game of choice: BlazBlue<span>&nbsp;</span>), we should.  Woo.</p>
<p>&nbsp;</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '14', 'f', null, null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('200', 'gsalas@andrew.cmu.edu', 'memo.salas@sv.cmu.edu', '2009-08-17 16:48:45', '2010-10-08 13:38:34.767921', 'f', 't', 'f', 'MemoSalas', 'Memo', 'Salas', 'Memo Salas', '/images/students/2010/FTSE/MemoSalas.jpg', '2010', 'SE', 'Tech', 'f', 'f', '2010-09-03 17:05:53.063995', 'f', 'Guillermo', '', '', '', '', '', '650-391-4676', 'memo_salas', 'memo', 'memo.salas@gmail.com', 'Local', '<p>Born in Mexico City, Guillermo "memo" Salas should have paid more attention to his geography lessons, instead he spent countless hours saving the universe in Origin videogames of the 90''s. He graduated from college as a Mechanical Engineer and immediately moved to Atlanta, GA to work for a network monitoring and control software company. Shortly after, life brought him back to Mexico City where he served as a sysadmin at a company in the financial sector for 3 years. Now he''s enrolling in this program because he wants to work on his software developer persona.</p>', '<p>"memo" likes movies by Quentin Tarantino and actively seeks to incorporate the director''s style into his life. Unsurprisingly, he recently became engaged to the beautiful do&ntilde;a Paulita Perez, who''ll gracefully await his return back in Mexico City after he graduates. In the meantime, memo will be very busy learning all he can from his peers and mentors at CMU-SV .</p>', null, null, 'Mobile', '650-469-3856', 'Google Voice', '', '', '', '', '200', '13', 'f', '', null, null, null, null, '2', '2010-07-09 22:06:37.948023', '2010-07-05 07:57:56.425119', '209.129.244.250', '208.54.5.66', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('201', 'jwang4@andrew.cmu.edu', 'jing.wang@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:52.149814', 'f', 't', 'f', 'JingWang', 'Jing', 'Wang', 'Jing Wang', '/images/students/2010/FTSE/JingWang.jpg', '2010', 'SE', 'Tech', 'f', null, '2010-09-03 17:05:52.141666', 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', '12', null, null, null, null, null, null, '4', '2010-08-02 05:36:48.665629', '2010-07-19 00:37:57.501021', '69.181.65.171', '69.181.65.171', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('202', 'xreigarm@andrew.cmu.edu', 'xavi.reig@sv.cmu.edu', '2009-08-17 16:48:45', '2010-09-03 17:05:55.754354', 'f', 't', 'f', 'XaviReigArmero', 'Xavi', 'Reig Armero', 'Xavi Reig Armero', '/images/students/2011/SE/XaviReigArmero.jpg', '2010', 'SE', 'DM', 'f', 'f', '2010-09-03 17:05:55.746135', 'f', '', 'Microsoft', 'Program Manager', 'Seattle', 'Washington', 'USA', '650-229-4255', 'xavier.reig', '', 'xavier.reig@gmail.com', 'Local', '<p>I grew up in a very small town near Barcelona, in Spain. When I turned eighteen, I moved to Barcelona to study Computer Science for five years. Before finishing my undergraduate studies, I started working in T-Systems, the software division of Deutsche Telekom, which also owns T-Mobile. As an assistant of a project manager, I worked preparing offers for big clients and monitoring their economical costs.</p>
<p style="background-color: transparent;">By the second year of my undergraduate studies, the idea of travelling to Silicon Valley came up. Some years after that dream I am here to learn from the best and become a well-prepared professional in the Project Management field.</p>
<p style="background-color: transparent;">What''s next? I don''t know. I''ll try to enjoy as much as I can from classmates, CMU and USA, and then just switch again to another place.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '202', '14', 'f', '', null, null, null, null, '1', '2010-07-05 00:54:05.388049', null, '75.18.189.179', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('203', 'adambird@andrew.cmu.edu', 'adam.bird@sv.cmu.edu', '2009-08-17 16:48:45', '2011-09-23 20:40:59.481626', 'f', 't', 'f', 'AdamBird', 'Adam', 'Bird', 'Adam Bird', '/images/students/2011/SE/AdamBird.jpg', '2011', 'SE', 'DM', 't', 'f', '2011-09-23 17:06:25.35737', 'f', '', 'Lockheed Martin', 'Engineering Leadership Development Program (LDP)', '', 'AZ', '', '435-881-8781', 'bird.adam', '', 'adam.bird@sv.cmu.edu', 'Remote', '<html />', '<html />', null, null, 'Mobile', '623-925-7329', 'Work', '', '', '', '', '203', '22', 't', '', null, null, null, null, '4', '2011-06-29 01:29:07.173205', '2011-05-29 07:11:28.612174', '192.91.173.36', '184.98.92.66', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('204', 'dhebb@andrew.cmu.edu', 'daniel.hebb@sv.cmu.edu', '2009-08-17 16:48:45', '2011-09-23 20:40:59.151325', 'f', 't', 'f', 'DanielHebb', 'Daniel', 'Hebb', 'Daniel Hebb', '/images/students/2011/SE/DanielHebb.jpg', '2011', 'SE', 'DM', 't', 'f', '2011-09-23 17:06:15.337846', 'f', '', 'Lawrence Livermore National Laboratory', 'Software Engineer', 'Livermore', 'CA', '', '484-791-2084', 'daniel_hebb', 'dth138', 'daniel.hebb@gmail.com', 'Local', '<p>I grew up outside Philadelphia and moved out here after my undergrad at Pennstate in Computer Engineering.&nbsp; I found a job out here right away and never really looked back.&nbsp; I''ve lived in both Northern and Southern California at this point.&nbsp; The cool jobs are in NorCal, but the fun times are in SoCal so I''m down south very often.</p>', '', null, null, 'Mobile', '', '', '', '', '', '', '204', '18', 't', '', null, null, null, null, '27', '2011-07-30 05:35:38.635162', '2011-07-29 01:47:27.256068', '76.21.20.178', '209.129.244.250', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('205', 'mylai@andrew.cmu.edu', 'mark.lai@sv.cmu.edu', '2009-08-17 16:48:45', '2011-09-23 20:40:58.019371', 'f', 't', 'f', 'MarkLai', 'Mark', 'Lai', 'Mark Lai', '/images/students/2011/SE/MarkLai.jpg', '2011', 'SE', 'DM', 't', 'f', '2011-09-23 17:05:38.907857', 'f', '', 'Eyefinity Officemate ', 'Systems Architect', 'Rancho Cordova (Sacramento area)', 'CA', '', '(415) 754-3686', 'mark.mjlai', 'mlai', 'mark.lai@sv.cmu.edu', 'Remote', '', '', null, null, 'Google Voice', '', '', '', '', '', '', '205', '20', 't', '', null, null, null, null, '14', '2011-07-13 15:05:22.212102', '2011-06-16 06:45:55.573025', '66.205.132.198', '66.205.132.198', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('206', 'mpl@andrew.cmu.edu', 'matt.lanken@sv.cmu.edu', '2009-08-17 16:48:45', '2011-09-23 20:40:59.412513', 'f', 't', 'f', 'MattLanken', 'Matt', 'Lanken', 'Matt Lanken', '/images/students/2011/SE/MatthewLanken.jpg', '2011', 'SE', 'DM', 't', 'f', '2011-09-23 17:06:21.032747', 'f', 'Matthew', 'Oracle America, Inc', 'Senior Member of Technical Staff', 'Redwood Shores', 'CA', 'USA', '650-759-4572', 'mlanken', 'mlanken', 'mlanken@gmail.com', 'Local', '<p>I grew up near Philadelphia, PA and went to school at Carnegie Mellon in  Pittsburgh. Upon graduating, I came to the bay area to work for Oracle.   I''ve always enjoyed working on small software projects and hope to  create something really cool someday!</p>', '<p>I''d like to accomplish the following three goals (professional or  personal) by the time I graduate:</p>
<ol>
<li> Become a better public speaker by practicing whenever possible! </li>
<li> Learn to manage my time efficiently </li>
<li> Run a marathon </li>
</ol>
<p>What I''m looking forward to about my educational experience is.....</p>
<p>Learning about software engineering?</p>', null, null, 'Mobile', '', '', '', '', '', '', '206', '19', 't', '', null, null, null, null, '14', '2011-07-28 17:17:23.62522', '2011-07-14 01:34:36.724466', '148.87.19.206', '99.59.179.60', null, '25', '23', '28', '22', '4', null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('262', 'ssuterwa@andrew.cmu.edu', 'shabbir.suterwala@sv.cmu.edu', '2009-08-17 16:48:46', '2011-09-23 20:40:37.89225', 'f', 't', 'f', 'ShabbirSuterwala', 'Shabbir', 'Suterwala', 'Shabbir Suterwala', '/images/students/2011/SM/ShabbirSuterwala.jpg', '2011', 'SM', null, 't', 'f', null, 'f', '', 'Cisco Systems', '', '', '', '', '408-829-4825', 'shabbir.suterwala', '', '', 'Local', '', '', null, null, 'Mobile', '', '', '', '', '', '', '262', '2', 't', '', null, null, null, null, '8', '2011-08-09 21:18:57.743754', '2011-05-20 17:41:59.162116', '173.36.196.6', '128.107.239.234', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('207', 'rnigam1@andrew.cmu.edu', 'raj.nigam@sv.cmu.edu', '2009-08-17 16:48:45', '2011-11-02 18:48:34.584814', 'f', 't', 'f', 'RajNigam', 'Raj', 'Nigam', 'Raj Nigam', '/images/students/2011/SE/RajarshiNigam.jpg', '2011', 'SE', 'DM', 't', 'f', '2011-09-23 17:06:08.109211', 'f', 'Rajarshi', 'Lockheed Martin', 'Engineering LDP', 'Gaithersburg', 'Maryland', 'United States', '213-863-4556', 'rajington', 'rajington', 'raj@nigam.com', 'Remote', '<p>Before deciding on engineering I planned on becoming a doctor or pharmacist. I volunteered at a hospital pharmacy and later worked as a technician. My desires changed when I realized I was devoting more time on the process improvement side of things, especially the increasingly technical part of the job, rather than on the medical side. I attended the University of Virginia where I majored in Cognitive Science, Computer Science, and Computer Engineering with a minor in Business. During my summers I interned at Lockheed Martin, where I accepted a full-time position into the Engineering Leadership and Development Program. I''ve done rotations in areas such as distributed fusion and wireless sensor networks, evolutionary algorithms, geospatial intelligence, system integration and test, and smartphone development. I hope to graduate from the program and CMU in the summer of 2011.</p>', '', null, null, 'Mobile', '', '', '', '', '', '', '207', '19', 't', 'Rodge / Roger - She', null, null, null, null, '9', '2011-11-02 18:48:34.582549', '2011-08-01 09:08:04.436261', '204.68.144.233', '80.98.106.235', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
