INSERT INTO "users" VALUES ('211', 'tsai1@ANDREW.CMU.EDU', 'kevin.tsai@sv.cmu.edu', '2009-08-17 16:48:45', '2011-09-23 20:40:58.341745', 'f', 't', 'f', 'KevinTsai', 'Kevin', 'Tsai', 'Kevin Tsai', '/images/students/2011/SE/KevinTsai.jpg', '2011', 'SE', 'DM', 't', 'f', '2011-09-23 17:05:44.399117', 'f', 'Kevin', 'cBio', '', 'Taipei', '', 'TW', '510-735-6669', 'Keceltes', 'Keceltes', 'kevin.j.tsai@gmail.com', 'Remote', '', '', null, null, 'Mobile', '', '', '', '', '', '', '211', '21', 't', '', null, null, null, null, '34', '2011-06-29 20:17:17.241631', '2011-06-23 01:31:08.946086', '75.37.64.31', '75.37.64.31', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('212', 'dtwum@andrew.cmu.edu', 'twum.djin@sv.cmu.edu', '2009-08-17 16:48:45', '2011-09-23 20:40:58.797813', 'f', 't', 'f', 'TwumDjin', 'Twum', 'Djin', 'Twum Djin', '/images/students/2011/SE/DjinTwum.jpg', '2011', 'SE', 'DM', 't', 'f', '2011-09-23 17:06:05.396521', 'f', 'Twum', 'Google Inc', 'Software Engineer', 'Mountain View', 'CA', 'USA', '650-253-1944', 'twumdjin', 'twumdjin', 'twum.djin@sv.cmu.edu', 'Local', '<p>I was born in Accra, Ghana.&nbsp;I moved to the States after high school. I graduated from Dartmouth College with a bachelors in Computer Science and Engineering. I''ve since been working as a Software Engineer at Google.</p>
<p>My career at Google started out as an individual contributor on Google Checkout, a payments service. I worked on the consumer frontend and later on internationalizing the product for the UK market, and then on the product''s system architecture.</p>
<p>I''ve since been working on various aspects of Google''s billing and payments platform that services several Google products and internal customers. I''m currently the Tech Lead for the platform effort.</p>', '', '', '', 'Work', '413-687-8235', 'Mobile', '', '', '', '', '1', '21', 't', 'Chu:m Gin  (Rhymes with room)', null, null, null, null, '18', '2011-07-24 14:04:32.784419', '2011-07-24 14:04:32.360512', '67.188.31.106', '67.188.31.106', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
