INSERT INTO "users" VALUES ('214', 'shooujoy@andrew.cmu.edu', 'john.yu@sv.cmu.edu', '2009-08-17 16:48:46', '2010-09-03 17:05:51.701679', 'f', 't', 'f', 'JohnYu', 'John', 'Yu', 'John Yu', '/images/students/2011/SE/JohnYu.jpg', '2010', 'SE', 'Tech', 'f', 'f', '2010-09-03 17:05:51.693292', 'f', '', '', '', '', '', '', 'xxx-xxx-xxxxx', '', '', '', 'Unknown', '', '', '', '', '', '', '', '', '', '', '', '1', '13', 'f', '', null, null, null, null, '1', '2010-07-03 22:12:28.920637', null, '75.36.155.29', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('215', 'hbarnor@andrew.cmu.edu', 'henry.barnor@sv.cmu.edu', '2009-08-17 16:48:46', '2011-11-04 03:15:15.133102', 'f', 't', 'f', 'HenryBarnor', 'Henry', 'Barnor', 'Henry Barnor', '/images/students/2011/SE/HenryBarnor.jpg', '2011', 'SE', 'Tech', 't', 'f', '2011-09-23 17:06:00.979816', 'f', '', 'Altera', '', 'Mounatin View', 'CA', '', '201-490-7469', 'disterics', 'henry.barnor@sv.cmu.edu', 'henry.barnor@sv.cmu.edu', 'Local', '<p>I was raised by sheepherders on the hills of BoingBoing while they were  selling chunky bacon. I need help with putting on my clothes because I  have a ring. My first job was a pig farmer. After working hard they  promoted me to garbage man. They told me the reason for this new  responsibility was show me the money.  I looked for a treasure map and  tools, but I never did find the booty. People''s trash clearly isn''t  multitudinous. I hope to go to college so that I can put my real  biography here.</p>', '', null, null, 'Mobile', '', '', '', '', '', '', '215', '19', 't', '', null, null, null, null, '8', '2011-11-04 03:15:15.131426', '2011-07-04 08:49:17.638949', '69.111.195.65', '67.117.145.200', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
