INSERT INTO "users" VALUES ('220', 'skarp@andrew.cmu.edu', 'sam.karp@sv.cmu.edu', '2009-08-17 16:48:46', '2011-09-23 20:40:59.601828', 'f', 't', 'f', 'SamKarp', 'Sam', 'Karp', 'Sam Karp', '/images/students/2011/SE/SamKarp.jpg', '2011', 'SE', 'Tech', 't', 'f', '2011-09-23 17:06:31.992504', 'f', '', '', 'Software Engineer', 'Denver', 'CO', '', '720-951-4699', 'sam.d.karp', 'samkarp', 'sam.karp@west.cmu.edu', 'Remote', '<p>I graduated with a BS in Computer Engineering from the University of Illinois in 2007 and moved out to the Rocky Mountains shortly after to work for Lockheed Martin. There I have been working on software systems for over two years. I am also a huge fan of my wife and the Pittsburgh Steelers.</p>', '', null, null, 'Mobile', '', '', '', '', '', '', '220', '20', 't', '', null, null, null, null, '20', '2011-08-07 15:31:11.707026', '2011-08-04 17:14:58.219476', '71.33.147.104', '192.91.173.42', null, '11', '18', '25', '1', '33', null, null, null, null, null, null, null, null, null);
