INSERT INTO "users" VALUES ('223', 'amak@andrew.cmu.edu', 'alan.mak@sv.cmu.edu', '2009-08-17 16:48:46', '2011-09-23 20:40:58.528473', 'f', 't', 'f', 'AlanMak', 'Alan', 'Mak', 'Alan Mak', '/images/students/2011/SE/AlanMak.jpg', '2011', 'SE', 'Tech', 't', 'f', '2011-09-23 17:05:52.791294', 'f', '', 'McKesson Corp.', 'Software Engineer', 'Emeryville', 'CA', 'USA', '415-299-2777', 'alanhmak', 'alan.mak@sv.cmu.edu', '', 'Local', '', '', null, null, 'Mobile', '', '', '', '', '', '', '223', '19', 't', '', null, null, null, null, '8', '2011-07-26 02:30:09.178926', '2011-07-02 16:17:25.260137', '71.198.104.92', '71.198.104.92', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('224', 'dmelande@andrew.cmu.edu', 'darryl.melander@sv.cmu.edu', '2009-08-17 16:48:46', '2011-09-23 20:40:59.902569', 'f', 't', 'f', 'DarrylMelander', 'Darryl', 'Melander', 'Darryl Melander', '/images/students/2011/SE/DarrylMelander.jpg', '2011', 'SE', 'Tech', 't', 'f', '2011-09-23 17:06:37.424269', 'f', '', 'Sandia National Laboratories', 'Technical Staff Member', 'Albuquerque', 'NM', 'USA', '505-293-5169', 'darryl.melander', 'melander', 'darryl.melander@sv.cmu.edu', 'Remote', '<p>I originally intended to design bridges for a living.&nbsp; During my final year as an undergraduate civil engineering student, when classes started to resemble what I''d be doing in the real world, I realized I didn''t want to be a structural engineer after all.&nbsp; Changing my focus to software without abandoning my engineering background, I became involved with a finite element mesh generation project (http://cubit.sandia.gov).&nbsp; Over time my interests and responsibilities drifted further away from structural engineering and toward software engineering.&nbsp; I''ve now been writing software professionally for 15 years, but I still don''t consider myself to be a true software engineer.&nbsp; By pursuing a masters degree in software engineering, my transformation from bridge builder to application builder will be complete and official.</p>', '', null, null, 'Home', 'None', 'Mobile', '', '', '', '', '224', '23', 't', 'Meh LAND er', null, null, null, null, '15', '2011-07-29 14:28:59.573875', '2011-06-30 01:53:28.512553', '198.102.153.2', '107.4.33.139', null, '4', '25', '30', '24', '28', null, null, null, null, null, null, null, null, null);
