INSERT INTO "users" VALUES ('226', 'vshiriki@andrew.cmu.edu', 'vache.shirikian@sv.cmu.edu', '2009-08-17 16:48:46', '2011-09-23 20:40:59.355388', 'f', 't', 'f', 'VacheShirikian', 'Vache', 'Shirikian', 'Vache Shirikian', '/images/students/2011/SE/VacheShirikian.jpg', '2011', 'SE', 'Tech', 't', 'f', '2011-09-23 17:06:20.185907', 'f', '', 'Lockheed Martin', 'Software Engineer', 'Sunnyvale', 'CA', 'USA', '925-785-6054', 'vshirikian', 'vshirikian', 'vshirikian@gmail.com', 'Local', '<p>I am a honest, down to earth, curious guy. My SE background is not  rooted in one specific area. I have experience with many platforms and  programming languages but one of my objectives in grad school is to  discover a SE field that I am passionate about and can specialize in. I  would say my greatest asset is my ability to learn and adapt quickly. I  am currently getting my hands dirty with a few web apps, coding  real-time satellite ground system software for Lockheed Martin''s MUOS  program (<a href="http://en.wikipedia.org/wiki/Mobile_User_Objective_System" target="_top">http://en.wikipedia.org/wiki/Mobile_User_Objective_System</a>), evolving/managing a data center for MUOS, and  configuring/managing custom application servers for friends/business.<br /> <br /> BS, Computer Science, University of California San Diego, 2007.<br /> Software and Computer Systems Engineer, Lockheed Martin Space Systems,  Sunnyvale, CA, 2007 - present.<br /> <br /> Some hobbies include basketball, racquetball, hacking my geek toys, and  spending time with family/friends.</p>', '<p>"The important thing is not to stop questioning, curiosity has it''s own   reason for existing." -Albert Einstein</p>', null, null, 'Mobile', '408-756-3833', 'Work', '', '', '', '', '226', '21', 't', 'Vah-chay', null, null, null, null, '32', '2011-08-04 07:53:43.397499', '2011-08-04 07:53:38.045921', '67.174.249.93', '67.174.249.93', null, '1', '7', '10', '33', '2', null, null, null, null, null, null, null, null, null);
