INSERT INTO "users" VALUES ('264', 'arunv@andrew.cmu.edu', 'arun.varshney@sv.cmu.edu', '2009-08-17 16:48:46', '2011-09-23 20:40:37.965492', 'f', 't', 'f', 'ArunVarshney', 'Arun', 'Varshney', 'Arun Varshney', '/images/students/2011/SM/ArunVarshney.jpg', '2011', 'SM', null, 't', null, null, 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', '2', 't', null, null, null, null, null, '1', '2011-01-03 05:09:42.901216', null, '99.104.125.150', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('288', 'chihhunl@andrew.cmu.edu', 'chihhung.lin@sv.cmu.edu', '2009-08-27 19:13:23', '2010-12-05 22:40:07.388944', 'f', 't', 'f', 'ChihHungLin', 'Chih-Hung', 'Lin', 'Chih-Hung Lin', '/images/students/INI/MSIT-21/ChihHungLin.jpg', '2011', 'INI', '', 'f', 'f', '2010-11-26 17:06:15.384221', 't', '', '', '', '', '', '', 'xxx-xxx-xxxxx', '', 'chihhunl', '', 'Unknown', '', '', '', '', '', '', '', '', '', '', '', '288', '4', 'f', '', null, null, null, null, '2', '2010-11-28 23:20:31.365332', '2010-08-26 17:52:28.70055', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('231', 'paulwong@andrew.cmu.edu', 'paul.wong@sv.cmu.edu', '2009-08-17 16:48:46', '2011-09-23 20:40:59.515145', 'f', 't', 'f', 'PaulWong', 'Paul', 'Wong', 'Paul Wong', '/images/students/2011/SE/PaulWong.jpg', '2011', 'SE', 'Tech', 't', 'f', '2011-09-23 17:06:26.286435', 'f', '', 'Lockheed Martin', '', 'San Jose', 'CA', 'USA', '415-602-1846', 'paulsfds', 'paulsfds', 'paulsfds@gmail.com', 'Local', '', '<p>I''d like to accomplish the following three goals (professional or  personal) by the time I graduate:</p>
<ol>
<li> Gain a great depth of software development knowledge and practical  experience.</li>
<li> Learn how to effectively lead a team and gain experience  working in many diverse teams.</li>
<li> Meet new people, build effective relationships, and make long  lasting friends.</li>
</ol>
<p>What I''m looking forward to about my educational experience is learning  and trying new things.</p>', null, null, 'Mobile', '', '', '', '', '', '', '231', '19', 't', '', null, null, null, null, '16', '2011-07-26 20:01:17.627068', '2011-06-02 01:22:58.798109', '76.102.226.25', '209.129.244.250', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('232', 'aariana@andrew.cmu.edu', 'amin.ariana@alumni.cmu.edu', '2009-08-17 16:48:46', '2011-09-23 20:40:37.092004', 'f', 't', 'f', 'AminAriana', 'Amin', 'Ariana', 'Amin Ariana', '/images/students/2011/SM/AminAriana.jpg', '2011', 'SM', null, 't', 'f', null, 'f', '', 'Google', 'Software Engineer', 'San Francisco', 'California', 'USA', '', 'amin_ariana', 'darxider', 'aminka@gmail.com', 'Near', '<p>I was born in Iran, in the short period between the 1979 revolution and the 1980 Iran-Iraq war. How is that for drama? I have a lot of happy memories growing up, the walls of which are casually painted with 8 years of war that claimed a million lives.<br /><br />In the aftermath, economic opportunities were wiped out, the country was facing a brain-drain and the boundaries of free-speech were continuing to collapse. My entertainment was studying math until 1992 when I was 12 and got my hands on the first PC I ever encountered, and then studying computer languages until I was 17.<br /><br />When I was 17 my family immigrated to Toronto, Canada, looking for a stable economy and education opportunities for my younger sister and me. Early in 1998 I had a blog and a social networking web site I created in ASP with a MS-Access back-end. I had many followers, but had no idea how to scale it. The world caught up and soon these innovations were yesterday''s news.<br /><br />After two years of high school in Canada, I attended the University of Waterloo as an undergraduate in the Honors Computer Science program. I did a few internships and found myself also interested in Psychology. I graduated with a Bachelors in Computer Science and met all the requirements for a General Psychology degree. I also became a Canadian citizen during my education. I started to work locally for a while.<br /><br />Early in my career I knew that I wanted to have a high impact on the world. I decided that the first step in that direction was to practice what I had learned in a place with a large audience and good practices. I had an exhausting 7 hour technical interview with Microsoft and got accepted for a position as a Software Design Engineer. I packed my bags, said goodbye to friends and family, and moved to Seattle, Washington in 2006. This was swimming against the flow: in the post 9/11 world in the US, people of my birth place were not welcome at the border.<br /><br />In my two years at Microsoft, I learned a great deal about design, best practices and people. The amazing thing about it was the many people I could learn from, not just about work, but about a fulfilling personal life as well. I also discovered more about myself. I realized that besides a good challenge and high impact, I enjoy other things. I also enjoy things such as knowing most of the peers I work with, recognition for what I do, dealing with the market directly and improvement in skills beyond only the technical ones. After a lot of self-exploration, I realized that my place is probably in a smaller entrepreneurial environment where I can face the free market more directly and thrive and grow.<br /><br />In 2009 I packed my bags yet again and headed for Silicon Valley. Inspired by the essays of Paul Graham and moved by the democratic movement in my birth country of Iran, I knew I needed to be in the hub that commands change in the world. I wanted to be a part of it. Right before my move, I had a phone conversation with Dr. James Morris, then Dean of the faculty. Despite having only one month left until the last application deadline, he encouraged me to apply. I went into overdrive trying to prepare for the GMAT. One week before the deadline, I wrote the exam with my hands shaking and teeth grinding when choosing multiple choice answers. When I was done, I almost wanted to discard it and write it again, but time was short and I decided to submit. My eyes were open-wide when I saw the 760 score. I would advise anybody procrastinating about it to "just do it".<br /><br />The company down here that hired me out of Microsoft is Adify. It is a startup that creates Ad Networks. It''s basically a market-place for advertisers and clusters of web publishers, brought together by brokers called Network Builders. Just before I joined, it was bought by Cox. It needed to expand, and since it is built on the Microsoft stack, the founders were interested in my background. Moving from a much bigger company back to a small one so far has been a very pleasant and growing change. Here I am, on the brink of the expansion of my company and also ready to learn software management with you guys from one of the best schools in the world.<br /><br />I''m very excited!</p>', '', null, null, '', '', '', '707-726-2646', 'Google Voice', '', '', '232', '10', 't', '/ameen aa-ree-aa-na/', null, null, null, null, '8', '2011-05-24 22:50:38.795245', '2011-05-21 20:54:13.410554', '72.14.229.81', '76.102.230.192', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
