INSERT INTO "users" VALUES ('255', 'mrajshek@andrew.cmu.edu', 'manoj.rajshekar@sv.cmu.edu', '2009-08-17 16:48:46', '2011-09-23 20:40:37.592498', 'f', 't', 'f', 'ManojRajshekar', 'Manoj', 'Rajshekar', 'Manoj Rajshekar', '/images/students/2011/SM/ManojRajshekar.jpg', '2011', 'SM', '', 't', 't', null, 'f', null, null, null, null, null, null, 'xxx-xxx-xxxxx', null, null, null, 'Unknown', null, null, null, null, null, null, null, null, null, null, null, '1', '1', 't', null, null, null, null, null, '4', '2011-08-07 06:59:37.974256', '2010-10-28 00:59:58.263656', '99.111.72.10', '12.139.64.101', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('257', 'lrighi@andrew.cmu.edu', 'lou.righi@sv.cmu.edu', '2009-08-17 16:48:46', '2012-09-18 01:52:33.123177', 'f', 't', 'f', 'LouRighi', 'Lou', 'Righi', 'Lou Righi', '/images/students/2011/SM/LuigiRighi.jpg', '2012', 'SM', '', 't', 'f', null, 't', '', 'Boeing', 'Avionics', 'Long Beach', 'CA', 'USA', '562 209 4564', '', '', 'lourighi@cox.net', 'Remote', '<p>I am an only child of an Italian family. I was raised in New York City. I  attended Catholic elementary and high schools. After receiving my BSME  in 1983, I met Ellen. <br /> We married in 1988 and have shared 21 years together. Ellen and I quit  our jobs and meandered across the country for thee months before  settling in Long Beach, CA. Our two daughters, Megan and Anna are both  in high school. <br /> I have worked in aerospace, transit and semiconductor industries, and  enjoy working with younger engineers transitioning into the workplace or  most of all. <br /> I received an MBA in 2004, became an official inventor with a patent in  the US and pending in the WTO countries in 2008. (Ironically, my  daughter is in FFA...Future Farmers of America...and raises pigs)</p>', '', null, null, 'Mobile', '', '', '', '', '', '', '257', '18', 'f', '', null, null, null, null, '11', '2012-09-18 01:52:33.118034', '2012-09-08 20:34:44.834207', '130.76.96.150', '99.98.249.139', null, null, null, null, null, null, null, null, null, null, null, 'HLgUy7ssfaX9so2pJxyU', '2012-09-18 01:52:33.081726', null, null);
