INSERT INTO "users" VALUES ('296', 'gthipman@andrew.cmu.edu', 'guntawee.tiwapong@sv.cmu.edu', '2009-08-27 19:13:23', '2011-03-01 22:31:31.812019', 'f', 't', 'f', 'GuntaweeTiwapong', 'Guntawee', 'Tiwapong', 'Guntawee Tiwapong', '/images/students/INI/MSIT-21/GuntaweeTiwapong.jpg', '2011', 'INI', '', 'f', 'f', '2010-11-26 17:06:17.169272', 't', '', '', '', '', '', '', '607-342-4828', 'guntawee', '', 'gthipman@gmail.com', 'Local', '<p>I come from Thailand, but I have been studying in the US for several years. I have lived in Windsor, CT, Ithaca, NY, and Pittsburgh, PA. I''m excited to live in the Bay Area, CA. I enjoy travelling, playing soccer, and learning foreign languages. I recently graduated from Cornell University with a bachelor in Electrical and Computer Engineering. I hope to be working in the IT industry in the Silicon Valley after graduation.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '274', '3', 'f', '', null, null, null, null, '5', '2011-01-23 19:30:26.686142', '2010-09-30 17:19:21.524714', '98.234.178.108', '209.129.244.250', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
