INSERT INTO "users" VALUES ('299', 'kaihsiay@andrew.cmu.edu', 'kaihsiang.yang@sv.cmu.edu', '2009-08-27 19:13:23', '2010-12-14 20:07:17.39955', 'f', 't', 'f', 'RyanYang', 'Ryan', 'Yang', 'Ryan Yang', '/images/students/INI/MSIT-21/RyanYang.jpg', '2011', 'INI', 'MOB', 'f', 'f', '2010-11-26 17:06:15.80065', 't', 'kaihsiang', '', '', '', '', '', 'xxx-xxx-xxxxx', '', 'ryanmusic', '', 'Unknown', '', '', '', '', '', '', '', '', '', '', '', '299', '4', 'f', '', null, null, null, null, '16', '2010-12-14 20:07:17.247404', '2010-12-07 20:29:57.752639', '76.21.5.172', '209.129.244.250', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('300', 'ryueh@andrew.cmu.edu', 'rich.yueh@sv.cmu.edu', '2009-08-27 19:13:23', '2011-04-16 17:06:17.726361', 'f', 't', 'f', 'RichYueh', 'Rich', 'Yueh', 'Rich Yueh', '/images/students/INI/MSIT-21/RichYueh.jpg', '2011', 'INI', '', 'f', 'f', '2010-11-26 17:06:21.442262', 't', '', '', '', 'San Jose', 'CA', '', '314.757.9801', 'rich.yueh', '', '', 'Local', '<p>I was born in Taiwan and moved to St. Louis, MO when I was young. I completed my undergrad at Purdue University. In the summers of 2007 and 2008 I interned at Yahoo, first at the main Sunnyvale campus and later on in the Mission College and Great America campuses. My projects were related to advertising on mobile devices but unfortunately they were scrapped in the recent coporate overhaul. I''ve always had a love for Silicon Valley and emerging technology, and I chose the INI bi-coastal program so that I could eventually end up there while completing my degree.</p>
<p>In my spare time, I like to DJ and work with music. I have a part time job as a DJ at the Metropark clothing store. For those of you in SV, you can find this store at Oakridge Mall and Valley Fair. There''s been some discussion as to what exact genre of music I play; I''ve just gone with the simple answer of "club mixes." Feel free to check out my Soundcloud page to listen to and download my mixes.</p>
<p>&nbsp;</p>
<p>twitter: richyueh</p>
<p>soundcloud: www.soundcloud.com/uaislive</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '300', '18', 'f', '', null, null, null, null, '3', '2011-04-16 17:06:00.305522', '2011-01-19 03:04:40.751508', '76.102.168.17', '76.102.168.17', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
