INSERT INTO "users" VALUES ('304', 'ssleong@andrew.cmu.edu', 'sylvia.leong@sv.cmu.edu', '2009-08-28 23:33:22', '2012-09-11 22:01:41.885101', 't', 'f', 'f', 'SylviaLeong', 'Sylvia', 'Leong', 'Sylvia Leong', '/images/staff/SylviaLeong.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon  Silicon Valley', 'Director of External Relations and Admissions', 'Moffett Field', 'CA', 'USA', '650-335-2808', 'sylvia_leong ', '', '', 'Local', '', '<p>Sylvia Leong is the director of external relations and admissions at the  Carnegie Mellon Silicon Valley campus. She has over ten years  experience in corporate recruiting and graduate school admissions. Prior  to joining Carnegie Mellon Silicon Valley, Sylvia was the senior  associate director of part-time MBA admissions at the USC Marshall  School of Business, where she had previously served as associate  director of full-time MBA admissions. In addition to her experiences at  academic institutions, Sylvia was the college and university recruiter  at Providian Financial Corporation (now Washington Mutual), hiring  undergraduates and MBAs into the financial services industry. In between  the switch from corporate to academia, she worked overseas in China,  teaching English as a Foreign Language to local Chinese teachers and  Business English to Chinese government officials. Sylvia earned her  bachelor&rsquo;s degree in mass communications from UC Berkeley.</p>', 'Bldg 23 - 215-B', 'M-F 9am-5pm ', 'Work', '626-375-4442', 'Mobile', '', '', '', '', '304', '7', 'f', '', null, null, null, null, '20', '2012-09-11 22:01:41.786329', '2012-08-16 21:35:29.263191', '209.129.244.75', '96.47.57.253', null, null, null, null, null, null, null, null, null, null, null, 'SVcdQxq3ZUqBxkvbWYfG', '2012-09-11 22:01:41.728166', null, null);
