INSERT INTO "users" VALUES ('307', 'zhang3@andrew.cmu.edu', 'joy.zhang@sv.cmu.edu', '2009-09-15 18:02:45', '2012-09-10 17:07:45.009333', 't', 'f', 'f', 'JoyZhang', 'Joy', 'Zhang', 'Joy Zhang', '/images/staff/JoyZhang.jpg', '', '', '', 'f', 't', null, 't', '', 'Carnegie Mellon  Silicon Valley', 'Research Assistant Professor ', 'Moffett Field', 'CA', 'USA', '650-335-2624', 'eskimojoy ', '', '', 'Local', '', '', 'Bldg 23 - 201B', '', 'Work', '412-818-8698', 'Mobile', '', '', '', '', '348', '11', 'f', '', null, null, null, null, '16', '2012-09-10 17:07:45.002684', '2012-08-23 00:20:12.594254', '76.233.206.212', '209.129.244.250', null, null, null, null, null, null, '2012-09-10 17:00:56.180334', null, null, null, null, 'LwmHD9JnrXEAZ1gxeLaf', '2012-09-10 17:07:44.955831', null, null);
INSERT INTO "users" VALUES ('308', 'tselker@andrew.cmu.edu', 'ted.selker@sv.cmu.edu', '2009-09-15 18:14:00', '2012-10-01 17:01:13.808048', 't', 'f', 'f', 'TedSelker', 'Ted', 'Selker', 'Ted Selker', '/images/staff/TedSelker.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon  Silicon Valley', 'Associate Director ', 'Moffett Field', 'CA', 'USA', '650-335-2835', 'tedselker ', 'tedselker', '', 'Local', '<p>Dr Ted Selker is Associate director of mobility research at Carnegie Mellon Silicon Valley and a visiting scholar at Stanford computer science department. Ted spent ten years as an associate Professor at the MIT Media Laboratory where he created the Context Aware Computing group, co-directed the Caltech/MIT Voting Technology Project, and directed a CI/IDI: kitchen of the future/ product design of the future project. His work is noted for creating demonstrations of a world in which intentions are recognized and respected in complex domains, such as kitchens, cars, on phones and in email. Ted&rsquo;s work takes the form of prototyping concept products supported by cognitive science research.<br /> <br /> His successes at targeted product creation and enhancement earned him the role of IBM Fellow and director of User Systems Ergonomics Research. He has served as a consulting professor at Stanford University, taught at Hampshire, University of Massachusetts at Amherst and Brown Universities and worked at Xerox PARC and Atari Research Labs. <br /> <br /> Ted''s innovation has been responsible for profitable and award winning products ranging from notebook computers to operating systems. For example, his design of the <span><a title="TrackPoint (this topic does not yet exist; you can create it)" rel="nofollow" href="http://info.sv.cmu.edu/do/edit/Main/TrackPoint?topicparent=Main.TedSelker">TrackPoint</a></span> in-keyboard pointing device is used in many notebook computers, his visualizations have made impacts ranging from improving the performance of the <span><a title="PowerPC (this topic does not yet exist; you can create it)" rel="nofollow" href="http://info.sv.cmu.edu/do/edit/Main/PowerPC?topicparent=Main.TedSelker">PowerPC</a></span> to usability OS/2 Thinkpad setup to Google maps, his adaptive help system has been the basis of products as well. Ted&rsquo;s work has resulted in numerous awards, patents, and papers and has often been featured in the press. Ted was co-recipient of the Computer Science Policy Leader Award for Scientific American 50 in 2004, the American Association for People with Disabilities Thomas Paine Award for his work on voting technology in 2006 and the Telluride Tech fest award in 2008.<br /> <br /> Ted is well known for guiding, demonstrating and speaking about strategic emerging technology opportunities. He specializes in seeding strategic conversations and in creating targeted workshops to teach and guide invention and innovation.</p>', '', 'Bldg 23 - 218', '', 'Work', '617-759-3001', 'Mobile', '', '', '', '', '348', '13', 'f', '', null, null, null, null, '20', '2012-08-30 00:09:46.477834', '2012-08-22 20:25:32.709161', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, '2012-10-01 17:01:13.770206', null, null, null, null, '9pJFyzrwtzfXtUfPiE6h', '2012-08-30 00:09:46.457924', null, null);
