INSERT INTO "users" VALUES ('314', 'sherylr@andrew.cmu.edu', 'sheryl.root@sv.cmu.edu', '2009-10-10 20:02:01', '2012-09-24 23:51:51.65251', 't', 'f', 'f', 'SherylRoot', 'Sheryl', 'Root', 'Sheryl Root', '/images/staff/SherylRoot.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon University', 'SM Consulting Professor ', 'Portola Valley', 'CA', 'USA', '650-851-4111 ', '', '', 'sherylr@rootanalysis.com', 'Local', '<p>Sheryl Root is a member of the faculty at Carnegie Mellon Silicon Valley. Currently, she has her business, <span><a title="RootAnalysis (this topic does not yet exist; you can create it)" rel="nofollow" href="http://info.sv.cmu.edu/do/edit/Main/RootAnalysis?topicparent=Main.SherylRoot">RootAnalysis</a></span>,  which is a consulting firm in business strategy and marketing. Before  joining the faculty, she was Director, Marketing Services at Applied  Materials and previously was with HP for 20 years having served as  director of Business Strategy, director of Marketing Operations for  Services, Director of the Software Initiative and Manager of Unix  environements. She led internal teams of consultants in advancing  software engineering and business management process practices within  Hewlett-Packard worldwide, specializing in the area of software.</p>
<p>Sheryl completed her undergraduate studies at the University of  California and obtained her master&rsquo;s degree in business from Stanford  University. She is on the Board of Advisors for the Stanford Business  School Sloan Program and is a member of the board for WITI (Women in  Technology, International).</p>', '', '650-851-4111', 'By scheduled appointment', 'Work', '', '', '', '', '', '', '274', '15', 'f', '', null, null, null, null, '15', '2012-09-24 23:51:51.647372', '2012-08-25 04:42:36.482956', '76.126.208.87', '76.126.208.87', null, null, null, null, null, null, null, null, null, '', null, 'pkAxxUzFbpA55GYSVC3Z', '2012-09-24 23:51:51.621672', null, null);
