INSERT INTO "users" VALUES ('349', 'juliebel@andrew.cmu.edu', 'julie.bellerose@sv.cmu.edu', '2010-01-19 23:36:31', '2012-10-01 17:08:21.276255', 't', 'f', 'f', 'JulieBellerose', 'Julie', 'Bellerose', 'Julie Bellerose', '/images/staff/JulieBellerose.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon Silicon Valley ', 'Research Faculty ', 'Moffett Field', 'CA', 'USA', '650-604-6375', '', '', '', 'Unknown', '<p>Julie is a research scientist at Carnegie Mellon Silicon Valley,  collaborating with the science teams of small body mission concepts  currently under development at NASA Ames. She is the first international  JSPS Postdoctoral Fellow to have stayed at the Japan Aerospace  Exploration Agency (JAXA) working with the JAXA Space Exploration Center  on the Hayabusa follow-on missions.</p>
<p>She obtained her Ph.D. at the University of Michigan, studying the  dynamics of binary asteroid systems and spacecraft applications.  Throughout her time at Michigan, she was also involved in a variety of  projects with the Student Space Systems Fabrication Lab (S3FL). This  included the MClimber team, which competed in the 2006 NASA Centennial  Challenge Elevator 2010. In her free time, she enjoys competitive  cycling and flying over the Bay area.</p>', '', 'Bld 202 (MS 202-201)               ', '', 'Work', '650-438-3200    ', 'Mobile', '', '', '', '', '1', '10', 'f', '', null, null, null, null, '15', '2012-10-01 17:08:21.265779', '2012-09-01 20:29:28.702365', '128.102.235.220', '67.180.16.54', null, null, null, null, null, null, '2012-10-01 17:01:07.004073', null, null, null, null, 'WLL1s4ezdq55jcfz5bXn', '2012-10-01 17:08:21.217751', null, null);
