INSERT INTO "users" VALUES ('356', 'dimitrag@andrew.cmu.edu', 'dimitra.giannakopoulou@sv.cmu.edu', '2010-02-05 23:53:36', '2010-08-10 23:28:41.173987', 't', 'f', 'f', 'DimitraGiannakopoulou', 'Dimitra', 'Giannakopoulou', 'Dimitra Giannakopoulou', '/images/staff/DimitraGiannakopoulou.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon  Silicon Valley', 'Senior System Scientist ', 'Moffett Field', 'CA', 'USA', '650-604-0504', '', '', '', 'Local', '<p>Dimitra Giannakopoulou is a senior scientist at Carnegie Mellon Silicon  Valley, working with the Robust Software Engineering group at the NASA  Ames Research Center. Her research focuses on scalable specification and  verification techniques for NASA systems. She is primarily interested  in incremental and compositional model checking based on software  components and architectures. She is co-recipient of an ACM  distinguished paper award, and an Outstanding Technology Award for  JavaPathfinder by the Federal Laboratory Consortium. She is Associate  Editor for the IEEE Transactions on Software Engineering journal,  co-editor of two special journal issues on compositional verification,  program co-chair of FASE 2011 and NFM 2009 (NASA Formal Methods  Symposium), and a co-organizer of the SAVCBS (Specification and  Verification of Component-Based Systems) Workshop Series. She has  published extensively in the area of software engineering and has served  on numerous committees of international conferences such as ICSE, FSE,  ISSTA, CONCUR, ASE, FASE, and FM. More information about Dr.  Giannakopoulou can be found at: <a href="http://ti.arc.nasa.gov/profile/dimitra/" target="_blank">http://ti.arc.nasa.gov/profile/dimitra/</a>.</p>', '', 'NASA Ames Research Park', '', 'Work', '', '', '', '', '', '', '1', '4', 'f', '', null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
