INSERT INTO "users" VALUES ('368', 'jeffperdue@cmu.edu', 'jeff.perdue@sv.cmu.edu', '2010-02-23 22:35:01', '2012-06-29 16:17:05.069663', 't', 'f', 'f', 'JeffPerdue', 'Jeff', 'Perdue', 'Jeff Perdue', '/images/staff/JeffPerdue.jpg', '', '', '', 'f', 'f', null, 't', '', '', '', '', '', '', '', '', '', '', 'Unknown', '<p>Jeff Perdue is a Senior Scientist at Carnegie Mellon Silicon Valley  where he teaches courses related to IT-enabled Service Management and  participates in research to define useful measures of service  performance and quality.</p>
<p>Jeff Perdue has over 30 years of IT related experience with job tasks  ranging from Teaching Assistant to Company President.  He has developed  and taught executive and professional education courses related to  IT-enabled sourcing since 2002.</p>
<p>He has been a software management consultant and contributed to the  development and adoption of the Capability Maturity Model for Software.   He co-founded and co-managed a software consulting company, and served  as Senior Vice President in the company that acquired his consulting  firm.  Prior to this:  he was a member of the technical staff at  Carnegie Mellon University&rsquo;s Software Engineering Institute, had several  senior management roles in a Pittsburgh based high technology startup,  and was a software manager and developer for a computer manufacturer.<br /> He also is a founding director of ITSqc, LLC the Carnegie Mellon  spin-off company launched to commercialize best practice models for  IT-enabled sourcing.</p>
<p>Mr. Perdue has Bachelors and Masters degrees in Computer Science from Michigan State University.</p>', '', '', '', '', '', '', '', '', '', '', '274', '4', 'f', '', null, null, null, null, '12', '2012-06-29 16:17:05.068938', '2012-06-19 18:45:06.83815', '96.235.26.193', '209.129.244.250', null, null, null, null, null, null, null, null, null, '', null, '1c256ySoYSguDqZvmaRb', '2012-06-29 16:17:05.064439', null, null);
INSERT INTO "users" VALUES ('369', 'js35@andrew.cmu.edu', 'jane.siegel@sv.cmu.edu', '2010-02-23 22:59:07', '2011-04-08 20:19:10.972264', 't', 'f', 'f', 'JaneSiegel', 'Jane', 'Siegel', 'Jane Siegel', '/images/students/mascot.jpg', '', '', '', 'f', 'f', null, 't', '', '', '', '', '', '', '', '', '', '', 'Unknown', '', '', '', '', '', '', '', '', '', '', '', '1', '2', 'f', '', null, null, null, null, '2', '2011-04-08 20:10:16.06549', '2011-04-08 20:10:13.867201', '108.17.88.59', '108.17.88.59', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('370', 'avenet@andrew.cmu.edu', 'arnaud.venet@sv.cmu.edu', '2010-03-30 22:45:34', '2012-10-01 18:41:42.40573', 't', 'f', 'f', 'ArnaudVenet', 'Arnaud', 'Venet', 'Arnaud Venet', '/images/staff/ArnaudVenet.jpg', '', '', '', 'f', 'f', null, 't', '', '', '', '', '', '', '', '', '', '', 'Unknown', '<p>Dr. Arnaud Venet&rsquo;s main research area is static program analysis by  Abstract Interpretation. He is the architect of a static analyzer for C  programs named C Global Surveyor (CGS). CGS has been applied to the  flight software of several NASA missions such as Mars missions (MPF,  DS1, MER) and some ISS payload software (UPA). CGS has been shown to  scale to codes over 550K LOC. Dr. Venet&rsquo;s research work focuses on  algorithms and techniques for specializing static analyzers in order to  achieve high precision and performance on large codes. He has designed a  static analyzer generator named CodeHawk that allows the rapid  development of customized static analyzers. Dr. Venet is currently  working on a static analyzer for C/C++ targeted to flight software  developed under the Integrated Modular Avionics framework.</p>', '', '', '', '', '', '', '', '', '', '', '1', '19', 'f', '', null, null, null, null, '26', '2012-10-01 18:41:30.463597', '2012-09-01 19:11:30.56766', '67.161.70.114', '67.161.70.114', null, null, null, null, null, null, '2012-10-01 17:01:02.665176', null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('371', 'dhaffner@andrew.cmu.edu', 'dusting.haffner@sv.cmu.edu', '2010-05-04 16:20:25', '2010-05-04 16:20:25', 'f', 't', 'f', 'DustinHaffner', 'Dustin', 'Haffner', 'Dustin Haffner', '/images/students/mascot.jpg', '2011', 'SCS Undergraduate', '', 'f', 'f', null, 't', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '1', '1', 'f', '', null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('372', 'tnguyen1@andrew.cmu.edu', 'le.nguyen@sv.cmu.edu', '2010-05-05 20:41:11', '2012-09-06 04:18:45.771532', 'f', 't', 'f', 'LeNguyen', 'Le', 'Nguyen', 'Le Nguyen', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/372/profile/LeNguyen.jpg', '', 'PhD', '', 'f', 'f', null, 't', 'Thanh Le', '', '', '', '', '', '', '', '', 'ntle@ntle.eu', 'Unknown', '', '', '', '', '', '', '', '', '', '', '', '812', '8', 'f', '', null, null, null, null, '5', '2011-09-15 07:30:25.930641', '2011-09-15 07:29:19.959285', '67.161.29.0', '67.161.29.0', null, null, null, null, null, null, null, 'LeNguyen.jpg', 'image/jpeg', '', null, null, null, null, null);
INSERT INTO "users" VALUES ('373', '1273262856.76563', 'jacques.dolan@sv.cmu.edu', '2010-05-07 20:07:36', '2010-10-07 17:20:33.168059', 'f', 'f', 'f', 'JacquesDolan', 'Jacques', 'Dolan', 'Jacques Dolan', '/images/staff/JacquesDolan.jpg', '', '', '', 'f', 'f', null, 'f', '', '', '', '', '', '', '', '', '', '', 'Unknown', '<p>Jacques Dolan has worked as a mechanical engineer on the development and testing of small spacecraft projects at NASA Ames, with an emphasis on thermal design and testing for space environments. Jacques has also worked closely in the last three years with students and researchers at the Carnegie Mellon University in the Silicon Valley Campus involving rovers, small-scale helicopters, and other physics-based modeling and simulation projects. These projects often involve mechanical component design, manufacturing, integration, and testing in rapid-prototyping situations in order to offer fast, inexpensive, and reliable solutions to real-world applications.</p>
<p>Jacques was very involved with FIRST Robotics in High School and a Mechanical Engineering team lead for the Solar Vehicle Project at the University of Minnesota, Twin Cities. This experience has been important for developing relationships and mentoring students involved with NASA Office of Education and CMU-SV internship opportunities.  He received his Bachelors of Mechanical Engineering from the University of Minnesota, Twin Cities.</p>
<p>He has been a member of the American Society of Mechanical Engineers since 2007.</p>', '', '', '', '', '', '', '', '', '', '', '348', '3', 'f', '', null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
