INSERT INTO "users" VALUES ('381', 'ianlane@andrew.cmu.edu', 'ian.lane@sv.cmu.edu', '2010-06-01 22:13:54', '2012-09-27 15:22:44.362271', 't', 'f', 'f', 'IanLane', 'Ian', 'Lane', 'Ian Lane', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/381/profile/lane_ian.gif', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon Universiry (CMU-SV, CSC-LTI)', 'Reserach Assistant Professor', 'Moffett Field', 'CA', '', '650-335-2843', '', '', 'ianlane@cs.cmu.edu', 'Unknown', '<p>Ian Lane is an assistant research professor at LTI, Carnegie Mellon  University. His research interests include speech recognition, natural  language processing, machine learning and applications of these  technologies. He has published extensively in these fields, and received  several patents and awards. He has been involved in the development of  numerous speech translation systems, both research systems (GALE,  TransTAC, TC-STAR, and IWSLT) and commercial products including Jibbigo.  Before joining Carnegie Mellon University Ian was an intern researcher  at ATR Spoken Language Communication Laboratories, Japan. He performed  his postgraduate studies at Kyoto University culminating in a Ph.D.  degree in 2006 and obtained his B.Tech. degree from Massey University,  New Zealand in 2000.</p>', '', 'Bldg 19 - 1041', '', 'Work', '', '', '', '', '', '', '348', '24', 'f', '', null, null, null, null, '17', '2012-09-15 18:20:47.729818', '2012-08-25 01:21:19.030137', '209.129.244.250', '198.228.216.25', null, null, null, null, null, null, '2012-09-15 17:01:25.544849', null, null, '', 'links', null, null, null, null);
