INSERT INTO "users" VALUES ('393', 'yuseungk@andrew.cmu.edu', 'yuseung.kim@sv.cmu.edu', '2010-07-19 21:29:49.520927', '2012-04-27 22:45:57.240419', 'f', 't', 'f', 'YuSeungKim', 'Yu Seung', 'Kim', 'Yu Seung Kim', '/images/students/2010/PhD/YuSeungKim.jpg', '', 'PhD', '', 'f', 'f', null, 't', '', '', '', '', '', '', '', '', '', 'corekey@gmail.com', 'Unknown', '', '', '', '', '', '', '', '', '', '', '', '1', '6', 'f', '', '2010-07-19 21:30:06.123532', '2010-07-19 21:30:15.862653', null, null, '2', '2011-11-14 19:50:11.783782', '2010-07-20 00:16:58.634372', '209.129.244.250', '210.94.41.89', '2010-07-19 21:30:24.382243', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('394', 'fmokaya@andrew.cmu.edu', 'frank.mokaya@sv.cmu.edu', '2010-07-19 21:36:30.174592', '2012-04-27 22:45:58.20081', 'f', 't', 'f', 'FrankMokaya', 'Frank', 'Mokaya', 'Frank Mokaya', '/images/students/2010/PhD/FrankMokaya.jpg', '', 'PhD', '', 'f', 'f', null, 't', '', '', '', '', '', '', '', '', '', 'frankmokaya@gmail.com', 'Local', '<p>I&rsquo;m a 1st-year PhD student in <a title="http://ece.cmu.edu/" href="http://ece.cmu.edu/">ECE Department</a>, <a title="http://www.cmu.edu" href="http://www.cmu.edu/">Carnegie Mellon University</a>, advised by Prof. <a title="http://www.ece.cmu.edu/~peizhang/" href="http://www.ece.cmu.edu/%7Epeizhang/">Pei Zhang</a>, and co-advised by Prof. Anthony Rowe.  My research is largely in the networked embedded systems area, specifically, mobile wireless sensor networks. I am currently working on collaborative communication, control and sensor fusion on the SensorFly.</p>
<p>I am originally from Kenya, born and raised in Nairobi. I attended Yale University as an undergraduate and worked with Prof. Roman Kuc. My undergraduate education was largely based on robotics, specifically sensor control of both bipedal and differential drive robots. I graduated i may 2009.</p>
<p>I have also done some more interesting stuff like interning at Morgan Stanley IT in 2008. I was an application infrastructure developer at one of the Time''s Square offices in New York. This was one of the most intense, yet interesting experience. I also worked at Yale University Applied Physics Dept. labs under Fred Walker as an Automation engineer. I created a wirelessly controled system for actuating motors using PLCs to move silicon samples through the MBE machine in the lab</p>', '', '', '', '', '', '', '', '', '', '', '394', '6', 'f', '', '2010-07-19 21:36:38.651777', '2010-07-19 21:36:49.509708', null, null, '1', '2011-05-16 23:44:02.024543', null, '209.129.244.250', null, '2010-07-19 21:36:57.424548', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('395', 'ericc1@andrew.cmu.edu', 'eric.chen@sv.cmu.edu', '2010-07-19 21:38:12.249361', '2012-04-27 22:45:56.311337', 'f', 't', 'f', 'EricChen', 'Eric', 'Chen', 'Eric Chen', '/images/students/2010/PhD/EricChen.jpg', '', 'PhD', '', 'f', 'f', null, 't', '', '', '', '', '', '', '', '', '', 'chenyeric@gmail.com', 'Unknown', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. Trash clearly is not multitudinous. I hope to put my real biography here one day.</p>', '', '', '', '', '', '', '', '', '', '', '1', '5', 'f', '', '2010-07-19 21:38:21.724987', '2010-07-19 21:38:31.81735', null, null, '1', '2010-08-24 20:17:44.718553', null, '209.129.244.250', null, '2010-07-19 21:38:39.810712', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('396', 'zweinber@andrew.cmu.edu', 'zack.weinberg@sv.cmu.edu', '2010-07-19 21:39:44.252967', '2012-04-27 22:45:57.672242', 'f', 't', 'f', 'ZackWeinberg', 'Zack', 'Weinberg', 'Zack Weinberg', '/images/students/2010/PhD/ZackWeinberg.jpg', '', 'PhD', '', 'f', 'f', null, 't', 'Zachary', '', '', '', '', '', '', '', '', 'zackw@panix.com', 'Unknown', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. Trash clearly is not multitudinous. I hope to put my real biography here one day.</p>', '', '', '', '', '', '', '', '', '', '', '1', '5', 'f', '', '2010-07-19 21:39:53.818306', '2010-07-19 21:40:03.005284', null, null, '0', null, null, null, null, '2010-07-19 21:40:14.818568', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('397', 'huankaip@andrew.cmu.edu', 'huankai.peng@sv.cmu.edu', '2010-07-19 21:41:29.52631', '2012-04-27 22:45:57.454931', 'f', 't', 'f', 'HuanKaiPeng', 'Huan-Kai', 'Peng', 'Huan-Kai Peng', '/images/students/2010/PhD/HuanKaiPeng.jpg', '', 'PhD', '', 'f', 'f', null, 't', '', 'Carnegie Mellon University - Silicon Vally Campus', 'PhD Student', 'Mountain View', 'California', 'USA', '6502132270', 'pumbaapeng', '', 'pumbaapeng@gmail.com', 'Local', 'I am a PhD student of Carnegie Mellon University - Silicon Valle Campus. I got my BS and MS from the Computer Science Department of National Tsing Hua University, while I worked with Prof. Youn-Long Lin and were specialized in Embedded Systems / Digital Design / Algorithm for Electronic Design Automation. After serving the military service in Navy, I work as an RA with Prof. Hung-Pin Wen in National Chiao-Tung University (on Application of Machine Learning on Circuit Analysis) and with Prof. Ker-Chao Li in Academia Sinica (Statistical Analysis on Human Cancer Genome). Please refer to my website (http://cia.cm.nctu.edu.tw/lab/pumbaa.html) for for information.', '', '', '', 'Mobile', '', '', '', '', '', '', '397', '9', 'f', '', '2010-07-19 21:41:38.427732', '2010-07-19 21:41:49.612217', null, null, '1', '2010-09-08 00:25:33.031124', null, '209.129.244.250', null, '2010-07-19 21:41:58.074226', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('398', 'rahulraj@andrew.cmu.edu', 'rahul.rajan@sv.cmu.edu', '2010-07-19 21:43:38.022318', '2012-04-27 22:45:57.110429', 'f', 't', 'f', 'RahulRajan', 'Rahul', 'Rajan', 'Rahul Rajan', '/images/students/2010/PhD/RahulRajan.jpg', '', 'PhD', '', 'f', 'f', null, 't', 'Rahul', 'CMU-SV', 'PhD Student, ECE', 'Mountain View', 'CA', 'United States', '678-608-0436', 'rahulraj', 'rahulraj', 'rahul.rajan@gmail.com', 'Local', '<p>I graduated with my BS/MS in ECE from Georgia Tech in Dec 2007 and left to conquer the world as a Design Engineer at RF Micro Devices. A year later, enticed by the greener pastures of the HCI field, I went back to Tech to work with the Ubiquitous Computing Group. I am currently pursuing my PhD with Dr. Ted Selker as my advisor in the Considerate Systems Group.</p>', '', '', '', 'Google Voice', '6786080436', '', '6786080436', '', '6786080436', '', '398', '9', 'f', '', '2010-07-19 21:43:55.136547', null, null, null, '4', '2011-06-28 03:32:55.556629', '2011-01-20 21:49:00.9684', '98.248.33.197', '209.129.244.250', '2010-07-19 21:48:43.206243', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('399', 'asaluja@andrew.cmu.edu', 'avneesh.saluja@sv.cmu.edu', '2010-07-19 21:45:02.932054', '2012-04-27 22:45:58.487324', 'f', 't', 'f', 'AvneeshSaluja', 'Avneesh', 'Saluja', 'Avneesh Saluja', '/images/students/2010/PhD/AvneeshSaluja.jpg', '', 'PhD', '', 'f', 'f', null, 't', '', 'Carnegie Mellon University', '1st year PhD student', 'Mountain View', 'CA', 'USA', '650-691-5234', 'asaluja', '', 'asaluja@gmail.com', 'Local', '<p>I''m currently a first-year PhD student working in the Intelligent Systems Lab, particularly in the areas of Speech Recognition, Natural Language Processing, and Statistical Machine Translation. &nbsp;</p>
<p>I did my B.Sc. in Electrical Engineering from Stanford University, graduating in 2007. &nbsp;While there, I worked on research in Fiber-Optic Communications and Financial Mathematics. After working in Equity Derivatives at Goldman Sachs and as a Product Manager at a mobile internet startup for 3 years, research beckoned again and so I packed my bags to head back to graduate school. &nbsp;</p>', '', '', '', 'Google Voice', '', '', '', '', '', '', '399', '9', 'f', '', '2010-07-19 21:47:16.158291', '2010-07-19 21:47:24.918635', null, null, '4', '2011-12-02 23:46:03.820564', '2011-04-15 08:29:48.41452', '128.237.234.227', '98.248.33.197', '2010-07-19 21:47:33.378003', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('400', 'jzhu1@andrew.cmu.edu', 'jiang.zhu@sv.cmu.edu', '2010-07-19 21:45:45.793093', '2012-09-24 17:28:13.500636', 'f', 't', 'f', 'JiangZhu', 'Jiang', 'Zhu', 'Jiang Zhu', '/images/students/2010/PhD/JiangZhu.jpg', '', 'PhD', '', 'f', 'f', null, 't', '', 'Carnegie Mellon Silicon Valley', 'Ph.D Student', 'Mountain View', 'CA', 'USA', '408 893 5288', 'ponyjzhu', 'jzhu', 'jiangzhu@stanfordalumni.org', 'Local', '<p style="background-color: transparent;">I''m Jiang Zhu and before coming to CMU, I have been a Technical Leader in Advanced Architecture &amp; Research at&nbsp;<a style="text-decoration: none; color: #4571d0; background-color: transparent; border-top-style: none; border-right-style: none; border-bottom-style: dotted; border-left-style: none; border-width: 1px; border-color: #4571d0;" href="http://www.cisco.com" target="_top">Cisco Systems Inc.</a>&nbsp;where I identify and solve research problems that could help to build a better Internet. I love doing&nbsp;<a style="text-decoration: none; color: #4571d0; background-color: transparent; border-top-style: none; border-right-style: none; border-bottom-style: dotted; border-left-style: none; border-width: 1px; border-color: #4571d0;" href="http://yuba.stanford.edu/" target="_top">networking research</a>&nbsp;in various fields including content-aware distribution networks, network virtualizations and network economics. I am particular interested in applying machine learning, data mining and game theory techniques to networking problems. I like reading research papers which helps me write my own. I also enjoy coding in C/C++, analyzing network protocols and hacking Linux kernel.</p>
<p style="background-color: transparent;"><img src="http://stanford.edu/~ponychu/images/profilepicbww.png" alt="profile pic" /></p>
<p style="background-color: transparent;">I was born in Beijing, China. I love the city very much. My dad is an artist and I was raised to become a painter or a photographer when I was very little. Well, my dad was pretty disappointed when I touched a computer for the first time at the age of 8 and decided to deviate from the planned route. My childhood dream job was to become a system software engineer. It seems I have realized that goal already.</p>
<p style="background-color: transparent;">Besides&nbsp;<span style="border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-color: #d7dbe4; border-style: solid;">drawing</span>&nbsp;and&nbsp;<span style="border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-color: #d7dbe4; border-style: solid;">other artistic activities</span>, I enjoy various sports in my spare time:&nbsp;<span style="border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px; border-left-width: 0px; border-color: #d7dbe4; border-style: solid;">softball</span>, swimming, badminton, to name a few. I also love going to museums and planetariums with my wife - we could spend hours there just as if we were little kids.</p>
<p style="background-color: transparent;">I lived on Stanford campus for many years and still keep a homepage&nbsp;there at http://www.stanford.edu/~ponychu.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '400', '29', 'f', 'John Jew', '2010-07-19 21:47:44.06521', null, null, null, '43', '2012-09-24 17:28:13.494884', '2012-09-07 06:08:20.161989', '173.36.196.8', '98.210.100.16', '2010-07-19 21:47:57.155372', null, null, null, null, null, null, null, null, '', null, 'LkgRNSxhQ839qKzkskMf', '2012-09-24 17:28:13.472132', null, null);
INSERT INTO "users" VALUES ('401', 'dpiao@andrew.cmu.edu', 'dongzhen.piao@sv.cmu.edu', '2010-07-19 21:46:27.989848', '2012-04-27 22:45:57.657066', 'f', 't', 'f', 'DongzhenPiao', 'Dongzhen', 'Piao', 'Dongzhen Piao', '/images/students/2010/PhD/DongzhenPiao.jpg', '', 'PhD', '', 'f', 'f', null, 't', '', '', '', '', '', '', '', '', '', 'parkurm@gmail.com', 'Unknown', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. Trash clearly is not multitudinous. I hope to put my real biography here one day.</p>', '', '', '', '', '', '', '', '', '', '', '1', '5', 'f', '', '2010-07-19 21:48:06.480126', '2010-07-19 21:48:19.199159', null, null, '3', '2011-11-27 18:41:21.24369', '2011-08-25 21:56:10.740097', '209.129.244.250', '129.192.170.250', '2010-07-19 21:48:30.586134', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('403', 'isoto@andrew.cmu.edu', 'inti.soto@sv.cmu.edu', '2010-07-19 21:49:17.240796', '2012-04-27 22:45:59.870064', 'f', 't', 'f', 'IntiSoto', 'Inti', 'Soto', 'Inti Soto', '/images/students/2011/FTSE/IntiSoto.jpg', '2011', 'SE', 'DM', 'f', 'f', '2011-09-23 17:06:32.817461', 'f', '', 'Central Bank of Nicaragua', 'Software Development Project Manager', 'Managua', 'Managua', 'Nicaragua', '650 559 0197', 'inti.soto', 'inti_soto', 'inti.soto@sv.cmu.edu', 'Local', '<p>During the last more than 6 years at Central Bank of Nicaragua, I have been involved in more than 15 software development projects related to economic and financial data processing, strategic planning, management-level report generation, and OLAP solutions.</p>
<p>The technology and architecture I have been working with is mainly Microsoft Visual Basic .NET (Windows Forms and ASP.NET Applications and Web sites) and SQL Server 2005/2008 (including Business Intelligence services: Analysis and Integration Services).</p>
<p>For most of these projects I was involved as a Project Manager, coordinating teams integrated by more than 10 IT specialists including: DBAs, Operative System Administrators and software developers.</p>
<p>I have accumulated more than 5,000 hours of programming experience, led projects and personnel for more than 4,000 hours and dedicated more than 1,300 hour to tools and developing trends evaluation. Beside this I have trained more than 135 developers on Microsoft .NET technology (900 hours approximately).</p>', '', '', '', 'Home', '650 518 2564', 'Mobile', '', '', '', '', '1', '15', 't', '', '2010-07-19 21:49:29.431472', '2010-07-19 21:49:38.560122', null, null, '10', '2011-08-26 19:33:05.104031', '2011-07-06 18:53:03.640196', '190.212.129.180', '71.142.94.107', '2010-07-19 21:49:46.98602', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('404', 'edogusoy@andrew.cmu.edu', 'engin.dogusoy@sv.cmu.edu', '2010-07-19 21:49:51.987814', '2012-04-27 22:45:56.907665', 'f', 't', 'f', 'EnginDogusoy', 'Engin', 'Dogusoy', 'Engin Dogusoy', '/images/students/2011/FTSE/EnginDogusoy.jpg', '2011', 'SE', 'DM', 'f', 'f', '2011-09-23 17:05:33.497492', 'f', '', '', '', '', '', '', '408 368 5859', 'engin_dogusoy', '', 'engind@su.sabanciuniv.edu', 'Local', '<p>I have been in German High School for 5 years and got both my Turkish and German diploma. After that, I spent 4 years in Sabanci University Istanbul, getting my undergraduate degree in Computer Science &amp; Engineering. I have graduated from Sabanci University on June 2010 and moved to Silicon Valley to get my masters degree in Software Engineering from CMSV.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '12', 't', 'Eng-in Dough-HOU-soy', '2010-07-19 21:50:03.560986', '2010-07-19 21:50:12.840227', null, null, '22', '2011-06-26 20:34:52.01199', '2011-05-26 07:26:16.566646', '98.234.104.33', '98.234.104.33', '2010-07-19 21:50:21.227967', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('405', 'ccjensen@andrew.cmu.edu', 'chris.jensen@sv.cmu.edu', '2010-07-19 21:50:55.96831', '2012-04-27 22:45:59.440149', 'f', 't', 'f', 'ChrisJensen', 'Chris ', 'Jensen', 'Chris Jensen', '/images/students/2011/FTSE/ChrisJensen.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:06:21.963551', 'f', 'Christopher', '', '', 'Sunnyvale', 'California', 'USA', '+1 (408) 462-0762', 'christophercjensen', 'ccjensen', 'christophercjensen@gmail.com', 'Local', '<ul>
<li>Born in October 1983</li>
<li>Raised in Norway</li>
<li>English mum and Norwegian dad</li>
<li>Enjoy most sports, though as a kid it was mostly football (soccer) and swimming. These days it''s mostly squash, golf and scuba diving (when I can find the time)</li>
<li>I love travelling and seeing new places</li>
<li>Very much enjoying iPhone/iPad programming</li>
</ul>', '<p>Did my Bachelor of Science Computer Science at the University of Southampton.</p>
<p>&nbsp;</p>
<p>&hellip;this is where I will write some more interesting things about myself&hellip;</p>', '', '', 'Google Voice', '', '', '', '', '', '', '405', '25', 't', 'Chris Yensen', '2010-07-19 21:51:05.754934', '2010-07-19 21:51:14.82408', null, null, '22', '2011-10-18 18:03:04.952371', '2011-09-22 00:59:46.592068', '17.212.155.199', '24.130.9.155', '2010-07-19 21:51:22.52001', '1', '23', '4', '29', '17', null, null, null, null, null, null, null, null, null);
