INSERT INTO "users" VALUES ('407', 'aradhwi@andrew.cmu.edu', 'asem.radhwi@sv.cmu.edu', '2010-07-20 22:47:48.083064', '2012-04-27 22:45:59.269585', 'f', 't', 'f', 'AsemRadhwi', 'Asem', 'Radhwi', 'Asem Radhwi', '/images/students/2011/FTSE/AsemRadhwi.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:06:18.379533', 'f', '', 'Saudi Aramco', 'Petroleum Engineering Systems Analyst', 'Dhahran', 'Eastern Province', 'Saudi Arabia', '4085098717', 'mighty_asem', 'asemradhwi', 'assim.radwi@aramco.com', 'Local', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. Trash clearly is not multitudinous. I hope to put my real biography here one day.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '14', 't', 'A-sim', '2010-07-20 22:47:59.084054', '2010-07-20 22:48:08.605946', null, null, '3', '2010-08-21 17:49:51.942676', '2010-08-20 07:17:26.125912', '209.129.244.250', '24.5.244.227', '2010-07-20 22:48:16.278082', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('408', 'yz3@andrew.cmu.edu', 'ian.zhang@sv.cmu.edu', '2010-07-20 22:49:16.533752', '2012-04-27 22:45:57.405714', 'f', 't', 'f', 'IanZhang', 'Ian', 'Zhang', 'Ian Zhang', '/images/students/2011/FTSE/IanZhang.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:05:40.746912', 'f', 'Yu', '', '', 'Mountain View', 'CA', 'USA', '650-215-3525', 'ian7zy', 'ian7zy', 'ian7zy@gmail.com', 'Local', '', '', '', '', 'Mobile', '4155955276', '', '4155955276', '', '4155955276', '', '1', '14', 't', '', '2010-07-20 22:49:33.664727', '2010-07-20 22:49:43.923801', null, null, '10', '2011-10-23 21:08:04.48222', '2011-10-15 02:46:58.872645', '209.129.244.250', '24.5.144.240', '2010-07-20 22:49:54.842879', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('409', 'howardhu@andrew.cmu.edu', 'howard.huang@sv.cmu.edu', '2010-07-20 22:50:12.672473', '2012-04-27 22:45:56.347868', 'f', 't', 'f', 'HowardHuang', 'Hao', 'Huang', 'Howard Huang', '/images/students/2011/FTSE/HowardHuang.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:05:28.930909', 'f', 'Howard', '', '', 'Santa Clara', 'California', 'USA', '808-294-1629', 'hahuang65', 'hahuang65', 'h.huang65@gmail.com', 'Local', '<p>Howard Huang is a student in the full-time SE track at Carnegie Mellon Silicon Valley. My hopes and dreams are to find a well-paying job doing what I love: programming. I am really inspired by a few beautiful iPhone and (especially) Mac programs. I have not quite decided what type of development I would want to do for a job yet, but I am hoping to be part of a small but brilliant team working on anything from Web Development to Game Programming.</p>
<p>I was born in the People''s Republic of China, and moved to Hawaii when I was three and a half. I can speak Chinese, but am not very adept at writing. After attending Iolani School in Hawaii for high school, I went on to Boston University to get his Bachelor''s degree in Computer Systems Engineering.</p>
<p>Some of my interests (besides programming, of course!) are music, video games, and just surfing the net. I like all sorts of music, anything from the 80s, rock, alternative, hip-hop, and classical/symphonic. I love pretty much all video games... and surfing the web finding all sorts of unbelieveable things is a hobby. I also play tennis, and occasionally get back on my violin once in a while.</p>
<p>&nbsp;</p>
<p>Howard is from Boston.</p>', '', '', '', 'Mobile', '559-426-5377', 'Google Voice', '', '', '', '', '411', '14', 't', 'How', '2010-07-20 22:50:22.569124', '2010-07-20 22:50:31.44641', null, null, '7', '2011-07-01 17:10:48.773865', '2011-06-09 01:16:38.775071', '24.6.17.136', '209.129.244.250', '2010-07-20 22:50:38.897906', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('410', 'vgs@andrew.cmu.edu', 'gaurav.sinha@sv.cmu.edu', '2010-07-20 22:50:50.629973', '2012-04-27 22:45:57.710292', 'f', 't', 'f', 'GauravSinha', 'Gaurav', 'Sinha', 'Gaurav Sinha', '/images/students/2011/FTSE/GauravSinha.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:05:45.220542', 'f', 'Vishva', '', '', '', '', '', '408-480-8717', 'gaurav_is_me', 'vsinha_no1', 'vgsinha@gmail.com', 'Local', '', '', '', '', 'Mobile', '', '', '', '', '', '', '410', '12', 't', '', '2010-07-20 22:51:02.240688', '2010-07-20 22:51:10.862819', null, null, '8', '2011-07-15 17:48:30.198244', '2011-06-03 19:13:15.587423', '209.129.244.250', '209.129.244.250', '2010-07-20 22:51:18.58393', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('411', 'ajauhri@andrew.cmu.edu', 'abhinav.jauhri@sv.cmu.edu', '2010-07-20 22:51:29.294851', '2012-06-27 22:57:38.122489', 'f', 't', 'f', 'AbhinavJauhri', 'Abhinav', 'Jauhri', 'Abhinav Jauhri', '/images/students/2011/FTSE/AbhinavJauhri.jpg', '', 'PhD', 'ECE', 'f', 'f', '2011-09-23 17:06:44.260963', 't', ' Abhinav', '', '', '', '', '', '805-341-6496', 'abhinav.jauhri', 'abhinavjauhri', 'abhinav.jauhri@gmail.com', 'Near', '<p>Since childhood I was enamored by the versatility of computers and have always nourished a dream to obtain wisdom of this technology. Bachelors of Technology course in Computer Engineering was my first major step in this direction.<br /><br />When as an adolescent I had first observed a code in GW-Basic, I was able to conceive the enormous power of programming languages. At that age it was amazing for me to observe people interacting and instructing the computer by means of a couple of lines of code. With time I became well acquainted with the semantics of various high-level languages and its working.<br /><br />A MS in Software Engineering would enable me to be understand methodologies involved in comprehending managerial functions and systems for designing an appropriate and large software with the help of software professionals.<br /><br />I have interned with Red Hat India for two months and acquainted myself with version control and frameworks like Seam Telco. In 2009, my three colleagues and I performed well as a team in a national-level competition organized by IBM India.<br /><br />I like to read articles, magazines, books and consult teachers with a view to acquire knowledge wherever required. In this process some of my doubts were cleared but more significantly was the realization of the huge plethora of fields in the study of computer science. Such educational episodes motivated me during the under-graduation&nbsp; studies to pursue higher studies in computers for total conceptual clarity.<br /></p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '20', 't', 'Ab-hi-NAHV Jaw-ha-ri', '2012-06-27 22:57:38.112234', '2010-07-20 22:51:51.291036', null, null, '42', '2011-10-28 03:19:05.474312', '2011-09-16 00:04:30.728439', '108.81.105.79', '204.14.239.224', '2010-07-20 22:52:00.088712', '30', '25', '29', '3', '22', null, null, null, '', null, null, null, null, null);
INSERT INTO "users" VALUES ('412', 'aumuhoza@andrew.cmu.edu', 'arlette.umuhoza@sv.cmu.edu', '2010-07-20 22:52:46.833818', '2012-04-27 22:45:57.388554', 'f', 't', 'f', 'ArletteUmuhoza', 'Arlette', 'Umuhoza', 'Arlette Umuhoza', '/images/students/2011/FTSE/ArletteUmuhoza.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:05:41.580713', 'f', ' ', '', '', '', '', '', '405-532-2673', 'arlette.umuhoza', 'arlette', 'arlette.umuhoza@student.oc.edu', 'Local', '<p>unwritten symphony yet :-)</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '13', 't', 'Arlette Umu-hose-ah', '2010-07-20 22:52:58.338274', '2010-07-20 22:53:07.083389', null, null, '44', '2011-10-10 18:13:16.546048', '2011-10-02 01:31:32.765549', '207.199.231.9', '207.199.231.9', '2010-07-20 22:53:15.471546', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
