INSERT INTO "users" VALUES ('414', 'ialshehr@andrew.cmu.edu', 'ibrahim.alshehri@sv.cmu.edu', '2010-07-20 22:55:04.135691', '2012-04-27 22:46:00.546281', 'f', 't', 'f', 'IbrahimALShehri', 'Ibrahim', 'ALShehri', 'Ibrahim ALShehri', '/images/students/2011/FTSE/IbrahimALShehri.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:06:38.34963', 'f', ' ', 'Saudi Aramco', 'System Analyst', 'Dhahran', '', 'Saudi Arabia', '4082158400', 'shehriih', 'shehriih', 'ibrahim.h@gmail.com', 'Local', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. Trash clearly is not multitudinous. I hope to put my real biography here one day.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '414', '11', 't', 'Ebrahem', '2010-07-20 22:55:14.585372', '2010-07-20 22:55:23.751299', null, null, '7', '2011-08-19 18:15:24.111799', '2011-06-10 03:15:26.695212', '24.6.60.215', '24.6.60.215', '2010-07-20 22:55:31.927982', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
