INSERT INTO "users" VALUES ('416', 'lcx@andrew.cmu.edu', 'leo.xu@sv.cmu.edu', '2010-07-20 22:57:13.610905', '2012-08-31 05:52:06.462034', 'f', 't', 'f', 'LeoXu', 'Leo', 'Xu', 'Leo Xu', '/images/students/2012/SE/LeoXu.jpg', '2012', 'SE', 'DM', 't', 'f', '2012-08-10 17:03:25.582602', 't', ' ', 'AT&T', 'Software Engineer', 'Glendale', 'California', 'USA', '949-4663065', 'kiddington', 'leoxu', 'kiddington@gmail.com', 'Remote', '<p>I came to US long long time ago, finished middle school, high school, and colleges in US.</p>
<p>I went to work for Sun Microsystems for my first job, while doing my first master. When I finished my first master I went to work for AT&amp;T... then I started at CMU for my second master, this time part time again.</p>
<p>My speciality is Java Programming and stock trading. I write very good Java software and I can smell profit in the air.</p>
<p>I live in Pasadena, CA.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '416', '15', 'f', '', '2010-07-20 22:57:23.358299', '2010-07-20 22:57:32.799406', null, null, '95', '2012-08-31 05:52:06.445173', '2012-08-12 16:38:19.328724', '71.84.33.189', '198.228.216.153', '2010-07-20 22:57:40.046704', null, null, null, null, null, null, null, null, '', null, 'Jf38bFupaok7niTtKy3T', '2012-08-31 05:52:06.410938', null, null);
INSERT INTO "users" VALUES ('417', 'weibinx@andrew.cmu.edu', 'weibin.xu@sv.cmu.edu', '2010-07-20 22:57:47.40973', '2012-08-10 17:02:47.612746', 'f', 't', 'f', 'WeibinXu', 'Weibin', 'Xu', 'Weibin Xu', '/images/students/2012/SE/WeibinXu.jpg', '2012', 'SE', 'DM', 't', 'f', '2012-08-10 17:02:47.584276', 't', ' ', 'Qualcomm', 'Senior Engineer', 'Santa Clara', 'California', 'U.S.A', '3038591952', 'binbinxu_sjtu', 'binbinx', 'weibinx@qualcomm.com', 'Local', '<p>I was born and brought up in Shanghai, China. I''ve been in U.S. for&nbsp;8 years and in bay area for 4 years. I got my BS from Shanghai Jiaotong Univ and MS in ECE from University of Colorado at Boulder. Right now, I''m working at Qualcomm, as a firmware engneer. My job mainly involves firmwawre design and implementation on the Qualcomm chipset solution for UMTS modem.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '417', '10', 'f', 'Way-Bin Xu', '2010-07-20 22:58:00.660992', '2010-07-20 22:58:10.679824', null, null, '78', '2012-07-15 22:27:52.329539', '2012-06-26 02:41:51.118116', '67.169.133.230', '67.169.133.230', '2010-07-20 22:58:18.637517', null, null, null, null, null, null, null, null, null, null, 'Yxcqp6WdqZzkTycyxbRx', '2012-07-15 22:27:52.320314', null, null);
