INSERT INTO "users" VALUES ('419', 'sthakkar@andrew.cmu.edu', 'sachin.thakkar@sv.cmu.edu', '2010-07-20 22:58:40.805565', '2012-08-10 17:03:00.588863', 'f', 't', 'f', 'SachinThakkar', 'Sachin', 'Thakkar', 'Sachin Thakkar', '/images/students/2012/SE/SachinThakkar.jpg', '2012', 'SE', 'DM', 't', 'f', '2012-08-10 17:03:00.570856', 't', ' ', 'VMware', 'Software Engineer', 'San Jose', 'CA', 'USA', '4083726565', '', 'sthakkar', '', 'Near', '', '', '', '', 'Mobile', '', '', '', '', '', '', '419', '17', 'f', 'Such-in Tuh-ker', '2010-07-20 22:58:55.800859', '2010-07-20 22:59:04.465323', null, null, '111', '2012-07-23 21:59:52.160263', '2012-06-05 02:11:07.565501', '72.52.96.33', '72.52.96.11', '2010-07-20 22:59:14.427274', null, null, null, null, null, null, null, null, '', null, '8CsKXrrzC4A3mVEpRVAv', '2012-07-23 21:59:51.883225', null, null);
INSERT INTO "users" VALUES ('420', 'acave@andrew.cmu.edu', 'aj.cave@sv.cmu.edu', '2010-07-20 22:59:41.675873', '2012-08-10 17:02:18.026504', 'f', 't', 'f', 'AjCave', 'AJ', 'Cave', 'AJ Cave', '/images/students/2012/SE/AJCave.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:17.882261', 't', 'Aaron', 'Amgen Inc', 'Sr Associate IS Analyst', 'Newbury Park', 'California', 'USA', '1-805-313-2882', '', 'ajcave', 'cavenator@gmail.com', 'Remote', '<p>I was born and raised in Newbury Park, CA.&nbsp; I transferred from Moorpark Community College and graduated Cum Laude with a BS in Computer Science.&nbsp; Immediately upon graduation, I got a job working within Regulated IS in Amgen and then late 2007, I transitioned to Solution Development.&nbsp; I have been working on a multi-site project for the past three years and am currently transitioning to tech lead for that project.&nbsp; We have deployments in Rhode Island, Colorado and Puerto Rico.</p>
<p>My objectives here at Carnegie Mellon is to acquire the skillset and tools necessary to take my career to the next level.&nbsp; I am hoping to get my hands dirty with Java again (or learn&nbsp;some new&nbsp;languages) along the way&nbsp;and contribute alongside with great people.&nbsp;</p>', '', '', '', 'Work', '1-909-969-8845', 'Mobile', '', '', '', '', '1', '36', 'f', '', '2010-07-20 22:59:50.052994', null, null, null, '242', '2012-08-04 05:00:12.73697', '2012-08-04 03:34:37.975627', '98.119.204.150', '98.119.204.150', '2010-07-20 23:00:02.129205', null, null, null, null, null, null, null, null, '', null, 'ZHVHvowy9d8BUq7rbbUB', '2012-08-04 05:00:12.683627', null, null);
INSERT INTO "users" VALUES ('421', 'sdgriffi@andrew.cmu.edu', 'scott.griffin@sv.cmu.edu', '2010-07-20 23:00:54.809718', '2012-08-10 17:02:54.564058', 'f', 't', 'f', 'ScottGriffin', 'Scott', 'Griffin', 'Scott Griffin', '/images/students/2012/SE/ScottGriffin.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:54.541677', 't', ' Scott', 'Google Inc', 'Software Engineer in Test', 'Boulder', 'CO', 'United States of America', '505-750-1114', 'sgriffinusa', 'sgriffinusa', 'sgriffinusa@gmail.com', 'Remote', '', '', '', '', 'Google Voice', '', '', '', '', '', '', '421', '13', 'f', '', '2010-07-20 23:01:06.51445', '2010-07-20 23:01:14.996519', null, null, '103', '2012-07-21 20:26:30.193479', '2012-07-19 02:26:17.572241', '76.25.157.224', '76.25.157.224', '2010-07-20 23:01:22.693162', null, null, null, null, null, null, null, null, 'sgriffinusa', 'icons', null, null, null, null);
INSERT INTO "users" VALUES ('422', 'dtao@andrew.cmu.edu', 'dan.tao@sv.cmu.edu', '2010-07-20 23:01:43.875845', '2012-08-10 17:02:02.920128', 'f', 't', 'f', 'DanTao', 'Dan', 'Tao', 'Dan Tao', '/images/students/2012/SE/DanielTao.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:02.868117', 't', 'Daniel', 'ThoughtWorks', 'Software Consultant', 'San Francisco', 'CA', 'USA', '(610) 416-9561', 'danielltao', 'dtao', 'daniel.tao@gmail.com', 'Local', '', '', '', '', 'Mobile', '', '', '', '', '', '', '422', '16', 'f', '', '2010-07-20 23:02:02.819644', '2010-07-20 23:02:11.307764', null, null, '61', '2012-08-08 16:36:26.815159', '2012-07-30 05:25:28.246064', '38.104.129.82', '67.169.43.142', '2010-07-20 23:02:19.765933', null, null, null, null, null, null, null, null, 'dtao', null, 'Hs6RsW9zCvaQDWCdTjyv', '2012-08-08 16:36:26.803191', null, null);
INSERT INTO "users" VALUES ('423', 'hdli@andrew.cmu.edu', 'hongdi.li@sv.cmu.edu', '2010-07-20 23:02:47.115405', '2012-09-10 01:25:00.744323', 'f', 't', 'f', 'HongdiLi', 'Hongdi', 'Li', 'Hongdi Li', '/images/students/2012/SE/HongdiLi.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:22.507082', 't', 'Hong', 'Optillel Solutions Inc.', 'Software Engineer', 'Berkeley', 'CA', 'USA', '(510)338-8736', 'hongdi.li', 'hongdi_li', 'addee2000@gmail.com', 'Local', '<p>I grew up in Guangzhou, a city in the southeast of China and immigrated to U.S. in 2007 with my family. I earned my BS in Applied Maths from South China University of Techonology. My career started as an Application Engineer at BigFix Inc., a computer security solution provider for enterprise. I obtained rich operating system configuration knowledge across different linux variants and all Windows serires OSes from this position. Later, I received an opputunity to join a start-up company co-founded by UC Berkeley grad students. The company is focusing on providing tools to leverage the power of parallel computating with the existing sequential program.</p>
<p>&nbsp;</p>
<p>I have experience in C/C++ multithread programming and performance tuning on both Windows and Linux. I also have some backgrounds in data mining techniques.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '9', 'f', '', '2010-07-20 23:02:56.525707', '2010-07-20 23:03:17.165609', null, null, '75', '2012-09-10 01:25:00.737554', '2012-08-26 23:47:28.850782', '99.57.25.77', '99.57.25.77', '2010-07-20 23:03:28.108288', null, null, null, null, null, null, null, null, null, null, 'yqTucLK1rdun1Bjt7zjT', '2012-09-10 01:25:00.712749', null, null);
INSERT INTO "users" VALUES ('424', 'lyahdav@andrew.cmu.edu', 'liron.yahdav@sv.cmu.edu', '2010-07-20 23:03:34.992758', '2012-08-24 21:45:03.851433', 'f', 't', 'f', 'LironYahdav', 'Liron', 'Yahdav', 'Liron Yahdav', '/images/students/2012/SE/LironYahdav.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:52.725249', 't', ' ', 'Manilla, LLC.', 'Software Engineer', 'San Francisco', 'CA', 'USA', '415-264-8655', 'lironya', 'lyahdav', 'lyahdav@gmail.com', 'Near', '', '', '', '', 'Mobile', '', '', '', '', '', '', '424', '18', 'f', 'Lee-rone Yah-dav', null, '2010-07-20 23:04:08.561447', null, null, '66', '2012-07-26 02:15:39.976937', '2012-07-12 06:35:39.764758', '173.11.102.102', '69.181.207.47', '2010-07-20 23:04:17.252616', null, null, null, null, null, null, null, null, 'lyahdav', null, null, null, null, null);
INSERT INTO "users" VALUES ('425', 'kangc@andrew.cmu.edu', 'kang.chen@sv.cmu.edu', '2010-07-20 23:07:33.001129', '2012-08-10 17:02:13.292003', 'f', 't', 'f', 'KangChen', 'Kang', 'Chen', 'Kang Chen', '/images/students/2012/SE/KangChen.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:13.176036', 't', '', 'Intuit', 'Software Engineer', 'Menlo Park', 'CA', 'USA', '415-260-5761', 'kangchen1110', 'kimyoutora', 'kangchen614@gmail.com', 'Local', '<p>I was born in China and emigrated to U.S. in 1996. I didn''t know any English at the time but it has become my most natural language right now. Aside from English, I am also a fluent Cantonese speaker and can understand Mandarin pretty well. Besides that, I have developed a strong liking in Japanese culture and knows some very basic Japanese but nothing more.</p>
<p>I am an avid fan of tennis. My first experience with the sport was in high school and have continued to play ever since. One of my top dreams in life is to travel to all four of the major tournaments in tennis.</p>
<p>In terms of education and technical experience, I graduated from UC Berkeley with majors in Computer Science and Economics. I have experience in C, Java, Python, Ruby, and any derivations of the above. I have spent most of my young professional career at Intuit, where I played a key role in their online and social marketing efforts. I worked in a very small team and has had the opportunity to take projects end-to-end from concept to implementation to deployment to testing. Over this period of time, I have developed a strong background in Ruby on Rails. My partner of choice is the Macbook Pro. I have a strong passion for TDD and continuous deployment. Recently, I have also started exploring NoSQL solutions such as MongoDB.</p>
<p>My goals for attending CMU is to acquire organizational skills to be a better leader.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '8', 'f', '', '2010-07-20 23:07:38.845643', '2010-07-20 23:07:49.22788', null, null, '113', '2012-08-08 07:07:50.562533', '2012-08-07 04:49:42.212298', '108.93.41.153', '108.93.41.153', '2010-07-20 23:07:59.342243', null, null, null, null, null, null, null, null, null, null, 'V3mE8ZeWyDahhKmzs72h', '2012-08-08 07:07:50.546354', null, null);
INSERT INTO "users" VALUES ('426', 'mdeats@andrew.cmu.edu', 'mike.deats@sv.cmu.edu', '2010-07-20 23:08:10.016699', '2012-08-10 17:03:16.924037', 'f', 't', 'f', 'MikeDeats', 'Mike', 'Deats', 'Mike Deats', '/images/students/2012/SE/MikeDeats.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:03:16.893457', 't', 'Michael', 'The Boeing Compay', 'Software Engineer', 'Colorado Springs', 'Colorado', 'United Sates', '520-990-5947', 'mikedeats', 'mikedeats', 'mikedeats@gmail.com', 'Remote', '<p>I was born in a town near Dallas Texas, but grew up in the mountains of northern Arizona. &nbsp;I attended the University of Arizona in Tucson, graduating with a degree in Computer Science in 2005. &nbsp;I worked for nearly two years doing embedded C/C++ development for jet engine controllers at Tucson Embedded Systems. &nbsp;I currently work for the Boeing Company in Colorado Springs, Colorado where I build satellite ground system software.&nbsp; My project is the Space-Based Space Surveillance (SBSS) satellite system for the US Air Force, which was launched in September of 2010. &nbsp;I enjoy camping, hiking, scuba diving, skiing, biking, and video games. &nbsp;I''m a huge music and movie lover, and I read voraciously. &nbsp;My favorite author is Ray Bradbury, and my favorite band-of-the-moment is Florence + The Machine.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '426', '13', 'f', '', '2010-07-20 23:08:20.941782', '2010-07-20 23:08:29.712009', null, null, '60', '2012-04-19 02:46:36.051456', '2012-03-07 04:07:23.092369', '24.9.251.173', '130.76.64.119', '2010-07-20 23:08:37.428245', null, null, null, null, null, null, null, null, '', null, 'MTqiJxBGAvDWq8VSHd4c', '2012-04-19 02:46:36.034279', null, null);
INSERT INTO "users" VALUES ('427', 'bttran@andrew.cmu.edu', 'brian.tran@sv.cmu.edu', '2010-07-20 23:12:20.105909', '2012-08-10 17:02:16.027989', 'f', 't', 'f', 'BrianTran', 'Brian', 'Tran', 'Brian Tran', '/images/students/2012/SE/BrianTran.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:15.890126', 't', ' ', 'Box.net', 'Software Engineer', 'Palo Alto', 'CA', 'USA', '5102258720', 'brian.t.tran', 'briantran', 'briantran86@gmail.com', 'Local', '<p>I grew up in the heart of Silicon Valley and started coding back in high school as a way to kill time during the summer breaks. I studied at UC Berkeley for my undergraduate degree in EECS and loved every minute of it (even the long nights in the basements of the computer science buildings). I did a brief stint at Intuit before switching over to Box.Net, a startup working to change the way that enterprises and businesses manage their content through the cloud.</p>
<p>In my free time, I like to play video games, swim, and rub elbows in mosh pits at rock concerts!</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '8', 'f', '', '2010-07-20 23:12:30.115841', '2010-07-20 23:12:41.54058', null, null, '74', '2012-08-05 19:07:58.384854', '2012-08-04 17:15:01.980797', '75.37.192.161', '75.37.192.161', '2010-07-20 23:12:50.19557', null, null, null, null, null, null, null, null, null, null, 'pwBzcAj7KapqWCZMmpPx', '2012-08-05 19:07:58.30943', null, null);
INSERT INTO "users" VALUES ('428', 'clc1@andrew.cmu.edu', 'cliff.chen@sv.cmu.edu', '2010-07-20 23:13:10.672288', '2012-04-27 22:46:00.615535', 'f', 't', 'f', 'CliffChen', 'Cliff', 'Chen', 'Cliff Chen', '/images/students/2011/FTSE/CliffChen.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:06:40.297116', 'f', 'Clifford', '', '', '', '', '', '650-255-5245', '', 'kurifu', 'cliffchen@ucla.edu', 'Near', '<p>Bay Area native, recently graduated in March 2010 with a B.S. in Computer Science and Engineering from UCLA.&nbsp;</p>
<p>&nbsp;</p>
<p>I spent the last 2 years of my undergraduate career working part time for GDMX Warner Bros., creating tools for video compression and automation scripting in the Research and Development department.&nbsp; I also spent my last year at UCLA working on a research project in the Network Research Lab, where I worked on a Network Coding project for Wireless Multihop Networks with a PhD student.&nbsp;</p>
<p>&nbsp;</p>
<p>I am an avid fan of cars, badminton, food (italian!), traveling, and music (hiphop/r&amp;b/alternative/trance/almost anything).</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '428', '15', 't', '', '2010-07-20 23:13:22.69673', '2010-07-20 23:13:31.216576', null, null, '30', '2011-06-29 01:40:37.119696', '2011-06-24 06:47:21.418423', '209.129.244.250', '71.146.18.190', '2010-07-20 23:13:39.111947', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('429', 'vprasad1@andrew.cmu.edu', 'vinay.prasad@sv.cmu.edu', '2010-07-20 23:14:04.694989', '2012-04-27 22:45:58.068821', 'f', 't', 'f', 'VinayPrasad', 'Vinay', 'Prasad', 'Vinay Prasad', '/images/students/2011/FTSE/VinayPrasad.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:05:56.488139', 'f', ' ', '', '', 'Santa Clara', 'CA', 'USA', '4088881987', '', 'vnyprasad', 'vnyprasad86@gmail.com', 'Local', '<p>I was born in India and brought up over here in the bay. I just (like a month ago) got done with my bachelors in Computer Science from San Jose State University. I don''t have much work experience, only internships so far but I''d like to change that. Hopefully after my masters here Ill be able to get into the work force with a bang!</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '429', '14', 't', 've nai', '2010-07-20 23:14:18.518464', '2010-07-20 23:14:27.513853', null, null, '6', '2011-08-31 20:54:49.371626', '2011-06-19 22:50:57.821336', '99.170.148.196', '209.129.244.250', '2010-07-20 23:14:35.148884', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('430', 'pangw@andrew.cmu.edu', 'pang.wu@sv.cmu.edu', '2010-07-20 23:15:20.679602', '2012-09-07 20:36:03.874348', 'f', 't', 'f', 'PangWu', 'Pang', 'Wu', 'Pang Wu', '/images/students/2011/FTSE/PangWu.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:06:10.915875', 'f', '', '', '', 'Mountain View', 'CA', 'USA', '415-595-5276', 'alexpangwu', 'pangwu', 'freezingsoft@hotmail.com', 'Local', '<p>I was born in GuangZhou, China. I get my bachelor degree of Software Engineering from South China University of Technology and Master of Science in Information Technology from the Hong Kong University of Science and Technology. I used to work for Tencent (one year), the biggest Internet comany in China.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '430', '14', 't', '', '2010-07-20 23:15:33.097376', '2010-07-20 23:16:07.329439', null, null, '20', '2012-09-07 20:36:03.852975', '2012-09-06 05:17:50.596494', '24.6.98.114', '24.6.98.114', '2010-07-20 23:16:17.229569', null, null, null, null, null, null, null, null, null, null, 'xx2qpWd2RrXFRiFUGPhM', '2012-09-07 20:36:03.831129', null, null);
INSERT INTO "users" VALUES ('431', 'rse@andrew.cmu.edu', 'rob.engel@sv.cmu.edu', '2010-07-20 23:15:56.4176', '2012-04-27 22:45:58.374846', 'f', 't', 'f', 'RobEngel', 'Rob', 'Engel', 'Rob Engel', '/images/students/2011/FTSE/RobEngel.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:05:59.168525', 'f', 'Robert', 'Tellabs, Inc.', 'Software Engineer LTE', 'Santa Clara', 'CA', 'USA', '408-309-2205', '', 'rengel', 'rob.engel@sv.cmu.edu', 'Local', '<p>I grew up in Sunnyvale, California. I am currently 22 years old. I recently graduated from Macalester College in St. Paul, MN with a degree in Computer Science. I played baseball for my school and have played all my life. My interests include baseball, rock music, racquetball, and working out.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '431', '14', 't', '', '2010-07-20 23:16:25.231325', '2010-07-20 23:16:34.039284', null, null, '8', '2011-07-26 05:14:59.174702', '2011-06-14 03:24:09.000764', '174.253.235.43', '24.6.170.109', '2010-07-20 23:16:41.85153', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
