INSERT INTO "users" VALUES ('432', 'gchawla@andrew.cmu.edu', 'gurmeet.chawla@sv.cmu.edu', '2010-07-21 23:30:40.645413', '2012-07-07 22:02:23.859989', 'f', 't', 'f', 'GurmeetChawla', 'Gurmeet', 'Chawla', 'Gurmeet Chawla', '/images/students/2012/SM/GurmeetChawla.jpg', '2012', 'SM', '', 't', 'f', '2012-06-29 17:02:17.951077', 't', '', 'Ingenuity Systems', 'Lead Developer', 'Redwood City', 'CA', 'USA', '650-235-0405', 'gurmeet.chawla', '', 'gurmeet.chawla@gmail.com', 'Local', '<p>I was born and brought up in Delhi, India. I have been in USA for last 10 years. I have worked with variety of companies in the bay area in different domains. I aspire to be a principle centered leader, who knows what he is talking about. I want to learn from my mistakes and from others.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '432', '8', 'f', '', '2010-07-21 23:30:51.741711', '2010-07-21 23:31:00.717977', null, null, '71', '2012-07-07 22:02:23.858824', '2012-07-02 01:51:29.769929', '69.181.100.59', '69.181.100.59', '2010-07-21 23:31:10.026421', null, null, null, null, null, null, null, null, null, null, 'tW7FvbAqyUncNeEz7dbN', '2012-07-07 22:02:23.839732', null, null);
INSERT INTO "users" VALUES ('433', 'zfb@andrew.cmu.edu', 'zoltan.biacs@sv.cmu.edu', '2010-07-21 23:32:04.088343', '2012-04-27 22:45:56.892475', 'f', 't', 'f', 'ZoltanBiacs', 'Zoltan', 'Biacs', 'Zoltan Biacs', '/images/students/2012/SM/ZoltanBiacs.jpg', '2012', 'SM', '', 't', 'f', null, 't', '', 'Qualcomm, Inc.', 'Director, Engineering', 'Santa Clara', 'CA', 'USA', '408-209-8176', 'zbsfca', '', 'zbiacs@comcast.net', 'Local', '<p>I was born and raised in the former Yugoslavia. Have a background in Earth sciences (Geodetic Engineering, University of Belgrade), earned my M.Sc. at University of Calgary (Canada), moved to USA in 1990. Since then, I have been working on core GPS (Global Positioning System) software development in commercial and consumer systems (desktop, client/server, embedded mobile systems). Worked for Shell Oil R&amp;D in Texas from 1990-93, moved to Silicon Valley and worked for Trimble Navigation 1993-98. In 1998, I joined Snaptrack (assisted GPS startup), later acquired by Qualcomm for $1B in 2000. After working for many years as a scientific programmer, software/systems engineer, I am now leading a team of 30+ engineers and managers working on Qualcomm''s gpsOne and QPoint product lines (LBS systems). I live in San Mateo, CA with my wife (a special education teacher), and our two children (boy and girl). Favorite activities include: books on Kindle, family time, music (jazz and world), movies, practicing my native and learned languages (Hungarian, Serbo-Croatian, English), exercise (swimming, bicycling, running).</p>', '', '', '', 'Mobile', '408-216-6998', 'Work', '', '', '', '', '433', '11', 'f', '', '2010-07-21 23:32:11.138506', '2010-07-21 23:32:19.603704', null, null, '35', '2012-04-20 07:07:05.801803', '2012-04-17 06:05:44.840989', '24.5.183.100', '24.5.183.100', '2010-07-21 23:32:27.172648', null, null, null, null, null, null, null, null, null, null, 'WBQFk8Z9T8vcGD6AqDpi', '2012-04-20 07:07:05.796685', null, null);
