INSERT INTO "users" VALUES ('436', 'kbheeman@andrew.cmu.edu', 'krishna.bheemanadham@sv.cmu.edu', '2010-07-21 23:34:10.399702', '2012-08-31 03:28:48.263676', 'f', 't', 'f', 'KrishnaBheemanadham', 'Krishna', 'Bheemanadham', 'Krishna Bheemanadham', '/images/students/2012/SM/KrishnaBheemanadham.jpg', '2012', 'SM', '', 't', 'f', null, 't', ' Krishna', '', '', 'San Francisco', 'California', 'USA', '6505180302', 'krishnasj', '', 'krishnamohanb@gmail.com', 'Near', '', '', '', '', 'Mobile', '', '', '', '', '', '', '436', '10', 'f', '', '2010-07-21 23:34:20.856068', '2010-07-21 23:34:31.351484', null, null, '257', '2012-08-31 03:28:48.261386', '2012-08-30 16:22:23.635426', '24.6.73.242', '24.6.73.242', '2010-07-21 23:34:39.677079', null, null, null, null, null, null, null, null, '', null, '7c7Q1QGDmiY2JBxGG1H4', '2012-08-30 16:22:23.607744', null, null);
INSERT INTO "users" VALUES ('437', 'aschen@andrew.cmu.edu', 'andrew.chen@sv.cmu.edu', '2010-07-21 23:34:54.775444', '2012-08-10 17:02:50.684917', 'f', 't', 'f', 'AndrewChen', 'Andrew', 'Chen', 'Andrew Chen', '/images/students/2012/SE/AndrewChen.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:50.667211', 't', ' ', 'Neustar', 'Software Engineer', 'Mountain View', 'CA', 'USA', '510-506-0466', 'aschen77', 'aschen77', 'aschen77@yahoo.com', 'Local', '<p>I am a Sunnyvale native.&nbsp; I attended UC Berkeley for undergrad.&nbsp; I currently work at Neustar on Castro St as a Java developer.</p>
<p>&nbsp;</p>
<p>Interests: Basketball, cars, motorcycles, road and mountain biking, anime</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '437', '17', 'f', '', '2010-07-21 23:35:01.883448', '2010-07-21 23:35:10.656955', null, null, '129', '2012-07-02 23:47:45.306995', '2012-06-06 01:02:12.200086', '209.49.21.68', '209.49.21.68', '2010-07-21 23:35:18.108255', null, null, null, null, null, null, null, null, 'aschen77', null, 'MRhCxTKqcU8by5eTY4Ez', '2012-07-02 23:47:45.298905', null, null);
INSERT INTO "users" VALUES ('438', 'dereka@andrew.cmu.edu', 'derek.anderson@sv.cmu.edu', '2010-07-21 23:35:23.685054', '2012-04-27 22:46:00.648312', 'f', 't', 'f', 'DerekAnderson', 'Derek', 'Anderson', 'Derek Anderson', '/images/students/2012/SM/DerekAnderson.jpg', '2012', 'SM', '', 't', 'f', null, 't', ' ', 'Skire', 'Sr. Director of Product Management', 'Menlo Park', 'CA', 'USA', '(415)613-4863', 'reb-danderson', '', 'derekseananderson@mac.com', 'Local', '<p>Although my wife often accuses me of "being raised by sheepherders on the hills of BoingBoing", this is actually not true. My family raises goats, not sheep.</p>
<p>&nbsp;</p>
<p>Since leaving BoingBoing (a small town about an hour north of Detroit, Michigan) I have been working in software development, even though I was advised back in 1987 that there was no future in computers. &nbsp;This apparently unlikely 20-year career has included the following major highlights:</p>
<p style="padding-left: 30px;">- Hands-on software development leadership in the areas of energy, healthcare, magazine distribution and corporate real estate</p>
<p style="padding-left: 30px;">- Publishing five books on software development in the early 1990''s</p>
<p style="padding-left: 30px;">- Founded two real estate&nbsp;technology&nbsp;firms, one I sold in 2003 (www.virtualpremise.com) and the other is currently actively pursuing angel funding.</p>
<p style="padding-left: 30px;">- The stabilization, turn-around and sale of WorkplaceIQ, an Israeli real estate project management SaaS platform.</p>
<p style="padding-left: 30px;">- Direct software sales experience&nbsp;with many&nbsp;Fortune&nbsp;500 clients including: ExxonMobil, Cisco, Boeing, ADP, US Bank, and many others. Launch of&nbsp;European&nbsp;and Asian operational subsidiaries.</p>
<p>&nbsp;</p>
<p>Educationally, I have obtained a Bachelors Degree in Business&nbsp;Administration&nbsp;from Georgia State University and a Masters Degree in Strategic Management from Indiana University.</p>
<p>&nbsp;</p>
<p>Generally I work only to support my bad habits, which include:&nbsp;collecting&nbsp;wine, travel, SCUBA diving, photography, collecting antique Alfa Romeo''s and avoiding household chores.&nbsp;</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '438', '18', 'f', '', '2010-07-21 23:35:34.644919', '2010-07-21 23:35:43.331128', null, null, '9', '2011-10-14 17:07:29.288802', '2011-07-09 18:09:08.852416', '24.7.126.176', '24.7.126.176', '2010-07-21 23:35:50.548816', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('439', 'pantypas@andrew.cmu.edu', 'peter.antypas@sv.cmu.edu', '2010-07-21 23:36:01.442415', '2012-04-27 22:46:00.815024', 'f', 't', 'f', 'PeterAntypas', 'Peter', 'Antypas', 'Peter Antypas', '/images/students/2012/SM/PeterAntypas.jpg', '2012', 'SM', '', 't', 'f', null, 't', ' ', 'Intelepeer, Inc', 'Senior Software Architect', 'Denver, CO via Emeryville, CA', 'CA', 'USA', '650-575-6918', 'peter_antypas', '', 'peter.antypas@gmail.com', 'Near', '<p>I grew up in Greece but I have wanted to move West ever since I can remember myself. I managed to do that 21 years ago, so I have lived exactly half my life there and half my life here. The second half has been far more interesting and enjoyable than the first half.</p>
<p>I first came to the States on an F1 visa. I am a self-made person and somewhat of a maverick :)</p>
<p>I have a variety of interests that continuously evolve. These days, my main recreational activities are sailing (own boat) and cycling. As for my past, well, let it be the past ... it was fun, but now it''s done.</p>
<p>&nbsp;</p>
<p>&nbsp;</p>
<p>&nbsp;</p>
<p>&nbsp;</p>
<p>&nbsp;</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '439', '11', 'f', '', '2010-07-21 23:36:15.567801', '2010-07-21 23:36:24.311822', null, null, '27', '2011-12-07 02:17:53.001193', '2011-12-05 01:24:18.222803', '69.181.154.157', '69.181.154.157', '2010-07-21 23:36:32.426468', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('440', 'ydo@andrew.cmu.edu', 'david.oh@sv.cmu.edu', '2010-07-21 23:47:46.420375', '2012-07-06 16:29:05.174421', 'f', 't', 'f', 'DavidOh', 'David', 'Oh', 'David Oh', '/images/students/2012/SM/DavidOh.jpg', '2012', 'SM', '', 't', 'f', '2011-06-24 17:05:34.718933', 't', 'David ', 'FeelingK', 'CPO/EVP of Global Business', 'Seattle', 'Washington', 'US', '425 753 9483', 'davidyh.oh', '', 'davidyh.oh@gmail.com', 'Remote', '<p>David is a multi-talented innovator who introduced the first Ringback Tones to the wireless world. As a CPO and EVP of Global Business at FeelingK, a global mobile technology company based in Seoul, S. Korea, he brings this visionary talent to company along with 20 years breaking new ground in product management, platform development, personalization services, and CRM for the telecommunications and wireless industries.</p>
<p>A highlight of David''s career includes his instrumental role at WiderThan (purchased by RealNetworks in 2006), the company that pioneered Ringback Tones. With his guidance, reach steadily grew to 300 million subscribers through 19 global wireless operators, and an industry standard was born. David changed the face of mobile entertainment for major wireless customers such as Verizon, AT&amp;T, Sprint, and Vodafone in multiple countries. Prior to these successes, he held a leadership position at AirCROSS a commercial mobile marketing platform that attracted major global brands such as Coca Cola, P&amp;G and Nike.</p>
<p>David started his career at SK Energy directing all aspects of CRM for the $16 Billion Energy Company. He first entered the telecom world at SK Telecom, at the development helm of a CRM platform and service that managed acquisition, customer life-time value maximization, cross selling/up selling and customer retention.</p>', '<html />', '', '', 'Mobile', '', '', '', '', '', '', '440', '7', 'f', '', '2010-07-21 23:47:57.542288', '2010-07-21 23:48:06.860207', null, null, '44', '2012-07-06 16:27:06.738442', '2012-01-16 07:05:29.536838', '71.197.144.85', '71.197.144.85', '2010-07-21 23:48:15.257943', null, null, null, null, null, null, null, null, '', null, 'wqs8qqHDsDxYLDwGsyeb', '2012-07-06 16:27:06.725681', null, null);
INSERT INTO "users" VALUES ('441', 'gpay@andrew.cmu.edu', 'geoff.pay@sv.cmu.edu', '2010-07-21 23:48:41.014515', '2012-04-27 22:45:58.035587', 'f', 't', 'f', 'GeoffPay', 'Geoff', 'Pay', 'Geoff Pay', '/images/students/2012/SM/GeoffryPay.jpg', '2012', 'SM', '', 't', 'f', null, 't', 'Geoffrey', '', '', 'San Francisco', 'CA', 'US', '415.894.0734', 'bolobao08', '', 'geoffrey.pay@gmail.com', 'Near', '<p><span style="font-family: Arial; font-size: 15px; white-space: pre-wrap;">Over 10 years, I have gained experience as a developer, designer, and product marketing executive with various web and software companies. Most recently, I held the role of marketing director for Rotten Tomatoes (formerly part of Fox Interactive Media), a company I helped start as part of the founding team in 1999. I''ve also played <span style="font-family: Arial; font-size: 15px; white-space: pre-wrap;">early stage </span>roles involving the design and launch of web, iTV, social media, and desktop products. For more about me and my work, visit www.geoffnet.com.</span></p>', '', '', '', 'Google Voice', '', '', '', '', '', '', '441', '35', 'f', '', '2010-07-21 23:48:52.833464', '2010-07-21 23:49:01.510908', null, null, '31', '2012-04-23 18:03:34.4651', '2012-04-03 02:08:28.607907', '99.112.68.197', '209.129.244.250', '2010-07-21 23:49:08.833925', null, null, null, null, null, null, null, null, '', null, 'dSge5ccGpn3Ffzr89uy5', '2012-04-23 18:03:34.438593', null, null);
INSERT INTO "users" VALUES ('442', 'rprasad@andrew.cmu.edu', 'ravi.prasad@sv.cmu.edu', '2010-07-21 23:49:08.834235', '2012-08-14 20:25:50.803007', 'f', 't', 'f', 'RaviPrasad', 'Ravi', 'Prasad', 'Ravi Prasad', '/images/students/2012/SM/RaviPrasad.jpg', '2012', 'SM', '', 't', 'f', '2012-06-29 17:02:17.013841', 't', '', 'TIBCO Software Inc.', 'Director, Engineering Services', 'Palo Alto', 'California', 'USA', '650 804 4190', 'raaveee', '', 'rprasad@tibco.com', 'Local', '', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '8', 'f', 'raavee', '2010-07-21 23:49:18.367145', '2010-07-21 23:49:27.096934', null, null, '56', '2012-08-14 20:25:50.792181', '2012-08-14 03:04:05.007405', '63.100.100.5', '63.100.100.5', '2010-07-21 23:49:35.01811', null, null, null, null, null, null, null, null, null, null, 'ABEGboYB7v26tNXkHoqt', '2012-08-14 20:25:50.777161', null, null);
INSERT INTO "users" VALUES ('443', 'tangao@andrew.cmu.edu', 'tan.gao@sv.cmu.edu', '2010-07-21 23:49:42.922553', '2012-08-08 17:42:40.933433', 'f', 't', 'f', 'TanGao', 'Tan', 'Gao', 'Tan Gao', '/images/students/2012/SM/TanGao.jpg', '2012', 'SM', '', 't', 'f', null, 't', ' ', 'Google', 'Technical Solutions Engineer', 'Mountain View', 'California', 'US', '650-383-8663', 'wwtgao', '', 'wwtgao@gmail.com', 'Local', '<p>Quick facts</p>
<ul>
<li><span style="font-size: 10px;">A native of Xi''an, China&nbsp;</span></li>
<li><span style="font-size: 10px;">Finished high school in Massachusetts (New England Clam Chowder!)&nbsp;</span></li>
<li><span style="font-size: 10px;">Attended undergraduate (BSEE) in North Carolina (Sweet tea and biscuits!)&nbsp;</span></li>
<li><span style="font-size: 10px;">Attended (1st) graduate school in California (MSEE)&nbsp;</span></li>
<li><span style="font-size: 10px;">Worked for one startup in Milpitas, CA for 2 years (went public in Taiwan)&nbsp;</span></li>
<li><span style="font-size: 10px;">Currently working on Chrome OS (open source!)&nbsp;</span></li>
</ul>
<p>Interests</p>
<ul>
<li><span style="font-size: 10px;">leisure travel (e.g. road trips, nature exploration)&nbsp;</span></li>
<li><span style="font-size: 10px;">history (e.g. eastern, western, country-specific, modern/ancient)&nbsp;</span></li>
<li><span style="font-size: 10px;">cooking (mostly Chinese here, started rudimentary baking)&nbsp;</span></li>
<li><span style="font-size: 10px;">helping others out (circumstances vary :-)&nbsp;</span></li>
<li><span style="font-size: 10px;">spending time w/ friends and family</span></li>
</ul>', '<p>roger roger</p>', '', '', 'Google Voice', '', '', '', '', '', '', '443', '10', 'f', '', '2010-07-21 23:49:53.194263', '2010-07-21 23:50:02.432902', null, null, '40', '2012-08-08 17:42:40.930443', '2012-05-30 00:43:48.795826', '216.239.45.4', '216.239.45.4', '2010-07-21 23:50:10.316093', null, null, null, null, null, null, null, null, null, null, 'JaK2UqygyH23wvoix6N7', '2012-08-08 17:42:40.914594', null, null);
INSERT INTO "users" VALUES ('444', 'pmelzer@andrew.cmu.edu', 'phil.melzer@sv.cmu.edu', '2010-07-21 23:52:01.562129', '2012-04-27 22:45:59.14517', 'f', 't', 'f', 'PhilMelzer', 'Phil', 'Melzer', 'Phil Melzer', '/images/students/2011/FTSE/PhilMelzer.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:06:14.536272', 'f', 'Philip', '', '', '', '', '', '203 524 0098', '', 'pmelzer', 'phil.melzer@sv.cmu.edu', 'Local', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. Trash clearly is not multitudinous. I hope to put my real biography here one day.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '12', 't', '', '2010-07-21 23:52:14.03633', '2010-07-21 23:52:22.731373', null, null, '3', '2011-09-24 02:18:19.911763', '2011-06-23 21:23:00.61599', '76.126.209.65', '209.129.244.250', '2010-07-21 23:52:30.074614', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('445', 'rbaxi@andrew.cmu.edu', 'rahul.baxi@sv.cmu.edu', '2010-07-21 23:52:38.25156', '2012-04-27 22:45:56.954752', 'f', 't', 'f', 'RahulBaxi', 'Rahul', 'Baxi', 'Rahul Baxi', '/images/students/2011/FTSE/RahulBaxi.jpg', '2011', 'SE', 'Tech', 'f', 'f', '2011-09-23 17:05:34.381598', 'f', ' ', '', '', '', '', '', '650-276-9757', '', 'rahulbaxi', 'rahul.baxi@gmail.com', 'Near', '', '', '', '', 'Mobile', '', '', '', '', '', '', '445', '14', 't', 'Raa-hool', '2010-07-21 23:53:03.896934', '2010-07-21 23:53:12.378112', null, null, '23', '2011-08-04 14:49:50.277553', '2011-08-04 14:48:01.467773', '208.54.5.179', '208.54.5.255', '2010-07-21 23:53:19.63103', '18', '20', '2', '7', '3', null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('446', 'rlucio@andrew.cmu.edu', 'ryan.lucio@sv.cmu.edu', '2010-07-21 23:53:15.444483', '2012-08-10 17:02:13.129595', 'f', 't', 'f', 'RyanLucio', 'Ryan', 'Lucio', 'Ryan Lucio', '/images/students/2012/SE/RyanLucio.jpg', '2012', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:13.062106', 't', ' ', 'Violin Memory', 'Senior Software Engineer', 'Mountain View', 'CA', 'USA', '650-515-5669', 'rdlucio', 'rlucio', 'ryan.lucio@gmail.com', 'Local', '<p>I''ve been in Silicon Valley for seven years.&nbsp; My undergraduate degree is in Computer Engineering and I have been a software engineer for pretty much the whole time I''ve been out here.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '446', '16', 'f', 'Ryan Lu-see-oh', '2010-07-21 23:53:25.641611', '2010-07-21 23:53:35.426737', null, null, '48', '2012-08-06 06:39:22.626367', '2012-08-02 01:52:32.766895', '98.207.195.83', '98.207.195.83', '2010-07-21 23:53:46.70175', null, null, null, null, null, null, null, null, 'rlucio', null, 'cvgHesN4mjjM8xe2J7yY', '2012-08-06 06:39:22.550231', null, null);
INSERT INTO "users" VALUES ('450', 'imuruges@andrew.cmu.edu', 'ilangovan.murugesan@sv.cmu.edu', '2010-07-21 23:57:13.305931', '2012-04-27 22:46:00.048455', 'f', 't', 'f', 'IlangovanMurugesan', 'Ilangovan', 'Murugesan', 'Ilangovan Murugesan', '/images/students/2012/SM/IlangovanMurugesan.jpg', '2012', 'SM', ' ', 't', 'f', null, 't', ' ', 'PalPal Inc.', 'Senior MTS ', 'San Jose', 'California', 'USA', '1-408-391-3471', 'ilangovan.murugesan', '', 'milangs@yahoo.com', 'Unknown', '<p>
<p style="text-align: left;"><span id="_marker">&nbsp;</span><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span style="font-size: small;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; I have over fourteen years of software development life cycle experience in a wide range of technologies and numerous telecommunications and networking application development projects. I have proficiency in web application development, networking protocols and performance tuning. I had led multiple global teams efficiently to project completion, utilizing cost effective techniques and within schedule and budget. </span></span></p>
</p>
<p class="MsoNormal" style="margin: 0in 0in 0pt;"><span style="font-size: 12pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Now I am at the crossroads where I decided to take my management and technical skills to the next level. In the future I am planning to possibly move on to entrepreneurship and start my own software company. With that in mind I would like to learn how to be an effective leader. I want to learn to be an excellent public speaker and efficient writer. </span></p>
<p class="MsoNormal" style="text-align: left;"><span style="font-size: 12pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">&nbsp;</span><span style="font-size: 12pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">&nbsp;&nbsp;&nbsp;&nbsp; I want to be a people person and do something useful to them. </span><span style="font-size: 12pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: AR-SA;">As a first step, I want to be out of the box with everybody :-)</span></p>', '', '', '', 'Mobile', '1-408-967-6532', 'Work', '', '', '', '', '450', '11', 'f', '', '2010-07-21 23:57:22.64599', '2010-07-21 23:57:31.416339', null, null, '33', '2012-02-14 02:28:31.388471', '2012-02-02 01:03:50.579451', '72.48.76.129', '216.113.168.128', '2010-07-21 23:57:38.829774', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('451', 'hhlaing@andrew.cmu.edu', 'htin.hlaing@sv.cmu.edu', '2010-07-22 17:29:21.687973', '2012-08-12 05:37:24.46397', 'f', 't', 'f', 'HtinHlaing', 'Htin', 'Hlaing', 'Htin Hlaing', '/images/students/2012/SM/HtinHlaing.jpg', '2012', 'SM', '', 't', 'f', null, 't', '', 'Attributor', 'VP of Engineering', 'San Mateo', 'California', 'U.S.A', '510 468 1991', 'h_hlaing', '', 'hhlaing@gmail.com', 'Near', '<p>&nbsp;</p>
<p>After 15 years of work experience, I am starting a new journey with two parallel tracks in my professional life.&nbsp; I am now in M.S Software Management program here in CMU Silicon Valley.&nbsp; At the same time, I am now a VP of Engineering managing a group of very talented engieers, QA and IT.&nbsp; I am confident that two complement each other.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '451', '10', 'f', '', '2010-07-22 17:29:44.119106', '2010-07-22 17:29:53.169267', null, null, '60', '2012-08-12 05:37:24.461522', '2012-08-10 19:10:26.594219', '24.6.178.200', '208.74.182.225', '2010-07-22 17:30:01.823651', null, null, null, null, null, null, null, null, '', null, 'vGQiizRCpykARj6B7zFE', '2012-08-12 05:37:24.447988', null, null);
