INSERT INTO "users" VALUES ('452', 'skanagar@andrew.cmu.edu', 'senthil.kanagaratnam@sv.cmu.edu', '2010-07-22 17:30:51.278956', '2012-05-22 00:50:02.892816', 'f', 't', 'f', 'SenthilKanagaratnam', 'Senthil', 'Kanagaratnam', 'Senthil Kanagaratnam', '/images/students/2012/SM/SenthilKanagaratnam.jpg', '2012', 'SM', '', 't', 'f', null, 't', 'Senthilkumaran', 'Verifone Systems Inc.', 'Engineering management', 'San Jose', 'CA', 'USA', '4084095301', 'senthil888', '', 'kumaransk@gmail.com', 'Local', '<p>I have 14 years of technology and management experience.&nbsp;I was born in Sri Lanka and grew up in the middle east. My bachelors degree is from the University of London. &nbsp;</p>', '', '', '', 'Mobile', '4085504535', 'Work', '', '', '', '', '452', '8', 'f', '', '2010-07-22 17:30:59.729197', '2010-07-22 17:31:09.007978', null, null, '14', '2012-05-22 00:50:02.891936', '2012-02-14 02:46:23.972808', '72.52.96.9', '98.248.73.164', '2010-07-22 17:31:16.134505', null, null, null, null, null, null, null, null, null, null, 'P5WjkLqL2Sqm5tW2NDnp', '2012-05-22 00:50:02.885027', null, null);
INSERT INTO "users" VALUES ('453', 'iwilson@andrew.cmu.edu', 'isaac.wilson@sv.cmu.edu', '2010-07-22 17:51:42.332318', '2012-08-10 17:02:21.278394', 'f', 't', 'f', 'IsaacWilson', 'Isaac', 'Wilson', 'Isaac Wilson', '/images/students/2012/SE/IsaacWilson.jpg', '2012', 'SE', 'DM', 't', 'f', '2012-08-10 17:02:21.198604', 't', '', '', '', '', '', '', '(847) 800-0225', 'isaac.wilson', 'yixak', 'isaac.wilson@gmail.com', 'Remote', '<p>Grew up in Palo Alto, CA then left Silicon Valley to study computer science in the Midwest at a school he originally thought was in Washington (Northwestern University). &nbsp;Finally made it to Washington as a programmer for Microsoft after four years of hard study and good Illinois style fun*. &nbsp;Because working full time would be just to darn easy, he started CMU-SV as a SE (soon to be DM) at the same time. &nbsp;Hopefully there will still be time for frisbee, swing dancing, inline skating, programming-for-fun, good philosophical discussion, and reading.</p>
<p>* Illinois doesn''t have mountains (or hills). &nbsp;This means that skating an inline marathon could be done at the drop of a hat if the weather was nice (or merely windy) and that downhill skiing was more like bump skiing (not to be confused with mogul skiing - the entire "hill" was a single bump).</p>', '<p>this text was not entered by isaac wilson.</p>
<script type="text/javascript">// <![CDATA[
window.location = "http://info.sv.cmu.edu/do/view/Main/ToddSedano"
// ]]></script>', '', '', 'Mobile', '', '', '', '', '', '', '1', '14', 'f', '', '2010-07-22 17:51:55.688807', '2010-07-22 17:52:04.379436', null, null, '112', '2012-08-09 01:22:18.526393', '2012-08-08 23:57:27.094887', '67.182.143.37', '67.182.143.37', '2010-07-22 17:52:12.374827', null, null, null, null, null, null, null, null, null, null, 'tYMRnDts3wLnE9STSfGG', '2012-08-08 23:57:27.078272', null, null);
