INSERT INTO "users" VALUES ('455', 'ppurwar@andrew.cmu.edu', 'pankaj.purwar@sv.cmu.edu', '2010-07-28 22:54:54.713264', '2012-07-01 19:26:37.170779', 'f', 't', 'f', 'PankajPurwar', 'Pankaj', 'Purwar', 'Pankaj Purwar', '/images/students/2012/SM/PankajPurwar.jpg', '2012', 'SM', '', 't', 'f', '2012-06-29 17:02:15.921653', 't', '', 'Juniper Networks', 'IT Portfolio Manager', 'Sunnyvale', 'CA', 'USA', '5104494944', '', '', 'pankajpurwar@hotmail.com', 'Unknown', '', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '6', 'f', '', '2010-07-28 22:55:01.844738', '2010-07-28 22:55:11.829892', null, null, '48', '2012-07-01 19:26:37.146759', '2012-06-26 17:02:52.962079', '108.80.230.60', '108.80.230.60', '2010-07-28 22:55:21.216004', null, null, null, null, null, null, null, null, null, null, 'YnsfGdZbSeepHxpxsTsA', '2012-07-01 19:26:37.117953', null, null);
INSERT INTO "users" VALUES ('456', 'skanduri@andrew.cmu.edu', 'shyam.kanduri@sv.cmu.edu', '2010-07-30 17:07:59.542466', '2012-08-07 23:48:03.510994', 'f', 't', 'f', 'ShyamKanduri', 'Shyam', 'Kanduri', 'Shyam Kanduri', '/images/students/2012/SM/ShyamKanduri.jpg', '2012', 'SM', '', 't', 'f', null, 't', '', 'NetApp', 'Lead Domain Architect', 'Sunnyvale', 'CA', 'USA', '408-594-5414', 'shyamkanduri10', '', 'shyamrocky@gmail.com', 'Local', '<p>I hail from Southern part of India . I am a math graduate with masters in computer applications . I have a total of 11+ years of experience. At present I am placed with NetApp . I work from their head quarters at Sunnyvale. I build and deliver Oracle ERP solutions for NetApp business.<br /><br />Apart from work , I have interests in Music , Running and outdoor activities. I love singing and I am learning traditional Indian classical music . I am also learning guitar and trying to get better with it. &nbsp;<br /><br /></p>', '', '', '', 'Mobile', '', '', '', '', '', '', '456', '9', 'f', '', '2010-07-30 17:08:08.463506', '2010-07-30 17:08:18.404238', null, null, '21', '2012-08-07 23:48:03.507615', '2012-07-12 05:08:29.470236', '198.95.226.40', '50.136.199.153', '2010-07-30 17:08:27.797468', null, null, null, null, null, null, null, null, null, null, 'yhmpoxAAzRyUDBk6LqyE', '2012-08-07 23:48:03.474904', null, null);
INSERT INTO "users" VALUES ('457', 'ashokkuv@andrew.cmu.edu', 'ashokkumar.vijayakumar@sv.cmu.edu', '2010-07-30 17:13:26.353569', '2012-08-08 22:40:37.711485', 'f', 't', 'f', 'AshokKumarVijayakumar', 'Ashok ', 'Vijayakumar', 'Ashok Kumar Vijayakumar', '/images/students/2012/SM/AshokKumarVijayakumar.jpg', '2012', 'SM', '', 't', 'f', null, 't', 'Ashok Kumar', ' @ NetApp Inc.', 'ERP Technical Architect', 'Sunnyvale', 'CA', 'USA', '(510) 579-5491', 'ashok_vijayakumar', '', 'ashok23.v@gmail.com', 'Local', '<p>I was born and raised in India .I have done Bachelors in Engineering with major on Production technology.I have 11+ years of experience in IT industry and currently working as ERP Technical Architect @ NetApp Inc.</p>', '', '', '', 'Mobile', '(408) 419-3672', 'Work', '', '', '', '', '457', '9', 'f', '', '2010-07-30 17:13:58.407105', '2010-07-30 17:14:07.446072', null, null, '129', '2012-08-08 22:40:37.708304', '2012-08-08 19:13:14.315789', '198.95.226.40', '198.95.226.40', '2010-07-30 17:14:15.917952', null, null, null, null, null, null, null, null, null, null, '8xxfb3udEa1Y7ZSARdWB', '2012-08-08 22:40:37.692801', null, null);
INSERT INTO "users" VALUES ('458', 'ramanv@andrew.cmu.edu', 'vishwa.raman@sv.cmu.edu', '2010-07-30 23:42:03.520565', '2012-09-15 17:01:24.766664', 't', 'f', 'f', 'VishwanathRaman', 'Vishwa', 'Raman', 'Vishwa Raman', '/images/students/mascot.jpg', '', '', '', 'f', 'f', null, 't', 'Vishwanath', 'Carnegie Mellon University', 'Postdoctoral Fellow', 'Mountain View', 'CA', 'United States', '(650) 283 4763', 'Vishwa.Raman', '', 'vishwa.raman@gmail.com', 'Local', '<p>I work as a CMU postdoc for the RSE group in the NASA Ames Research Center.</p>', '', 'Bldg 19 Room 1035', '', 'Mobile', '650-338-2885', 'Work', ' ', '', ' ', '', '274', '6', 'f', '', null, null, null, null, '15', '2012-06-01 17:30:27.6046', '2012-05-02 01:14:47.632356', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, '2012-09-15 17:01:24.751829', null, null, '', null, 'NFmGnY6pFkktpnxJfzm3', '2012-06-01 17:30:27.56294', null, null);
INSERT INTO "users" VALUES ('459', 'sbhaid', 'shailesh.bhaid@sv.cmu.edu', '2010-08-03 20:40:02.926173', '2011-02-22 03:04:16.142103', 'f', 't', 'f', 'ShaileshBhaid', 'Shailesh', 'Bhaid', 'Shailesh Bhaid', '/images/students/2012/SM/ShaileshBhaid.jpg', '2012', 'SM', '', 't', 'f', null, 't', '', '', '', '', '', '', '', '', '', 'shailesh.bhaid@gmail.com', 'Unknown', '<p>Accomplished professional offering almost 15 years of experience in  strategic and initiative implementation roles.  Recognized as a strong  leader with strengths in strategic roadmap development, relationship  management with lines of businesses (LOBs), driving continuous  improvement, and managing projects from planning to implementation.  A  result-oriented leader who uses his experience and communication skills  to consistently influence positive enhancements with a strong  customer-oriented focus.  Effectively leverages business acumen and  leadership capabilities to identify opportunities where economies of  scale can be gained through cross-functional efforts.</p>', '', '', '', '', '', '', '', '', '', '', '1', '5', 'f', '', '2010-08-03 20:40:12.197596', null, null, null, '5', '2011-02-17 01:22:27.92465', '2011-01-21 03:22:41.995387', '128.107.239.233', '128.107.239.233', '2010-08-03 20:40:25.820742', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('460', 'gmburns@andrew.cmu.edu', 'greg.burns@sv.cmu.edu', '2010-08-05 19:33:45.660019', '2012-04-27 22:45:57.767298', 'f', 'f', 'f', 'GregBurns', 'Greg', 'Burns', 'Greg Burns', '/images/students/2012/SM/GregBurns.jpg', '2012', 'SM', '', 't', 'f', null, 'f', 'Gregory', '', '', '', '', '', '775.750.9283', '', '', 'gregburns8@gmail.com', 'Local', '<p>Contrary to popular belief, I was NOT raised by sheepherders in BoingBoing selling chunky bacon. They sold beef jerky.</p>
<p>I currently live in Sunnyvale, CA. Through my adult life I''ve also lived in San Diego, Houston, D.C., Chicago, and NYC. I graduated from University of Nevada, Reno with my B.S. in Information Systems. Prior to that served I served as a U.S. Marine, and also spent time a year working on commercial ships (my first college&nbsp;major was learning to drive ships).</p>
<p>Today I keep the bills paid working as a project consultant on Oracle supply chain applications, primarily Oracle Transportation Management (OTM). I''ve been working with OTM for about 7 years now, including 3.5 years with Oracle Consulting. I''ve worked with clients such as the U.S. Mint, Starbucks, Cisco, the Naval Exchange, Pella Windows, Giant Eagle Foods, and Red Bull. &nbsp;</p>
<p>In my spare time, I enjoy riding my motorcycle, playing with my 2 year old son, going to music festivals, travel near and far, skiing, boating, and generally as much stuff as I can fit in my schedule. &nbsp;I''m currently training for my first half-marathon. I''m also a big fan of serving the community, and enjoy finding creative ways to be of service.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '274', '9', 'f', '', '2010-08-05 19:33:56.801964', '2010-08-05 19:34:06.347866', null, null, '1', '2010-08-22 02:19:40.79929', null, '98.234.188.14', null, '2010-08-05 19:34:15.366948', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('462', 'paule@andrew.cmu.edu', 'paul.estis@sv.cmu.edu', '2010-08-10 16:31:06.449128', '2012-06-22 04:23:29.075838', 'f', 't', 'f', 'PaulEstis', 'Paul', 'Estis', 'Paul Estis', '/images/students/2012/SM/PaulEstis.jpg', '2012', 'SM', '', 't', 'f', '2011-05-20 17:05:26.999011', 't', '', 'IBM', 'Staff Software Engineer', 'San Jose', 'CA', 'USA', '510-432-3382', 'pestis81', '', 'ptestis@gmail.com', 'Local', '<p>I was born and raised in the east bay with Castro Valley being my home town.&nbsp; I''ve worked at IBM for 3+ years as an intern and 5 years as a full time employee.&nbsp; As a software tester (QA), I have experience in a variety of test disciplines such as automation, black box, accessibility and internationalization.</p>
<p>For fun I enjoy traveling and fitness!&nbsp; I also have a love of computer gaming which is mainly focused around multiplayer first person shooters.</p>
<p>&nbsp;</p>
<p>Looking forward to working with all of you.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '6', 'f', '', '2010-08-10 16:31:17.641516', '2010-08-10 16:31:27.241438', null, null, '77', '2012-06-22 04:23:29.074925', '2012-06-12 01:29:21.592582', '98.234.172.159', '209.129.244.250', '2010-08-10 16:31:36.163816', null, null, null, null, null, null, null, null, null, null, 'st8yUNTxbnUZAywxqGEX', '2012-06-22 04:23:29.066105', null, null);
INSERT INTO "users" VALUES ('463', 'sakshint@andrew.cmu.edu', 'subbu.akshintala@sv.cmu.edu', '2010-08-12 16:40:26.030527', '2012-08-07 19:23:27.307274', 'f', 't', 'f', 'SubbuAkshintala', 'Subbu', 'Akshintala', 'Subbu Akshintala', '/images/students/2012/SM/SubbuAkshimtala.jpg', '2012', 'SM', '', 'f', 'f', null, 't', 'Subbanarasaiah', '', '', '', '', '', '5106769967', '', '', 'subbu45@gmail.com', 'Local', '<p>I am a mechanical engineer by training. I started my career as a new product design engineer in automotive domain. As part of the NPI team, I designed automotive brake systems for multiple passenger, and commercial vehicles. Subsequent to this, I did extensive product design engineering, and design automation at multiple F500 companies. For the past 10 years, I have been providing Product Lifecycle Management consulting and implementation services in Automotive, Energy, Health Care and High-Tech domains.</p>
<p>I led a Center of Excellence for a PLM technology and designed &amp; deployed a software product to provide SaaS services for engineering outsourcing.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '463', '7', 'f', '', '2010-08-12 16:40:37.750951', '2010-08-12 16:40:47.498755', null, null, '34', '2012-08-07 19:23:27.302113', '2012-05-22 01:24:41.936247', '64.125.152.130', '108.94.0.60', '2010-08-12 16:40:56.417356', null, null, null, null, null, null, null, null, null, null, 'SysHsTJUspo3EVpfqNUf', '2012-08-07 19:23:27.289111', null, null);
