INSERT INTO "users" VALUES ('469', '1282261411.69733', 'evgeny.sitnikov@sv.cmu.edu', '2010-08-19 23:43:31.845673', '2012-03-01 22:17:36.244955', 't', 'f', 'f', 'EvgenySitnikov', 'Evgeny', 'Sitnikov', 'Evgeny Sitnikov', '/images/mascot.jpg', '', '', '', 'f', 'f', null, 'f', '', '', '', '', '', '', '', '', '', 'evgeny.sitnikov@googlemail.com', 'Unknown', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. People''s trash clearly isn''t multitudinous. I hope to put my real biography here one day.</p>', '', '', '', '', '', '', '', '', '', '', '348', '5', 'f', '', '2010-08-19 23:43:42.897194', '2010-08-19 23:43:52.647916', null, null, '0', null, null, null, null, '2010-08-19 23:44:02.705009', null, null, null, null, null, null, null, null, '', null, null, null, null, null);
INSERT INTO "users" VALUES ('474', '1282400639.69823', 'tai.greene@sv.cmu.edu', '2010-08-21 14:23:59.861386', '2011-06-20 18:25:31.898923', 'f', 't', 'f', 'TaiGreene', 'Tai', 'Greene', 'Tai Greene', '/images/students/2012/SM/TaiGreene.jpg', '2012', 'SM', '', 't', 'f', null, 't', '', 'Exthusia', 'Managing Partner', 'Playa Del Rey', 'CA', 'USA', '(310) 734-9093', 'taigreene', '', 'taigreene@gmail.com', 'Remote', '<p>Creative, Zero Time Strategist, Technologist, Box Free Risk Taker are the make-up of serial entrepreneur Tai Greene. He is an ardent, motivated and passionate technocrat who is quickly carving his niche in this rapidly evolving space.&nbsp;</p>
<p>Tai has made a career simplifying and demystifying new media and technology for businesses, organizations and individuals to build relationships and generate profit by adding value. Known for his passion, creativity and energy, Tai has done creative and technical engagements for the likes of Saatchi Saatchi to Boeing, as well as being called on by all the major studios in LA (Disney, Fox, Warner, Paramount, Sony) and serves on the boards on two non-profit organizations, Anti-Self Destruction (LA gang intervention) and Semantic Seed &ndash; LA (technology incubator).&nbsp;</p>
<p>Tai''s activities combine an immediate interest in global emerging markets with enthusiasm for adventure, fascination with science and passion for people. He is currently focused on the advancement of the smart grid, renewable energy, cloud computing and mobility for entrepreneurs and professionals by providing strategy, process and implementation tools for monetization verticals in the Semantic Web technology 3.0 era.&nbsp;</p>
<p>Tai Greene is the managing partner of Exthusia, a strategic design and technology consulting practice that employs the User Centric Design methodology. They connect Product Management frameworks to Development best practices.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '474', '7', 'f', '', null, null, null, null, '13', '2011-06-20 18:21:55.330319', '2011-05-17 01:30:18.93663', '207.171.30.170', '64.134.232.109', '2010-08-21 14:24:09.070142', '4', '18', '31', '10', '33', null, null, null, null, null, null, null, null, null);
