<ol>
<li> Keep my mind active by constantly learning </li>
<li> Meet new people and maintain relationships </li>
<li> Enjoy the ride </li>
</ol>', '', '', '', '', '', '', '', '', '', '1', '2', 'f', '', null, null, null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
