INSERT INTO "users" VALUES ('524', 'esims@andrew.cmu.edu', 'elodie-jane.sims@sv.cmu.edu', '2010-09-22 19:05:32.046618', '2012-01-12 23:18:17.750783', 't', 'f', 'f', 'ElodieJaneSims', 'Élodie-Jane', 'Sims', 'Elodie-Jane Sims', '/images/staff/ElodieJaneSims.jpg', '', '', '', 'f', 'f', null, 'f', 'Élodie-Jane', 'NASA Ames Research Center', 'Research Scientist, CMU', 'Moffet Field', 'CA', 'USA', '(650) 604-0820', '', '', 'Elodie-Jane.Sims@sv.cmu.edu', 'Local', '<p>Dr. &Eacute;lodie-Jane Sims&rsquo;s main research area is static program analysis by   Abstract Interpretation. She is specialized in pointer''s analysis and separation logic. She has been working at ENS for the last 3 years with the static analyser ASTR&Eacute;E (www.astree.ens.fr) specialized for control/command programs (found in particular in avionic and automotive industrie).</p>', '', 'Bldg. 269, Rm. 152, Cub. 23', '', 'Work', '', '', '', '', '', '', '274', '8', 'f', '', '2010-09-22 19:05:48.809093', '2010-09-22 19:05:55.135585', null, null, '8', '2012-01-02 08:19:18.523399', '2012-01-02 08:19:10.055604', '88.182.134.178', '88.182.134.178', null, null, null, null, null, null, '2012-01-01 17:05:51.246767', null, null, '', null, null, null, null, null);
