INSERT INTO "users" VALUES ('526', '1285182583.15622', 'james.kuffner@sv.cmu.edu', '2010-09-22 19:09:43.174503', '2010-09-22 19:10:02.451253', 't', 'f', 'f', 'JamesKuffner', 'James ', 'Kuffner', 'James  Kuffner', '/images/mascot.jpg', '', '', '', 'f', null, null, 't', 'James', null, null, null, null, null, null, null, null, 'kuffner@cs.cmu.edu', null, '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. People''s trash clearly isn''t multitudinous. I hope to put my real biography here one day.</p>', null, null, null, null, null, null, null, null, null, null, '274', '3', null, null, '2010-09-22 19:09:56.670167', '2010-09-22 19:10:02.445156', null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('527', '1285349311.62376', 'kiumarse.zamanian@sv.cmu.edu', '2010-09-24 17:28:31.687299', '2010-09-25 19:59:00.649227', 't', 'f', 'f', 'KiumarseZamanian', 'Kiumarse', 'Zamanian', 'Kiumarse Zamanian', '/images/mascot.jpg', '', '', '', 'f', 'f', null, 't', 'Kiumarse', 'CMU SV Software Management', 'Facilitator & Consulting Professor ', 'Mountain View', 'CA', 'UNITED STATES', '415-867-8531 ', 'kzamanian', '', 'kzamanian@yahoo.com', 'Local', '<p>Kiumarse Zamanian received his PhD degree in engineering from CMU with a focus on applying formal methods and object-oriented techniques to model, share and reason about information in distributed systems. He has been a consulting and adjunct professor at CMU Silicon Valley since 2006 and enjoys working with entrepreneurial teams in transforming innovative ideas into useful software products.&nbsp;</p>
<p>Kiumarse has over 25 years of hands-on experience leading entrepreneurial initiatives to define and create innovative and customer-centric software solutions at Unisys, Exxon, Autodesk, Informatica, Yahoo!, Glam Media and several start-ups. &nbsp;His technical expertise include information management, business intelligence, on-line advertising, search, service-oriented architecture, cloud computing, mobile applications, and computer-aided design &amp; engineering. He is the co-inventor of nine US patents and has also published and presented extensively in various technology forums worldwide.&nbsp;&nbsp;For more information, please visit <a style="outline-width: initial; outline-style: none; outline-color: initial; font-weight: inherit; font-style: inherit; font-size: 13px; font-family: inherit; vertical-align: baseline; text-decoration: underline; color: #006699; padding: 0px; margin: 0px; border: 0px initial initial;" title="View public profile" name="webProfileURL" href="http://www.linkedin.com/in/kiumarsezamanian">http://www.linkedin.com/in/kiumarsezamanian</a>&nbsp;</p>', '', '', '', 'Mobile', '8885991399', '', '8885991399', '', '8885991399', '', '527', '4', 'f', '', null, null, null, null, '2', '2010-09-25 19:59:00.377491', '2010-09-25 19:28:53.342433', '71.202.146.172', '71.202.146.172', '2010-09-24 17:28:47.557723', null, null, null, null, null, null, null, null, null, null, null, null, null, null);
