<p>I worked at Stanford University''s Psychology Department and Annual Reviews prior to joyning Carnegie Mellon Silicon Valley team.</p>', '', 'Bldg 23 - 217 C', '8:30-5', 'Work', '650-906-2434', 'Mobile', '', '', '', '', '274', '10', 'f', 'Reežik (Lah-RIS-ah ree-ZJIK) ', '2010-12-11 00:34:26.951501', '2010-12-11 00:34:33.254062', null, null, '4', '2011-08-22 17:36:03.291419', '2011-06-01 16:58:44.672815', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, null, null, null, '', null, null, null, null, null);
INSERT INTO "users" VALUES ('544', 'pdewagte@andrew.cmu.edu', 'philippe.dewagter@sv.cmu.edu', '2011-01-10 19:37:29.521736', '2012-04-27 22:45:58.269989', 'f', 't', 'f', 'PhilippeDeWagter', 'Philippe', 'De Wagter', 'Philippe De Wagter', '/images/mascot.jpg', '2011', 'ECE MS', '', 'f', 'f', null, 'f', '', 'Carnegie Mellon University', 'Student', 'Mountain View', 'CA', 'U.S.A.', '(650) 862-6507', 'dewphy', '', 'pdewagte@andrew.cmu.edu', 'Local', '<p>I was born in Belgium.</p>', '<h2>About Me</h2>', '', '', 'Mobile', '', '', '', '', '', '', '274', '6', 'f', '', '2011-01-10 19:37:37.815751', '2011-01-10 19:37:44.283696', null, null, '1', '2011-01-10 22:58:12.044426', null, '76.126.213.187', null, '2011-01-10 19:37:52.411682', null, null, null, null, null, null, null, null, '', null, null, null, null, null);
INSERT INTO "users" VALUES ('545', 'jchong@ece.cmu.edu', 'jike.chong@sv.cmu.edu', '2011-01-26 22:02:33.58468', '2012-09-10 22:44:11.325888', 't', 'f', 'f', 'JikeChong', 'Jike', 'Chong', 'Jike Chong', '/images/mascot.jpg', '', '', '', 'f', 'f', null, 't', 'Jike', '', 'Adjunct Professor', '', '', '', '', '', '', 'jike.chong@gmail.com', 'Unknown', '<p><strong>Jike Chong</strong> is an adjunct professor at Carnegie Mellon University, Silicon Valley. He brings a decade of experience in parallel computing, spanning  multicore and manycore processor development, application research and  development, and software architecture and engineering. His work in  parallel computing led to several patents at Sun Microsystems, Inc, and  Intel Corporation. While working at Sun, he designed micro-architectural  features for Sun&rsquo;s highly parallel flagship T2 processor. As an Intel  Ph.D. Research Fellow at the Intel Application Research Labs, he  developed acceleration techniques for computational finance kernels for  Intel&rsquo;s upcoming Many Integrated Core (MIC) processors.</p>
<p>Dr Chong is the Founder and Chief Application Architect of Parasians (Parallel Computing Artisans). Parasians consult in the parallel computing space, and specialize in helping visionary clients in target industries navigate the process and address the intricacies in significantly speeding up compute-intensive application that directly affects revenue/cost. Prior to Parasians, he has also worked at Electric Cloud, Xilinx Research Labs and Altera Corp.</p>
<p>Dr Chong earned his B.S. and M.S. in Electrical and Computer Engineering at Carnegie Mellon University, received his Ph.D. in Electrical Engineering and Computer Sciences at University of California, Berkeley, and the Management of Technology (MOT) Certificate from Haas Business School at University of California, Berkeley. He is a member of Eta Kappa Nu, Tau Beta Pi, and the IEEE.</p>', '', '', '', '', '', '', '', '', '', '', '274', '6', 'f', '', '2011-01-26 22:02:47.065929', '2011-01-26 22:02:54.362562', null, null, '11', '2012-09-10 22:44:11.322181', '2012-08-03 02:01:46.256029', '64.168.229.50', '67.174.242.111', '2011-01-26 22:03:02.950193', null, null, null, null, null, '2012-09-10 17:00:47.322692', null, null, '', null, 'nCmcnXxnxzfKFRQeTD73', '2012-09-10 22:44:11.294644', null, null);
