INSERT INTO "users" VALUES ('548', 'mromero@andrew.cmu.edu', 'mikelynn.romero@sv.cmu.edu', '2011-03-08 18:27:24.374175', '2012-10-03 17:54:32.593209', 't', 'f', 'f', 'MikelynnRomero', 'Mikelynn', 'Romero', 'Mikelynn Romero', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/548/profile/romero.jpg', '', '', '', 'f', 'f', null, 't', 'Mikelynn', 'Career Services and Student Affairs ', 'Associate Director of Career Services and Student Affairs ', 'Moffett Field ', 'CA', 'USA', '650-335-2880', '', '', 'mikelynn.romero@gmail.com', 'Remote', '<p>Mikelynn Romero, M.Ed. is a two-time graduate of the University of Southern California, where she attained her Bachelor of Arts in Political Science and her Master of Education in Postsecondary Administration and Student Affairs. Mikelynn''s professional career began in the hiring department of the Los Angeles office of the global law firm of Skadden, Arps, Slate, Meagher, and Flom LLP. &nbsp;Since graduate school Mikelynn has worked at Trinity University, the University of Southern California, the New Mexico Higher Education Department, Los Alamos National Laboratory&nbsp;and managed a statewide talent attraction program called NM CareerMatch.&nbsp;</p>
<p>Mikelynn was born and raised in New Mexico, and has a passion for career development and student activities.&nbsp;</p>', '', 'Bldg 23 Rm 214', '10:30 - 6:30 ', 'Work', '650-603-7032', 'Fax', '', '', '', '', '274', '9', 'f', 'Mike-Lynn', '2011-03-08 18:27:36.317792', '2011-03-08 18:27:43.353061', null, null, '70', '2012-10-03 17:54:32.590759', '2012-10-02 20:30:09.609225', '209.129.244.250', '67.169.180.66', '2011-03-08 18:27:51.748305', null, null, null, null, null, null, null, null, '', null, 'EwDPszJaGfc5JtLVpQJ4', '2012-10-02 20:30:05.524583', null, null);
