INSERT INTO "users" VALUES ('553', 'nlinnell@andrew.cmu.edu', 'natalie.linnell@sv.cmu.edu', '2011-03-17 20:59:07.301159', '2012-09-15 17:01:23.749605', 't', 'f', 'f', 'NatalieLinnell', 'Natalie', 'Linnell', 'Natalie Linnell', '/images/mascot.jpg', '', '', '', 'f', 't', null, 't', 'Natalie', 'CMU-SV', 'Post-Doc ', 'Mountain View', 'CA', 'USA', '650-335-2889', '', '', 'linnell@cs.washington.edu', 'Unknown', '<p>My primary interests are educational technology, technology for the developing world, and mobile applications.</p>
<p>My general research focus is on application-driven computing, especially socially-motivated computing.&nbsp; My most recent work focuses on using digital signal processing on Android devices to allow them to communicate with a TV in order to aid agricultural educators in rural India.&nbsp; I also worked on a Tablet PC-based classroom interaction system, and on deploying this system in novel distance learning courses, such as a course between the US and Pakistan, and a video-based course in China. &nbsp;</p>', '', '', '', 'Work', '', '', '', '', '', '', '274', '6', 'f', '', '2011-03-17 20:59:21.655676', '2011-03-17 20:59:28.239199', null, null, '8', '2012-08-03 16:59:23.861273', '2012-07-02 19:52:54.351608', '98.207.41.1', '209.129.244.250', '2011-03-17 20:59:36.173165', null, null, null, null, null, '2012-09-15 17:01:23.7287', null, null, '', null, 'tMs4W5JxPZ5xPzrB6AwJ', '2012-08-03 16:59:23.820589', null, null);
