INSERT INTO "users" VALUES ('557', 'ravit@andrew.cmu.edu', 'ravi.thomas@sv.cmu.edu', '2011-03-24 22:12:00.506789', '2012-10-02 20:45:12.635447', 't', 'f', 'f', 'RaviThomas', 'Ravi', 'Thomas', 'Ravi Thomas', '/images/mascot.jpg', '', '', '', 'f', 'f', null, 't', '', 'CMU- Silicon Valley', '', 'Moffett Field', 'California', '', '650-208-8984', 'joharben', '', 'ravithomas@me.com', 'Unknown', '<p>Dr Thomas is a Consulting CFO for several startups. Recently he has been the CFO of Yunteq and EngageClick. Prior to these recent startups he was the CFO of&nbsp;University Associates LLC &nbsp;and an Adjunct Professor of Economics at University of California, Santa Cruz.&nbsp;He has held senior level executive positions at several startups. A co-founder, CFO and a board member of&nbsp;Jareva Technologies he was involved in all aspects of the company from its&nbsp;founding as a service business, to its repositioning as a software product company,&nbsp;to the revenue stage and its successful exit through an acquisition by Veritas. Prior&nbsp;to founding Jareva he was the CFO of PostX, a company in the secure messagingarena. As CFO he was involved in raising over $30 million for PostX and Jareva.&nbsp;VCs that have invested in PostX and Jareva include Mayfield, Hummer Winblad,and Labrador. Prior to joining his first startup Dr Thomas was an Assistant&nbsp;Professor at the Fox School of Business at Temple University where he taught&nbsp;graduate and undergraduate courses in microeconomics, economics of information,&nbsp;and public finance. He has also taught at Swarthmore College and was a Visiting&nbsp;Fellow at the International Monetary Fund. He received his undergraduate degree&nbsp;from the London School of Economics with First Class Honors and his Ph.D. in&nbsp;Economics from the University of California, Berkeley.</p>', '', 'TBA', 'TBA', 'Mobile', '', '', '', '', '', '', '557', '64', 'f', '', '2011-03-24 22:12:15.011558', null, null, null, '50', '2012-10-02 20:45:12.627664', '2012-09-28 14:32:57.297828', '75.25.138.113', '76.126.214.157', null, null, null, null, null, null, null, null, null, '', null, 'YNkU4ysF1q2xJTcLytNG', '2012-10-02 20:45:12.601668', null, 'length');
