INSERT INTO "users" VALUES ('585', 'jcanales@andrew.cmu.edu', 'jerel.canales@sv.cmu.edu', '2011-07-11 01:42:14.700817', '2012-09-06 04:17:41.980429', 'f', 't', 'f', 'JerelCanales', 'Jerel', 'Canales', 'Jerel Canales', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/585/profile/JerelCanales.jpg', '2012', 'SM', 'SM', 'f', 'f', null, 't', 'Jerel', '', '', 'San Francisco', 'California', 'USA', '415-690-6805', '', '', 'jerelcan@gmail.com', 'Near', '<p>I''m a graduate student in the Software Management (entrepreneurship) program. &nbsp;I''m originally from central Texas, where I graduated with a computer science degree from the University of Texas at Austin. &nbsp;Professionally, I worked for Texas Instruments as a hardware design engineer, quickly transitioning into a technical lead and then hardware verification manager. &nbsp;My work focused on IP &amp; SOC development, specifically for the wireless market. &nbsp;At Texas Instruments, I also played a critical role in strategic design methodology and tool deployment. &nbsp;In 2007, I relocated to Silicon Valley to work for Zoran Corporation, a mid-sized company focused on&nbsp;SOC development for the DTV market, where I served as a hardware verification manager.</p>
<p>Prior to my technical career, I served as an account executive for Teleco, an interconnect company in San Antonio, Texas. &nbsp;Later, I formed a joint partnership with a friend in Austin, Texas.</p>
<p>Personally, I like to cook, watch and play sports, play guitar, and read great fiction. &nbsp;</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Train for and participate in the SF marathon</li>
<li>Train for and participate in a long distance cycling race</li>
<li>Start a business venture</li>
</ol>', '', '', 'Mobile', '', '', '', '', '', '', '812', '9', 'f', '', '2011-07-11 01:42:19.124508', '2011-07-11 01:42:24.988519', null, null, '17', '2011-11-12 20:39:22.492265', '2011-11-10 20:40:50.357255', '67.116.42.182', '209.129.244.250', null, null, null, null, null, null, null, 'JerelCanales.jpg', 'image/jpeg', '', null, null, null, null, null);
INSERT INTO "users" VALUES ('586', 'gychan@andrew.cmu.edu', 'garry.chan@sv.cmu.edu', '2011-07-11 01:43:51.719071', '2012-10-03 16:20:48.227843', 'f', 't', 'f', 'GarryChan', 'Garry', 'Chan', 'Garry Chan', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/586/profile/GarryChan.jpg', '2013', 'SM', 'SM', 't', 'f', '2012-08-10 17:02:19.595354', 't', 'Garry', '', '', 'Toronto', 'Ontario', 'Canada', '416.625.2195', 'garry_chan', '', 'gchan@gcrp.ca', 'Remote', '<p>I''m a remote student based in Toronto. My tech skills are in database architecture and data management / analytics. My business skills include building an IT services company for the past 15+ years, specializing in IT project management, RFPs, pre-sales, outsourcing etc.</p>
<p>I hope to learn a lot of interesting things at CMU as I embark on a new venture ... starting a new software business.</p>
<p>In addition to English, I can read/write Chinese, and speak Cantonese and some Mandarin.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
