<li>Improve my writing skills to meet the rigorous standards at CMU</li>
<li>Leverage the brain trust at CMU (profs, classmates etc.) to fine-tune my product idea</li>
<li>Live and breathe Silicon Valley!</li>
</ol>', '', '', 'Mobile', '', '', '', '', '', '', '1', '9', 'f', '', '2011-07-11 01:44:00.712694', '2011-07-11 01:44:07.238539', null, null, '167', '2012-10-03 16:20:48.222537', '2012-10-02 12:52:25.841786', '38.117.92.218', '38.117.92.218', null, null, null, null, null, null, null, null, null, '', null, 'SULFhehfCdeeThCQ5Rbt', '2012-10-03 16:20:48.195019', null, null);
