INSERT INTO "users" VALUES ('596', 'jjgoldsm@andrew.cmu.edu', 'jason.goldsmith@sv.cmu.edu', '2011-07-11 02:04:23.08906', '2012-08-10 17:02:10.309531', 'f', 't', 'f', 'JasonGoldsmith', 'Jason', 'Goldsmith', 'Jason Goldsmith', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/596/profile/JasonGoldsmith.jpg', '2012', 'SM', 'SM', 'f', 'f', '2012-08-10 17:02:10.249091', 't', 'Jason', '', '', '', '', '', '408-368-7500', 'jasoncmusv', null, 'jason@goldsmith.us', 'Local', '<p>Jason is a Full Time Software Management student who has a passion for comic books. Currently he is developing a startup, ComicBin, to disrupt the traditional comic book market.</p>
<p>Prior to attending CMU, Jason spent 6 years working in the construction industry, mostly running the business and selling contracts, but with the occasional building of things as well. Before construction he was a consultant working for companies such as Longs Drugs and Salesforce.com. Jason also has a background in customer service and technical support.</p>', '', '', '', 'Mobile', '', '', '', '', '', '', '1', '4', 'f', '', '2011-07-11 02:04:30.052635', '2011-07-11 02:04:36.541901', null, null, '140', '2012-08-09 03:00:35.277485', '2012-07-29 05:35:37.899763', '209.129.244.250', '76.220.32.57', null, null, null, null, null, null, null, null, null, '', null, 'bM6xJStSK62z3FB1Xy8s', '2012-08-09 03:00:35.261542', null, null);
