INSERT INTO "users" VALUES ('607', 'sanjoonl@andrew.cmu.edu', 'daniel.lee@sv.cmu.edu', '2011-07-11 02:48:48.354654', '2012-09-27 02:19:40.830154', 'f', 't', 'f', 'DanielLee', 'Daniel', 'Lee', 'Daniel Lee', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/607/profile/DanielLee.jpg', '2013', 'SM', 'SM', 't', 'f', null, 't', 'Sangjoon', 'Oracle', '', 'Pleasanton', 'CA', 'United States', '408-785-0611', 'dansjlee', null, 'dansjlee@yahoo.com', 'Local', '<p><strong><span style="font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;">I majored in computer science and statistics at University of Seoul and the majority of my past experiences have focused in the areas of software development, IT operation, product marketing, and software engineering. I came to the states 13 years ago to work for Intel in Phoenix AZ. Maybe because of it, I sometimes feel like Phoenix is my second home and still miss the heat and deserts there :) I moved to California when I got a job at PeopleSoft in 2000. Lately, I studied computer science (database concentration) at Stanford for a graduate certificates. I''m currently holding a position of DBA operations manager at Oracle but I''m thinking to take my technical position back sometime soon. I''m staying in San Ramon CA and I have two kids - 18 (girl) and 16 (boy).</span><span style="font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;"><span style="font-family: ''Times New Roman''; font-size: small;"> </span></span><span style="font-size: 15px; font-family: Arial; background-color: transparent; vertical-align: baseline; white-space: pre-wrap;">I hope the learning experiences and the new educational network at CMU will broaden my horizons and allow me to start my own business in the near future.</span></strong></p>', '<h2>About Me</h2>
