</ol>', '', '', 'Google Voice', '', '', '', '', '', '', '607', '11', 'f', '', '2011-07-11 02:48:56.475998', '2011-07-11 02:49:04.412013', null, null, '139', '2012-09-27 02:19:40.827723', '2012-09-21 22:25:06.544029', '148.87.46.2', '148.87.19.218', null, null, null, null, null, null, null, null, null, '', null, '7XsdYGJMDkr1cjbsKfHh', '2012-09-27 02:19:40.795757', null, null);
