INSERT INTO "users" VALUES ('617', 'kpantic@andrew.cmu.edu', 'kristoffer.pantic@sv.cmu.edu', '2011-07-11 03:06:46.224434', '2012-08-11 22:59:52.20784', 'f', 't', 'f', 'KristofferPantic', 'Kris', 'Pantic', 'Kristoffer Pantic', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/617/profile/KristofferPantic.jpg', '2012', 'SE', 'Tech', 'f', 'f', '2012-08-10 17:02:37.166032', 't', 'Kristoffer', '', '', 'Mountain View', 'California', 'United States', '+14082301098', 'kristoffer.pantic', null, 'me@kristofferpantic.com', 'Local', '<p>I recently finished my BS in Computer Engineering at Universidad Sim&oacute;n Bol&iacute;var in Caracas, Venezuela. I''ve been working for several local companies and startups in Venezuela for the last 2 years. I just moved to Mountain View for this program so I''m pretty new to the States and the Bay Area. My hobbies are mostly playing soccer, tennis and biking.</p>', '<h2>About Me</h2>
