INSERT INTO "users" VALUES ('618', 'spasumar@andrew.cmu.edu', 'shekar.pasumarthi@sv.cmu.edu', '2011-07-11 03:29:47.374498', '2012-10-04 01:47:20.57029', 'f', 't', 'f', 'ShekarPasumarthi', 'Shekar', 'Pasumarthi', 'Shekar Pasumarthi', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/618/profile/ShekarPasumarthi.jpg', '2013', 'SM', 'SM', 't', 'f', null, 't', 'Shekar', 'Aviat Networks', 'Software Development Manager', 'Santa Clara', 'California', 'United States', '4085677134', 'shekar.giants', null, 'shekarp@pcweb.com', 'Local', '<p>I am from India. I did all my schooling till my undergraduate in India. My undergradaute degree was in Electrical Engineering. I came over to the University of Kentucky for my Master in Electrical Engineering. Right after finishing my Master I got a job in Landis &amp; Gyr in San Jose. Since then I have been in the Bay Area and have worked for several companies. Currently I am a Manager of Software Development at a company called Aviat Networks.</p>
<p>I love sports. I watch and follow almost all the major sports, Baseball, Cricket, Football, Hockey, Basketball, Tennis and Golf. I take out time to play tennis.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
