INSERT INTO "users" VALUES ('620', 'sperez@andrew.cmu.edu', 'gio.perez@sv.cmu.edu', '2011-07-12 21:29:55.543133', '2012-10-03 15:24:33.594357', 'f', 't', 'f', 'GioPerez', 'Gio', 'Perez', 'Gio Perez', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/620/profile/SaulPerez.jpg', '2013', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:30.227516', 't', 'Saul', 'Boeing (Boeing Capital)', 'Sr Systems Architect', 'Orange County', 'California', '', '(562) 797-0122', 'saul.g.perez', '', 'saul.g.perez@digitalprez.com', 'Remote', '<p>Saul G Perez is responsible for providing effective business solutions,   implementation and design of the highly available computing environment   for Boeing Capital Corporation, a wholly owned subsidiary that is   primarily responsible for arranging, structuring and providing financing   for Boeing''s commercial airplanes and space and defense products. <br /> <br /> Prior to his current assignment, P&eacute;rez supported Boeing Defense Systems   (BDS) &amp; Shuttle Systems, Information Technology.  While there he   provided subject matter expertise of design for highly available   systems.  P&eacute;rez has over 13 years of information systems &amp;   engineering experience successfully supporting and implementing business   solutions worldwide.  His primary technical emphasis are with Highly   Available &amp; Systems Architecture including but not limited to system   design, enterprise architecture, virtualization, data center   optimization, and information security architecture.<br /> <br /> P&eacute;rez has a bachelor''s degree in computer engineering from California   State University, Long Beach and is currently pursuing a master''s degree   in engineering from Carnegie Mellon.  He is actively involved in   technical communities in relation to virtualization, highly available   systems and application development frameworks for enterprise   architecture. <br /> <br /> Industry experience includes working with companies in aerospace,   finance, sports management, real estate, medical, and other specialized   service industries.</p>', '&nbsp;', '', '', 'Work', '(562) 206-7817  ', 'Home', '(562) 879-1536', 'Mobile', '', '', '274', '14', 'f', '', '2011-07-12 21:30:00.537068', '2011-07-12 21:30:06.556182', null, null, '938', '2012-10-03 15:24:33.582332', '2012-10-03 14:22:29.309521', '76.251.98.188', '76.251.98.188', null, null, null, null, null, null, null, null, null, 'saul-g-perez', null, 'ESK2L5gztxz7xfBbXujs', '2012-10-03 15:24:33.497628', null, null);
INSERT INTO "users" VALUES ('621', 'apoothat@andrew.cmu.edu', 'ashwin.poothatta@sv.cmu.edu', '2011-07-12 21:32:51.021535', '2012-08-10 17:02:06.546225', 'f', 't', 'f', 'AshwinPoothatta', 'Ashwin', 'Poothatta', 'Ashwin Poothatta', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/621/profile/AshwinPoothatta.jpg', '2012', 'SM', 'SM', 'f', 'f', '2012-08-10 17:02:06.510773', 't', 'Ashwin Arun', 'Accenture Technology Solutions', 'Senior Software Engineer', 'Singapore', 'California', 'Singapore', '6508612343', 'meteorash', '', 'legend.ash@gmail.com', 'Local', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. People''s trash clearly isn''t multitudinous. I hope to put my real biography here one day.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Goal 1</li>
<li>Goal 2</li>
<li>Goal 3</li>
</ol>', '', '', 'Mobile', '', '', '', '', '', '', '1', '6', 'f', '', '2011-07-12 21:32:56.142572', '2011-07-12 21:33:02.063979', null, null, '137', '2012-08-03 17:08:26.623524', '2012-07-27 20:43:29.747029', '69.181.252.202', '69.181.252.202', null, null, null, null, null, null, null, null, null, '', null, 'tFX2g8YNJhiomRvMqAJV', '2012-08-03 17:08:26.61034', null, null);
INSERT INTO "users" VALUES ('622', 'mhpham@andrew.cmu.edu', 'minh.pham@sv.cmu.edu', '2011-07-12 21:40:39.628081', '2012-10-04 01:20:45.704885', 'f', 't', 'f', 'MinhPham', 'Minh', 'Pham', 'Minh Pham', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/622/profile/MinhPham.jpg', '2013', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:34.617344', 't', 'Minh', 'Boeing Co', 'Programmer Analysis', 'Bellevue', 'Washington', 'USA', '206-876-0448', 'minh.hoang.pham', null, 'minh_p@hotmail.com', 'Remote', '<p>Originally from Vietnam, I immigrated to the United State ages ago.&nbsp; I recieved my BS in Informatics from the University of Washington and worked for Infosys Technologies LTD after graduation as&nbsp; a Software Engineer.</p>
<p>During my tenure with Infosys, I had the opportunity to travel to India for 6 months and trained at their Info-university in Mysore India.&nbsp; After one and a half&nbsp; year with Infosy, I migrated to Boeing and been there ever since.</p>
<p>Currently, I am programmer/developer working on creating new functionality/fixing other people mistake using C++ and LISP for a product call ICAD and CATIA.&nbsp; Long story short, I write code so that Boeing''s engineers can make airplane parts faster.&nbsp; Something Boeing, Ford and all these big manufacturing company call ''Knowledge Based Engineering''.</p>
<p>But that is my life story ......</p>', '<h2>About Me</h2>
<p>I have 3 Motorycle:</p>
<p>1) 2004 Ducati 794S</p>
<p>2) 2005 Vespa PX150</p>
<p>3) 1965 Triumph Bonneville T120</p>
<p>&nbsp;</p>
<p>I love my VESPA the best!</p>', '', '', 'Mobile', '425-865-1097', 'Work', '', '', '', '', '274', '7', 'f', '', '2011-07-12 21:40:46.236145', '2011-07-12 21:40:52.35876', null, null, '196', '2012-10-04 01:20:45.702444', '2012-10-02 01:12:13.934395', '71.35.131.237', '71.35.181.11', null, null, null, null, null, null, null, null, null, 'TofuPrd', null, 'LBZ1myNyyFNt4hhcwV1L', '2012-10-04 01:20:45.689873', null, null);
