INSERT INTO "users" VALUES ('624', 'jricks@andrew.cmu.edu', 'james.ricks@sv.cmu.edu', '2011-07-12 21:45:24.022411', '2012-10-04 01:25:16.180904', 'f', 't', 'f', 'JamesRicks', 'James', 'Ricks', 'James Ricks', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/624/profile/JamesRicks.jpg', '2013', 'SE', 'Tech', 't', 'f', '2012-08-10 17:02:58.710962', 't', 'James', 'Lockheed Martin', 'Software Engineer', 'Colorado Springs', 'Colorado', 'USA', '719-332-0240', 'james.ricks', null, 'ricksjames@gmail.com', 'Remote', '<p>I grew up in Idaho. After graduating with an undergraduate degree in Computer Science from BYU-Idaho I moved to Colorado to work for Lockheed Martin.</p>', '<h2>About Me</h2>
