INSERT INTO "users" VALUES ('725', '1323835445.8087926', 'cecile.peraire@sv.cmu.edu', '2011-12-14 04:04:05.853141', '2012-10-04 02:57:39.940399', 't', 'f', 'f', 'CecilePeraire', 'Cécile', 'Péraire', 'Cecile Peraire', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/725/profile/CecilePeraire.jpg', '', '', '', 'f', 't', '2012-06-29 17:02:11.703692', 't', '', 'CMU SV', 'Professor, Software Engineering and Management', 'Mountain View', 'California', 'United States', '650-468-4503', '', null, 'cecile.peraire@ieee.org', null, '<p>Dr. C&eacute;cile P&eacute;raire has over 15 years of software engineering experience in both industry and academia. She earned her Ph.D. in computer science from the Swiss Federal Institute of Technology (EPFL, Lausanne, Switzerland). Following a postdoctoral research fellowship at SRI International and Hewlett Packard, she worked at IBM where she played different roles covering the many facets of software development.&nbsp;She has contributed significantly to&nbsp;IBM''s internal and commercial methods, including the Rational Unified Process (RUP).&nbsp;Dr. P&eacute;raire&nbsp;is currently a Professor at Carnegie Mellon Silicon Valley.&nbsp;Her research interests are in agile and lean software development methods, measurable process improvement, project management, requirements, architecture, quality and business processes.&nbsp;She has a passion for innovation in methods, practices, models and&nbsp;tools that enable teams to more effectively develop and deliver software-intensive solutions.</p>', '', '122 (Building 23)', '', 'Mobile', '650-335-2851', 'Work', '', '', '', '', '725', '1', 'f', '', '2011-12-14 04:43:01.87668', '2011-12-14 04:43:09.968709', null, null, '228', '2012-10-04 02:57:39.937286', '2012-10-04 01:50:24.355711', '76.102.49.148', '76.102.49.148', null, null, null, null, null, null, null, 'CecilePeraire.jpg', 'image/jpeg', '', null, 'bo7Cz7DDCgyyNrCVBJHq', '2012-10-03 23:36:25.38802', null, 'length');
