INSERT INTO "users" VALUES ('746', '1336601715.999204', 'hedda.schmidtke@sv.cmu.edu', '2012-05-09 22:15:16.03381', '2012-09-20 14:43:39.684962', 't', 'f', 'f', 'HeddaSchmidtke', 'Hedda', 'Schmidtke', 'Hedda Schmidtke', '/images/mascot.jpg', '', '', '', 'f', 'f', null, 't', 'Hedda Rahel', 'Carnegie Mellon University', 'Assistant Professor', '', '', '', '650 335 2851', 'hedda.schmidtke', null, 'hedda.schmidtke@googlemail.com', null, '<p>Hedda R. Schmidtke is assistant professor in Information and Communications Technology at CMU Rwanda and CMU Silicon Valley. Her main research interest is on intelligent applications for light-weight mobile and distributed systems, including computing platforms such as RFID, mobile phones, and Smart Spaces. She has publications in the areas Smart Environments, Internet of Things, Ubiquitous/Pervasive Computing, Artificial Intelligence, Knowledge Representation, Wireless Sensor Networks, Geographic Information Systems, and Cognitive Science.</p>', '', '650 335 2851', 'Wed 3pm', 'Work', '650 763 8018', 'Mobile', '', '', '', '', '746', '1', 'f', '', '2012-05-09 22:15:22.814954', '2012-05-09 22:15:30.592101', null, null, '20', '2012-09-20 14:43:39.681657', '2012-09-18 12:22:58.966506', '41.74.174.52', '41.74.174.52', null, null, null, null, null, null, null, null, null, 'schmidtke', null, 'qqYzVjLooCXBHzK5wzs1', '2012-09-20 14:43:39.514242', null, null);
