INSERT INTO "users" VALUES ('766', '1338224712.7843761', 'jia.zhang@sv.cmu.edu', '2012-05-28 17:05:12.79242', '2012-09-25 02:19:54.192258', 't', 'f', 'f', 'JiaZhang', 'Jia', 'Zhang', 'Jia Zhang', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/766/profile/001_JiaZhang.jpg', '', '', '', 'f', 'f', null, 't', '', 'Carnegie Mellon University - Silicon Valley', 'Associate Research Professor', 'Moffett Field', 'California', 'USA', '312-718-2468', 'jiazhangchicago', null, '', null, '<p style="margin: 0in; margin-bottom: .0001pt; background: white; vertical-align: baseline;"><span style="font-size: 9pt; font-family: Verdana, sans-serif;">Jia Zhang is an Associate Research Professor in the area of Software Engineering at Carnegie Mellon University&rsquo;s Silicon Valley campus. Her recent research interests center on services computing, with a focus on collaborative scientific workflows, service oriented architecture, and semantic service discovery. She has co-authored one textbook titled "Services Computing" and has published over 100 refereed journal papers, book chapters, and conference papers. She is now an Associate Editor of IEEE Transactions on Services Computing (TSC) and of International Journal of Web Services Research (JWSR). Zhang is Program Vice Chair of IEEE International Conference on Web Services (ICWS).</span></p>
<p style="margin: 0in; margin-bottom: .0001pt; background: white; vertical-align: baseline;"><span style="font-size: 9pt; font-family: Verdana, sans-serif;">&nbsp;</span></p>
<p style="margin: 0in; margin-bottom: .0001pt; background: white; vertical-align: baseline;"><span style="font-size: 9pt; font-family: Verdana, sans-serif;">Previously at the Northern Illinois University as a tenured Associate Professor of computer science, Zhang taught software engineering and databases and opened two graduate-level courses based on her co-authored textbook "Services Computing." Zhang also has nine years of architect and technical lead experience in software industry.</span></p>
<p style="margin: 0in; margin-bottom: .0001pt; background: white; vertical-align: baseline;"><span style="font-size: 9pt; font-family: Verdana, sans-serif;">&nbsp;</span></p>
<p><span style="font-size: 9pt; line-height: 115%; font-family: Verdana, sans-serif;">Zhang earned her Ph.D. in computer science from the University of Illinois at Chicago, and her M.S. and B.S. in computer science from Nanjing University, China.</span></p>', '', '#120', '', 'Mobile', '650-335-2831', 'Work', '', '', '', '', '812', '1', 'f', '', '2012-05-28 17:05:18.594299', '2012-05-28 17:05:27.443353', null, null, '36', '2012-09-25 02:19:54.107391', '2012-09-12 04:44:14.348436', '209.129.244.250', '67.180.17.125', null, '29', '17', '8', '6', '27', null, '001_JiaZhang.jpg', 'image/jpeg', '', null, 'csBZZdhxan5xqHxQfVDY', '2012-09-25 02:19:54.09811', null, 'length');
