INSERT INTO "users" VALUES ('801', 'davidliu@andrew.cmu.edu', 'david.liu@sv.cmu.edu', '2012-06-27 21:45:47.646031', '2012-10-04 01:35:51.571662', 'f', 't', 'f', 'DavidLiu', 'David', 'Liu', 'David Liu', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/801/profile/059_DavidLiu.jpg', '2013', 'SE', 'Tech', 'f', 'f', '2012-09-28 17:01:24.242765', 't', '', '', '', '', '', '', '', '', null, 'dliu882000@gmail.com', 'Unknown', '<p>I was born and raised in San Gabriel, CA.&nbsp; I graduated from UCLA in 2010 with a BS in chemical engineering and a breadth in computer science.</p>
<p>After interning at PFR Engineering developing software for the petroleum industry, I wanted a more development-heavy role.&nbsp; I joined Acumen, LLC upon graduation, where I learned a great deal about the web development stack and scripting, and have been there for two years.&nbsp; I decided to pursue a MS from Carnegie Mellon SV, because I feel that the formal training will be a great complement to my experience and mostly self-taught skills.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Gain an understanding of best practices in development</li>
<li>Receive real-world experience learning and solving technical problems</li>
<li>Learn how to effectively work in teams and understand the roles within it</li>
</ol>', '', '', '', '', '', '', '', '', '', '812', '1', 'f', 'David Lee-u', '2012-06-27 21:45:50.256625', '2012-06-27 21:45:57.303663', null, null, '97', '2012-10-04 01:35:51.568483', '2012-10-03 03:23:12.739515', '209.129.244.250', '98.248.42.42', null, null, null, null, null, null, null, '059_DavidLiu.jpg', 'image/jpeg', 'https://github.com/davliu', null, 'PPUWsgefQLtEMteUGG7Z', '2012-10-04 01:35:51.556983', null, 'length');
