INSERT INTO "users" VALUES ('803', 'dpfeffer@andrew.cmu.edu', 'david.pfeffer@sv.cmu.edu', '2012-06-27 21:47:36.019613', '2012-10-03 01:20:01.501334', 'f', 't', 'f', 'DavidPfeffer', 'David', 'Pfeffer', 'David Pfeffer', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/803/profile/030_DavidPfeffer.jpg', '2013', 'SE', 'Tech', 'f', 'f', '2012-09-28 17:01:27.41256', 't', 'David', '', '', 'Palo Alto', 'CA', '', '202-329-3557', 'pfeffed', null, 'david@pfeffer.org', 'Local', '<p>I decided to attend CMU SV to formalize my self-taught background in Computer Science and bring my knowledge to the next level. &nbsp;Previously, I majored in Physics and Spanish at Vanderbilt University and earned an MBA from Georgetown University''s McDonough School of Business.</p>
<p>I have about five years of work experience, including:</p>
<ul>
<li>a year working for a Congressman on Capital Hill as a Legislative Correspondent.</li>
<li>two years at BearingPoint Consulting (now part of Deloitte), where my group focused on central bank reform in emerging markets</li>
<li>two years at SYNNEX Corporation, a leading IT distributor, where I helped start the new Cloud Computing division.</li>
</ul>
<p>I am a passionate geek and have always loved to mess around with technology of all sorts. &nbsp;I live in Palo Alto with my beautiful wife Meredith. &nbsp;We are expecting our first baby who is due in October 2012.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Goal 1</li>
<li>Goal 2</li>
<li>Goal 3</li>
</ol>', null, null, 'Mobile', '650-331-0059', 'Home', '650-308-4027', 'Google Voice', '650-690-7577', 'Fax', '812', '1', 'f', '', '2012-06-27 21:47:40.021401', '2012-06-27 21:47:46.538839', null, null, '46', '2012-10-03 01:20:01.466173', '2012-10-01 21:21:19.840311', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, null, '030_DavidPfeffer.jpg', 'image/jpeg', 'pfeffed', null, 'gss3pbx4s1cHsxXnk4rb', '2012-10-03 01:20:01.295569', null, 'semester');
