INSERT INTO "users" VALUES ('807', 'dnbrown@andrew.cmu.edu', 'danny.brown@sv.cmu.edu', '2012-06-27 21:53:25.425376', '2012-10-02 20:12:37.030277', 'f', 't', 'f', 'DannyBrown', 'Danny', 'Brown', 'Danny Brown', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/807/profile/033_DanBrown.jpg', '2014', 'SE', 'Tech', 't', 'f', '2012-09-28 17:01:34.289816', 't', 'Daniel', 'Accuray Inc.', 'Robotics Engineer', 'Sunnyvale', 'CA', 'United States', '4086089815', 'daniel.brown.546', null, 'nartey_brown@yahoo.com', 'Near', '<p>I was born in Ghana, West Africa, where I completed my High School education. I subsequently left for Guyana, South America, where I completed my B.Sc. (Mechanical Engineering) education. After that, I came to the US to complete my MSc. Mechanical Engineering degree at Florida Institute of Technology.</p>', '<h2>About Me</h2>
