INSERT INTO "users" VALUES ('810', 'mmasuda@andrew.cmu.edu', 'mari.masuda@sv.cmu.edu', '2012-06-27 21:56:09.978435', '2012-10-03 19:33:31.005041', 'f', 't', 'f', 'MariMasuda', 'Mari', 'Masuda', 'Mari Masuda', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/810/profile/042_MariMasuda.jpg', '2014', 'SE', 'Tech', 't', 'f', '2012-09-28 17:01:36.775106', 't', '', '', '', '', '', '', '650-799-6757', 'mbmasuda', null, '', 'Local', '<p>I am a Bay Area native. &nbsp;After attending Colby College where I majored in music and minored in computer science, I served in the U.S. Navy as a helicopter pilot. &nbsp;After that I was a technical writer at the San Diego Supercomputer Center before moving back to the Bay Area where I am now employed as a web content manager/programmer at Stanford University''s Hoover Institution.</p>', '', null, null, 'Mobile', '650-725-3461', 'Work', '', '', '', '', '812', '1', 'f', '', '2012-06-27 21:56:16.913782', '2012-06-27 21:56:25.378712', null, null, '58', '2012-10-03 19:33:31.001264', '2012-10-03 05:33:25.996795', '171.66.113.83', '99.113.32.139', null, null, null, null, null, null, null, '042_MariMasuda.jpg', 'image/jpeg', 'mbmasuda', null, 'KmVbZxbjuWqTGzWi9yxp', '2012-10-03 05:33:25.98151', null, null);
INSERT INTO "users" VALUES ('811', 'albertp@andrew.cmu.edu', 'albert.pham@sv.cmu.edu', '2012-06-27 21:57:03.366334', '2012-10-02 00:37:20.634484', 'f', 't', 'f', 'AlbertPham', 'Albert', 'Pham', 'Albert Pham', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/811/profile/Albert_Pham.jpg', '2014', 'SE', 'Tech', 't', 'f', '2012-09-28 17:01:37.854185', 't', '', 'Lockheed Martin', 'Software Engineer', 'Sunnyvale', 'California', '', '503-329-0553', 'albert_pham', null, 'albert.q.pham@gmail.com', 'Local', '<p>I am a Bay Area transplant originally from Portland, Oregon where I received my undergraduate degree at Portland State University in Computer Engineering with an emphasis in embedded systems. I currently work at Lockheed Martin Space Systems Company as a software engineer.</p>
<p>&nbsp;</p>
<p>In my free time, my hobbies include running, playing tennis, hiking, snowboarding, and exploring the outdoors.</p>
<p>&nbsp;</p>
<p>I look forward to being a part-time student in the software engineering (tech track) and becoming more involved with the Carnegie Mellon Silicon Valley community.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Take on new challenges at work and further develop and progress in my personal career path</li>
<li>Further develop presentation skills and be more comfortable with public speaking </li>
<li>Qualify for the Boston Marathon</li>
</ol>', '', '', 'Mobile', '', '', '', '', '', '', '1', '1', 'f', '', '2012-06-27 21:57:08.847285', '2012-06-27 21:57:16.752899', null, null, '39', '2012-10-02 00:37:20.63083', '2012-09-30 08:05:18.655484', '192.31.106.36', '68.120.199.227', null, null, null, null, null, null, null, 'Albert_Pham.jpg', 'image/jpeg', 'apham2', null, '8tctMoQNmUAzzhxdvg6x', '2012-10-02 00:37:20.611638', null, null);
