INSERT INTO "users" VALUES ('816', 'prabhjos@andrew.cmu.edu', 'prabhjot.singh@sv.cmu.edu', '2012-06-27 22:06:55.247985', '2012-10-03 20:48:24.019578', 'f', 't', 'f', 'PrabhjotSingh', 'Prabhjot', 'Singh', 'Prabhjot Singh', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/816/profile/048_PrabhjotSingh.jpg', '2013', 'SE', 'DM', 'f', 'f', '2012-09-28 17:01:31.019021', 't', 'Prabhjot', '', '', 'Fremont', 'California', 'USA', '510-371-2335', 'saini.prabhjot', null, 'prabhjot27@gmail.com', 'Local', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. People''s trash clearly isn''t multitudinous. I hope to put my real biography here one day.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
