</ol>', '', '', 'Mobile', '', '', '', '', '', '', '816', '1', 'f', 'PRAP-jhoth Sing', '2012-06-27 22:07:01.680523', '2012-06-27 22:07:09.438828', null, null, '172', '2012-10-03 20:48:24.009679', '2012-10-02 23:16:14.405595', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, null, '048_PrabhjotSingh.jpg', 'image/jpeg', 'singhprabhjot', 'icons', 'jcC2hmVvAXcMidCy6vEi', '2012-10-03 20:48:23.981312', null, 'length');
INSERT INTO "users" VALUES ('817', 'rwb@andrew.cmu.edu', 'rob.black@sv.cmu.edu', '2012-06-27 22:08:13.029072', '2012-10-03 00:40:22.6385', 'f', 't', 'f', 'RobBlack', 'Rob', 'Black', 'Rob Black', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/817/profile/034_RobBlack.jpg', '2014', 'SE', 'DM', 't', 'f', '2012-09-28 17:01:33.368031', 't', 'Robert', 'Google Inc.', '', 'Mountain View', 'CA', 'USA', '314-724-4376', 'rob.black.sv.cmu.edu', null, 'robwblack@gmail.com', 'Local', '<p>I''m a student in part time SE DM program living and working in Silicon Valley. &nbsp;I''m excited to start classes in the fall!</p>', '<h2>About Me</h2>
