INSERT INTO "users" VALUES ('825', 'mghatike@andrew.cmu.edu', 'medha.ghatikesh@sv.cmu.edu', '2012-06-27 22:16:53.151121', '2012-10-03 23:10:03.013376', 'f', 't', 'f', 'MedhaGhatikesh', 'Medha', 'Ghatikesh', 'Medha Ghatikesh', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/825/profile/008_MedhaGhatikesh.jpg', '2013', 'SM', '', 'f', 'f', '2012-09-28 17:02:11.705184', 't', 'Medha', 'Orion Health', 'Software Engineer', 'Auckland', '', 'New Zealand', '+64 650 450 1589', 'medha.ghatikesh', null, 'medha.ghati@gmail.com', 'Unknown', '<p>&ldquo;Nec Dextrorsum-Nec Sinistrosum&rdquo; Neither to the right - nor to the left; the motto of Bishop Cottons Girls School, my junior school, represents the determination with which all Cottonians follow their goals. When I set my mind on something, I strive to achieve it.&nbsp;</p>
<p>I was offered direct entry into the second year of Software Engineering under the Accelerated Pathway of Engineering at the University of Auckland. A student in this pathway completes a four year engineering degree in just three years. I was also the Vice President of the Software Engineering Students Association.</p>
<p>While still at university, I came up with a solution to poverty &ndash; creating sustainable employment for artisans below the poverty line by guaranteeing a fair price for their handicrafts. The idea was to create a Facebook application &lsquo;Vital Gifts&rsquo; that showcased handicrafts made by artisans, utilizing the viral marketing capability of social networks to promote social gift giving. This idea won fourth place in the Microsoft Imagine Cup technology competition against more than 100 teams from all over New Zealand. I then co-founded a social venture, &lsquo;Vital Link Group&rsquo;, to continue working on the idea. As Chief Branding Officer and Software Engineer, my roles were diverse. I met a lot of professionals, presented in front of an audience of 700, and transformed from a student to a social entrepreneur in a matter of six months.</p>
<p>After completing my undergraduate education in Software Engineering, I began working as a Software Engineer at New Zealand''s largest software exporter and health innovator - Orion Health. Along with my development role, I was also given the responsibility to work on the company&rsquo;s Development Standards, as well as the Quality Management System to fit the United States FDA regulations. Along with this, I was also Vice President Public Relations of the Orion Toastmasters club.</p>
<p>When I''m not busy chasing goals, I enjoy singing Carnatic classical and western music, creative writing - www.ghatikesh.com, painting, and everything artsy!</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Do what I love for a living.</li>
<li>Make a difference while I''m at it.</li>
<li>Be awesome at Ruby on Rails.</li>
</ol>', null, null, 'Mobile', '', '', '', '', '', '', '812', '1', 'f', 'mĕ_th_hä', '2012-06-27 22:16:57.333673', '2012-06-27 22:17:03.648126', null, null, '30', '2012-10-03 23:10:03.010292', '2012-10-01 07:31:53.843052', '209.129.244.250', '24.5.127.161', null, '1', '4', '8', '17', '25', null, '008_MedhaGhatikesh.jpg', 'image/jpeg', 'https://github.com/medha', null, 'Cz3wdGTrFxX26hH8hxGe', '2012-10-03 23:10:02.999789', null, 'semester');
INSERT INTO "users" VALUES ('818', 'jwl2@andrew.cmu.edu', 'john.lee@sv.cmu.edu', '2012-06-27 22:09:04.885634', '2012-10-03 21:37:34.163311', 'f', 't', 'f', 'JohnLee', 'John', 'Lee', 'John Lee', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/818/profile/041_JohnLee.jpg', '2014', 'SE', 'DM', 't', 'f', '2012-09-28 17:01:36.721518', 't', '', 'OPENLANE', 'Software Engineer', 'San Francisco', 'CA', 'USA', '650.520.5395', '', null, 'dabuda@cmu.edu', 'Local', '<p>I was born in Taiwan and came to the United States when I was 2. &nbsp;I grew up in the NY/NJ metro area and graduated from Rutgers University with a B.S. in Finance.&nbsp; I joined CSC out of college as a consultant.&nbsp; CSC provided a 8-week training program in Chicago where I was exposed to COBOL, Visual Basic, and C.&nbsp; But my first software development project was Java and I have been programming in Java ever since.&nbsp; I eventually moved out to San Francisco to join a friend at a startup. In my free time I like to run and gain the calories right back by trying new eateries on Yelp. &nbsp;</p>
<p>LinkedIn: <a style="margin: 0px 10px 0px 0px; padding: 0px 0px 0px 19px; border: 0px; outline: none; font-weight: normal; font-style: normal; font-size: 11px; font-family: Arial, Helvetica, ''Nimbus Sans L'', sans-serif; vertical-align: middle; text-decoration: none; color: #666666; display: inline-block; background-image: url(http://static02.linkedin.com/scds/common/u/img/sprite/sprite_profile_top_card_v4.png); background-color: #f6f6f6; font-variant: normal; letter-spacing: normal; line-height: 13px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-position: 0px -249px; background-repeat: no-repeat no-repeat;" title="View public profile" name="webProfileURL" href="http://www.linkedin.com/in/jlee614">www.linkedin.com/in/jlee614</a></p>', '<div><ol> </ol></div>
<p><strong><span style="color: #353535; font-family: Georgia,''Times New Roman'',Times,serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17.3333px; orphans: 2; text-align: center; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; background-color: #ffffff; display: inline ! important; float: none;">"Tell me and I&rsquo;ll forget; show me and I may remember; involve me and I&rsquo;ll understand."</span></strong></p>', null, null, 'Mobile', '', '', '', '', '', '', '818', '1', 'f', 'John Lee', '2012-06-27 22:09:10.718423', '2012-06-27 22:09:17.248152', null, null, '211', '2012-10-03 21:37:34.159705', '2012-10-03 18:00:26.556633', '66.238.115.109', '66.238.115.109', null, '4', '11', '25', '29', '33', null, '041_JohnLee.jpg', 'image/jpeg', 'johnleee', 'icons', 'sZtDTKegBBwdg1mPxEVy', '2012-10-03 21:37:34.143407', null, 'length');
INSERT INTO "users" VALUES ('819', 'aolshans@andrew.cmu.edu', 'adam.olshansky@sv.cmu.edu', '2012-06-27 22:09:46.949832', '2012-10-02 09:14:21.255195', 'f', 't', 'f', 'AdamOlshansky', 'Adam', 'Olshansky', 'Adam Olshansky', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/819/profile/049_AdamOlshanksy.jpg', '2014', 'SE', 'DM', 't', 'f', '2012-09-28 17:01:37.757995', 't', '', 'Honeywell Aerospace', 'Analyst I Systems Integration', 'Tempe', 'Arizona', '', '480-254-4835', 'adam17ao', null, 'adamolshansky17@gmail.com', 'Remote', '<p>I was born and raised in Arizona and recently graduated from the University of Arizona with a B.S. in Engineering Management. &nbsp;I also have minors in Computer Science and Computer Engineering. &nbsp;I recently started a job with Honeywell but am hoping to move to Silicon Valley at some point in my career as I continue to learn.</p>', '<h2>About Me</h2>
