INSERT INTO "users" VALUES ('822', 'vchureeg@andrew.cmu.edu', 'woody.chureeganon@sv.cmu.edu', '2012-06-27 22:12:43.986365', '2012-10-03 22:36:08.794501', 'f', 't', 'f', 'WoodyChureeganon', 'Woody', 'Chureeganon', 'Woody Chureeganon', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/822/profile/014_WoodyChureeganon.jpg', '2013', 'SM', '', 'f', 'f', '2012-09-28 17:02:08.779788', 't', 'Vuthipong', '', '', '', '', '', '3108489300', 'thecvch', null, 'thecvch@hotmail.com', 'Local', '<p>I was born and raised in Bangkok, Thailand. However, I got the chance to move to International School Ho Chi Minh City from Grade 7-10 and Internaltion School Manila from Grade 10-12 before moved back to Chulalongkorn Univeristy (CU). At CU, my major was Information and Communication Engineering and now I am a part of Carnegie Mellon University Silicon Valley, majoring in Software Management.</p>', '<h2>About Me</h2>
