INSERT INTO "users" VALUES ('823', 'ydesouza@andrew.cmu.edu', 'yuri.desouza@sv.cmu.edu', '2012-06-27 22:15:29.290077', '2012-10-03 22:00:53.205597', 'f', 't', 'f', 'YuriDeSouza', 'Yuri', 'de Souza', 'Yuri de Souza', '/images/mascot.jpg', '2013', 'SM', '', 'f', 'f', null, 't', '', 'Microsoft Corporation', 'Senior Software Development Engineer', 'Mountain View', 'CA', 'USA', '(650) 450-8501', 'ydesouza', null, 'yuri@xyfer.com', 'Unknown', '', '', null, null, 'Mobile', '', '', '', '', '', '', '823', '11', 'f', '', null, null, null, null, '5', '2012-10-03 22:00:53.198624', '2012-10-03 20:27:44.070942', '209.129.244.250', '24.4.101.123', null, null, null, null, null, null, null, null, null, 'https://github.com/ydesouza', null, 'ej1t7GpwacMFuMTr4b9M', '2012-10-03 22:00:53.176035', null, null);
INSERT INTO "users" VALUES ('824', 'danielfo@andrew.cmu.edu', 'daniel.fortner@sv.cmu.edu', '2012-06-27 22:16:17.560722', '2012-10-03 22:06:40.877694', 'f', 't', 'f', 'DanielFortner', 'Dan', 'Fortner', 'Daniel Fortner', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/824/profile/029_DanFortner.jpg', '2013', 'SM', '', 'f', 'f', '2012-09-28 17:02:10.64284', 't', 'Daniel', 'Bubba Gump Shrimp Company', 'Manager', 'Monterey', 'California', 'USA', '860-857-7152', '', null, 'danfortner@snet.net', 'Local', '<h2>Please excuse the generic bio, I hope to sylize this and tell it like a story in the future.  I was born in California and raised on the East Coast (Connecticut).  My main draw back in high school was sports, where I played soccer, wrestling and lacrosse.  I excelled at wrestling which led me to Rhode Island College in Providence where I got my BA in Telecomunications and was on the NCAA D3 Wrestling team.  After graduating I managed four restaurant concepts and learned my financials there.  My knack for computers, specifically programming, led me back to school in 2011-2012; my strenght so far is Java programming.  And I hope to combine my business saavy and technical programming skills at CMU SV as a full-time Software Management student.</h2>', '<h2>About Me</h2>
<p>I have been living in beautiful Monterey, CA for the last 4 years and extremely enjoy motorsport racing as my hobby.  Having Laguna Seca in your backyard is a definate perk for a track and autocross guy.  Pictures to come!!!!</p>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>have a job lined up before I graduate through networking</li>
<li>make friends in Silicon Valley</li>
<li>balance school and life enough to still be able to enjoy my hobby</li>
</ol>', null, null, 'Mobile', '', '', '', '', '', '', '812', '1', 'f', '', '2012-06-27 22:16:24.480278', '2012-06-27 22:16:31.47837', null, null, '92', '2012-10-03 22:06:40.873579', '2012-10-03 20:49:34.733968', '209.129.244.250', '209.129.244.250', null, '33', '9', '15', '27', '7', null, '029_DanFortner.jpg', 'image/jpeg', 'danfortner', null, 'aGNDGqSsuTTWindzyswX', '2012-10-03 22:06:40.858605', null, null);
INSERT INTO "users" VALUES ('872', '1340920635.9173238', 'bo-lung.tsai@sv.cmu.edu', '2012-06-28 21:57:15.923718', '2012-08-07 21:39:19.156546', 'f', 'f', 'f', 'BoLungTsai', 'Leonard', 'Tsai', 'Bo-Lung Tsai', '/images/mascot.jpg', '', '', '', 'f', 'f', null, 't', 'Bo-Lung', '', '', 'Mountain View', 'CA', 'USA', '+15106378291', '', null, 'bo-lung.tsai@sv.cmu.edu', null, '<p><span style="color: #424545; font-family: verdana, arial, helvetica, sans-serif; font-size: 13px; line-height: 18px; background-color: #fbfbfb;">I am a graduate student in the <span style="color: #424545; font-family: verdana, arial, helvetica, sans-serif; font-size: 13px; line-height: 18px; background-color: #fbfbfb;">exchange summer</span>&nbsp;program and majored in Computer Science.</span></p>', '', '', '', 'Mobile', '', '', '', '', '', '', '872', '1', 'f', 'the -ts- sound is as in "cats".', '2012-06-28 21:57:20.083883', '2012-06-28 21:57:25.945724', null, null, '6', '2012-08-07 21:35:17.156051', '2012-07-13 18:12:02.748395', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, null, null, null, '', null, null, null, null, null);
INSERT INTO "users" VALUES ('826', 'latak@andrew.cmu.edu', 'lata.krishnamohan@sv.cmu.edu', '2012-06-27 22:17:37.121253', '2012-10-04 00:55:21.970942', 'f', 't', 'f', 'LataKrishnamohan', 'Lata', 'Krishnamohan', 'Lata Krishnamohan', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/826/profile/025_LataKrishnamohan.jpg', '2013', 'SM', '', 'f', 'f', '2012-09-28 17:02:12.549393', 't', '', '', '', 'Saratoga', 'California', '', '+16507987987', 'latak.27', null, 'lata_km@hotmail.com', 'Local', '<p>I was born and brought up in Mumbai, India. I graduated with an MBA in Finance and went on to begin a career in Financial Services. I worked with India''s largest mortgage finance company HDFC and thereafter with two of the global Asset Management companies - HSBC and BNP Paribas. In my last assignment I was the Chief Client Services and Investor Relations Ofiicer. My role involved overseeing the day to day operations, driving projects, business process improvements and liaising with the Regulators.&nbsp;</p>
<p>I love music and learned Indian Classical music (vocal). I travel to re-energize my batteries after a long work sprint. When I am indoors I either read or paint or use poetry as a form of expression.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals by the time I graduate:</p>
<ol>
<li>Develop a deeper understanding of software and software management techniques.</li>
<li>Build a network of friends and an academic community of advisors.</li>
<li>Have a job lined up.</li>
