INSERT INTO "users" VALUES ('833', 'mltan@andrew.cmu.edu', 'mark.tan@sv.cmu.edu', '2012-06-27 22:24:36.237402', '2012-09-30 08:13:33.409314', 'f', 't', 'f', 'MarkTan', 'Mark', 'Tan', 'Mark Tan', '/images/mascot.jpg', '2013', 'SM', '', 'f', 'f', '2012-09-28 17:02:18.680255', 't', 'Mark Joseph', '', 'Procter & Gamble', 'Mountain View', 'California', 'United States', '+1(626)6468616', 'mltan4', null, 'markjosephltan@gmail.com', 'Local', '<p><span style="font-size: 9.000000pt; font-family: ''Cambria''; font-weight: 700">I was born and raised in Manila, Philippines. I have an undergraduate degree in BS Computer Engineering, University of the Philippines and pursued a career as a Systems Analyst in Procter &amp; Gamble, where I managed financial systems application for aquisitions and divestitures.</span></p>
<p><span style="font-size: 9.000000pt; font-family: ''Cambria''; font-weight: 700">I enjoy swimming, running, and outdoor adventures such as hiking and surfing. I like hanging out with friends, discovering new places, and exploring the unexplored.<br /></span></p>', '<p>&nbsp;</p>
<p><span style="font-size: 10.000000pt; font-family: ''Cambria''; font-weight: 700">OBJECTIVES</span><span style="font-size: 9.000000pt; font-family: ''Cambria''; font-weight: 700">&nbsp;</span></p>
<div>
<div>
<ul>
<li><span style="font-size: 9.000000pt; font-family: ''Cambria''; font-weight: 700">Pursue a career as a product manager</span><span style="font-size: 9.000000pt; font-family: ''Cambria''">,  enable delivery of innovative strategy for existing or new ventures in  the area of mobile platforms and/or financial applications.</span> <span style="font-size: 9.000000pt; font-family: ''Cambria''; font-weight: 700">&nbsp;</span></li>
<li><span style="font-size: 9.000000pt; font-family: ''Cambria''; font-weight: 700">Lead incubation initiatives and innovation programs </span><span style="font-size: 9.000000pt; font-family: ''Cambria''">by leveraging my knowledge on both business and technical domains.</span></li>
<li><span style="font-size: 9.000000pt; font-family: ''Cambria''"><strong>Lead relationship and strategic roadmap </strong>with clients and corporate business units by designing system solutions that will enable successful product delivery. </span></li>
</ul>
</div>
</div>', null, null, 'Mobile', '', '', '', '', '', '', '833', '1', 'f', '', '2012-06-27 22:24:40.430661', '2012-06-27 22:24:46.232156', null, null, '45', '2012-09-27 05:42:51.323214', '2012-09-26 20:57:00.093097', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, null, null, null, 'mltan4', null, 'F1tGPJkm9p5fxsBgGudY', '2012-09-27 05:42:51.242718', null, 'length');
INSERT INTO "users" VALUES ('834', 'pwanniss@andrew.cmu.edu', 'petch.wannissorn@sv.cmu.edu', '2012-06-27 22:25:19.69747', '2012-10-02 17:47:03.88242', 'f', 't', 'f', 'PetchWannissorn', 'Petch', 'Wannissorn', 'Petch Wannissorn', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/834/profile/015_PetchWannissorn.jpg', '2013', 'SM', '', 'f', 'f', '2012-09-28 17:02:19.822793', 't', 'Petch', '', '', 'Sunnyvale', 'California', 'United States', '7343550752', '', null, 'petchw@gmail.com', 'Local', '<p>I was born and raised in Bangkok, Thailand. I came to the US when I was 17 to complete my undergraduate in Computer Science in Engineering at University of Michigan and my MS in Computer Science at UCLA later. I enjoy eating foods with friends, playing badminton and singing.</p>', '<p><strong> </strong></p>
