INSERT INTO "users" VALUES ('836', 'bgadiyar@andrew.cmu.edu', 'bharath.gadiyaram@sv.cmu.edu', '2012-06-27 22:27:02.532271', '2012-06-27 22:27:10.456958', 'f', 't', 'f', 'BharathGadiyaram', 'Bharath', 'Gadiyaram', 'Bharath Gadiyaram', '/images/mascot.jpg', '2014', 'SM', '', 't', null, null, 't', 'Bharath Kumar', null, null, null, null, null, null, null, null, 'jeebeekay@yahoo.com', null, '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. People''s trash clearly isn''t multitudinous. I hope to put my real biography here one day.</p>', '<h2>About Me</h2><p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:<ol><li>Goal 1</li><li>Goal 2</li><li>Goal 3</li></ol></p>', null, null, null, null, null, null, null, null, null, '353', '1', null, null, '2012-06-27 22:27:04.479187', '2012-06-27 22:27:10.436425', null, null, '0', null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, null);
INSERT INTO "users" VALUES ('837', 'vgupta@andrew.cmu.edu', 'vikas.gupta@sv.cmu.edu', '2012-06-27 22:27:46.293946', '2012-09-26 02:59:56.774085', 'f', 't', 'f', 'VikasGupta', 'Vikas', 'Gupta', 'Vikas Gupta', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/837/profile/026_VikasGupta.jpg', '2014', 'SM', '', 't', 'f', null, 't', 'Vikas', 'Google', 'Software Engineer', 'Mountain View', 'California', 'India', '650-248-1892', '', null, 'vikasgupta66@gmail.com', 'Local', '<p>I was born and brought up in New Delhi in India. I pursued my undergraduation in Computer Engineering at Netaji Subhas Institute of Technology (University of Delhi). After graduating in 2007, I started working with Adobe Systems in India as a software developer. At Adobe, I worked for over four years on their web conferencing solution called ''Adobe Connect''. In 2011, I moved to the US and joined Google, where I am working as a software engineer on ''Big Data Analytics and Visualization''.</p>
<p><img id="smallDivTip" style="z-index: 90; border: 0px solid blue; position: absolute; left: 112px; top: 89px;" src="chrome://dictionarytip/skin/dtipIconHover.png" alt="" /></p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Learn</li>
<li>Learn more!</li>
<li>Learn even more!</li>
</ol>
<p>Through this program, I want to complement my technical skills with the business and management aspect of a software company. My primary interests are product management and entrepreneurship.</p>', null, null, 'Mobile', '', '', '', '', '', '', '837', '1', 'f', '', '2012-06-27 22:27:52.853463', '2012-06-27 22:27:59.494052', null, null, '15', '2012-09-26 02:59:56.771231', '2012-09-09 02:52:12.57613', '216.239.45.130', '75.94.131.108', null, null, null, null, null, null, null, '026_VikasGupta.jpg', 'image/jpeg', '', null, 'RMqc2RZZy3id3xUBDQva', '2012-09-26 02:59:56.756327', null, 'semester');
