INSERT INTO "users" VALUES ('839', 'dhousman@andrew.cmu.edu', 'david.housman@sv.cmu.edu', '2012-06-27 22:29:13.00194', '2012-10-01 03:05:34.559988', 'f', 't', 'f', 'DavidHousman', 'David', 'Housman', 'David Housman', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/839/profile/021_DavidHousman.jpg', '2014', 'SM', '', 't', 'f', null, 't', 'David', 'eHealth.com', 'Web Analytics Program Manager', 'Mountain View', 'CA', 'USA', '925.209.1236', 'davidjhousman', null, 'dhousman@gmail.com', 'Local', '<p>I graduated from Carnegie Mellon University in 2005 with majors in Business Administration and Human Computer Interaction. Since then I''ve worked in User Experience Research and Web Analytics.</p>
<ul>
<li>You can find&nbsp; my LinkedIn profile here: http://www.linkedin.com/in/discovertheuser. </li>
<li>And here''s my personal website: http://www.davidhousman.com/</li>
</ul>
<p>I''ve done a fair amount of contracting in my day, and here are the companies that I''ve worked for:</p>
<ul>
<li>Oracle Corporation</li>
<li>Samsung SISA</li>
<li>Rearden Commerce</li>
<li>Tivo, Incorporated</li>
<li>iCrossing Incorporated</li>
<li>Move, Incorporated</li>
<li>eHealth Incorporated</li>
</ul>
<p>&nbsp;</p>
<p>P.S. I actually was raised by Boingboing goatherders.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Build a strong professional network</li>
<li>Improve collaboration with creative people</li>
<li>Learn to collaborate with engineers.</li>
</ol>', null, null, 'Mobile', '', '', '', '', '', '', '812', '1', 'f', 'House + men', '2012-06-27 22:29:16.369944', '2012-06-27 22:29:23.643639', null, null, '21', '2012-10-01 03:05:34.556007', '2012-09-29 21:21:23.580641', '76.102.14.20', '76.102.14.20', null, null, null, null, null, null, null, '021_DavidHousman.jpg', 'image/jpeg', '', null, 'SBHgzyxkRDJVKmiivF97', '2012-10-01 03:05:34.537014', null, 'length');
