INSERT INTO "users" VALUES ('850', 'chenkaik@andrew.cmu.edu', 'chenkai.kuang@sv.cmu.edu', '2012-06-27 22:42:48.271774', '2012-10-04 01:27:24.609286', 'f', 't', 'f', 'ChenkaiKuang', 'kai', 'Kuang', 'Chenkai Kuang', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/850/profile/070_ChenkaiKuang.jpg', '2013', 'ECE', '', 'f', 'f', '2012-09-28 17:01:09.108676', 't', '', '', '', '', '', '', '6505268077', '', null, 'kuangchenkai@gmail.com', 'Local', '<p>Chenkai Kuang is a Electrical and Computer Engineering Master Student in Carnegie Mellon University Silicon Valley. &nbsp;He just graduated from Nanjing University of Science and Technology with a major in Computer Science &amp; Telecommunication.</p>
<p>Chenkai has some experience in Ad Hoc network routing, especially opportunistic routing and NS2 network simulator. His programming languages are Java, C/C++, perl, OTCL. He has some experience in Game developing through C++ and Windows API.</p>
<p>Chenkai is taking the three courses this semester:</p>
<p>Introduction to software engineering</p>
<p>How to write fast code</p>
<p>Java for smartphone design</p>
<p>He likes coding and enjoys coding. His knowledge of programming methology and software engineering priciples can make him a good engineer with a team.</p>', '<h2>About Me</h2>
