<li>be fluent in English prisentation</li>
<li>secrete : )</li>
</ol>', null, null, 'Mobile', '', '', '', '', '', '', '812', '1', 'f', '', '2012-06-27 22:42:54.775965', '2012-06-27 22:43:00.766977', null, null, '406', '2012-10-04 01:27:24.601072', '2012-10-04 00:23:01.684269', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, null, '070_ChenkaiKuang.jpg', 'image/jpeg', 'github.com/ChenkaiKuang', null, '7zMx2xwKyP9Z11obsY2V', '2012-10-04 01:27:24.566847', null, 'length');
INSERT INTO "users" VALUES ('851', 'seokjeol@andrew.cmu.edu', 'seok.jeong.lee@sv.cmu.edu', '2012-06-27 22:44:05.762408', '2012-09-26 11:38:27.009804', 'f', 't', 'f', 'SeokJeongLee', 'Seok-Jeong', 'Lee', 'Seok-Jeong Lee', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/851/profile/075_SeokJeongLee3.jpg', '2013', 'ECE', '', 'f', 'f', null, 't', '', '', '', '', '', '', '', '', null, 'katelsj@gmail.com', 'Unknown', '<p>I was raised by sheepherders on the hills of BoingBoing while they were selling chunky bacon. Because I have a ring, I need help with putting on my clothes. After working hard they promoted me to garbage man. They told me the reason for this new responsibility was show me the money. I looked for a treasure map and tools, but I never did find the fourteen minutes. People''s trash clearly isn''t multitudinous. I hope to put my real biography here one day.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Goal 1</li>
<li>Goal 2</li>
<li>Goal 3</li>
</ol>
<p>&nbsp;</p>', null, null, '', '', '', '', '', '', '', '812', '1', 'f', '', '2012-06-27 22:44:07.44242', '2012-06-27 22:44:13.540878', null, null, '20', '2012-09-26 11:38:27.003253', '2012-09-05 16:28:35.651644', '24.5.127.253', '108.65.77.15', null, null, null, null, null, null, null, '075_SeokJeongLee3.jpg', 'image/jpeg', '', null, 'xqhgftT35Hkv9ZVi3TUJ', '2012-09-26 11:38:26.869979', null, 'semester');
INSERT INTO "users" VALUES ('852', 'smediker@andrew.cmu.edu', 'sagar.medikeri@sv.cmu.edu', '2012-06-27 22:44:58.554343', '2012-09-17 01:22:09.737908', 'f', 't', 'f', 'SagarMedikeri', 'Sagar', 'Medikeri', 'Sagar Medikeri', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/852/profile/072_SagarMedikeri.jpg', '2013', 'ECE', '', 'f', 'f', null, 't', '', 'Carnegie Mellon University', 'Graduate Student', 'Mountain View', 'California', 'USA', '', '', null, 'sagar.medikeri@gmail.com', 'Unknown', '<p>I''m a First year Graduate Student at Carnegie Mellon Silicon Valley pursuing my Masters in ECE.&nbsp;</p>
<p>After finishing my Bachelors in ECE in B. V. Bhoomaraddi College, Hubli, India, I worked for 2 years as a Software Engineer at Juniper Networks, Bangalore working on modular Ethernet Switch software. I implemented the PFE programming for Layer 2 features like Storm Control and SPAN/RSPAN. I have also worked on Test Automation using Perl.</p>
<p>My interests include Linux, Operating Systems, Mobile Application development among others. Of late I have been following Chrome and ChromeOS and find it posing exciting new challenges and opportunities.</p>
<p>For Leisure, I go to the movies, play games, go trekking/exploring. :)</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Goal 1</li>
<li>Goal 2</li>
