INSERT INTO "users" VALUES ('864', 'roberti@andrew.cmu.edu', 'bob.iannucci@sv.cmu.edu', '2012-06-28 17:11:23.998325', '2012-09-30 02:41:15.891813', 't', 'f', 'f', 'BobIannucci', 'Bob', 'Iannucci', 'Bob Iannucci', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/864/profile/Bob%20Iannucci.jpg', '', '', '', 'f', 'f', null, 't', 'Robert', 'CMU Silicon Valley', 'Distinguished Service Professor', 'Moffett Field', 'CA', 'USA', '650-335-2801', 'iannucci', null, 'bob@rail.com', null, '<p><strong>Bob Iannucci</strong><br />Director of the Mobility Research Center<br />Distinguished Service Professor<br /><br /><strong>Areas of Interest</strong><br /><br />Mobile and embedded computing, scalable systems, sensor networks, emergency communications systems<br /> <br /><strong>Education</strong><br />Ph.D. 1988, Electrical Engineering and Computer Science, MIT<br /><br />Dr.  Bob Iannucci is Director of the Mobility Research Center at Carnegie  Mellon University Silicon Valley and is known for leading both software  and systems research in scalable and mobile computing.&nbsp; Most recently,  he served as Chief Technology Officer of Nokia and Head of Nokia  Research Center (NRC).&nbsp; Bob spearheaded the effort to transform NRC into  an Open Innovation center, creating "lablets" at MIT, Stanford,  Tshinghua University, the University of Cambridge, and &Eacute;cole  Polytechnique F&eacute;d&eacute;rale de Lausanne (EPFL).&nbsp; Under his leadership, NRC''s  previously established labs and the new lablets delivered fundamental  contributions to the worldwide Long Term Evolution for 3G (LTE)  standard; created and promulgated what is now the MIPI UniPro interface  for high-speed, in-phone interconnectivity; created and commercialized  Bluetooth Low Energy - extending wireless connectivity to  coin-cell-powered sensors and other devices; and delivered new  technology initiatives including TrafficWorks (using mobile phones to  crowd source traffic patterns, Point and Find (augmented-reality using  the mobile phone&rsquo;s camera for image recognition and &ldquo;zero click&rdquo; search)  and the Morph Concept (opening new directions for using nanotechnology  to significantly improve mobile phone functionality and usability).&nbsp; <br /> <br />Previously, Bob led engineering teams at startup companies focused  on virtualized networking and computational fluid dynamics, creating  systems that offered order-of-magnitude improvements over alternatives.&nbsp;  He also served as Director of Digital Equipment Corporation''s Cambridge  Research Laboratory (CRL) and became VP of Research for Compaq.&nbsp; CRL  created some of the earliest multimedia indexing technologies, and these  became part of Alta Vista.&nbsp; In addition, the CRL team and Dan  Siewiorek''s team at CMU created MoCCA - a mobile communication and  computing architecture - that prefigured and anticipated (by more than a  decade) much of what has become today''s smartphone technology.&nbsp; MoCCA  won the IDEA Gold award for its innovative approach to facilitating  real-time interaction within teams.&nbsp; Bob spent the earliest days of his  career at IBM studying and developing highly scalable computing systems.<br /> <br />Bob remains active as a hands-on systems builder.&nbsp; His most recent  iPhone app for radio direction finding is in use in over 70 countries,  and he is actively engaged in building WiFi-based "internet of things"  devices and the cloud services behind them.&nbsp; He serves as advisor to  companies developing new technologies for ultra-low-power computing,  mobile video systems, and cloud-connected mobile apps.<br /> <br />Bob earned his Ph.D. from MIT in 1988, and his dissertation was on  the hybridization of dataflow and traditional von Neumann architectures,  offering advantages over both.&nbsp; He has served on a number of scientific  and engineering advisory boards and was on the program committees for  the 3rd and 4th International Sympoisia on Wearable Computing.&nbsp; Bob also  served as a member of the selection committee for the Millennium  Technology Prize in 2008.</p>', '', '', '', 'Work', '', '', '', '', '', '', '1', '1', 'f', '', '2012-06-28 17:11:31.289091', '2012-06-28 17:11:38.335545', null, null, '18', '2012-09-30 02:41:15.888584', '2012-09-21 04:42:04.448176', '107.194.247.170', '107.194.247.170', null, null, null, null, null, null, null, 'Bob Iannucci.jpg', 'image/jpeg', '', null, 't8bhiMfWMsizsZrNTuT5', '2012-09-30 02:41:15.877816', null, null);
