INSERT INTO "users" VALUES ('903', 'himanshp@andrew.cmu.edu', 'himanshu.pandey@sv.cmu.edu', '2012-06-29 17:14:46.388712', '2012-10-03 17:30:22.289411', 'f', 't', 'f', 'HimanshuPandey', 'Himanshu', 'Pandey', 'Himanshu Pandey', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/903/profile/Pandey_Himanshu_2012_003.JPG', '2014', 'INI', '', 'f', 'f', '2012-09-28 17:01:59.08549', 't', 'Himanshu', '', '', 'Pittsburgh', 'Pennsylvania', 'United States', '4126087842', 'himanshupandey.in', null, 'himanshupandey.in@gmail.com', 'Unknown', '', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Goal 1</li>
