INSERT INTO "users" VALUES ('943', 'gcahill@andrew.cmu.edu', 'grant.cahill@sv.cmu.edu', '2012-07-17 18:11:35.011602', '2012-10-03 05:44:00.819957', 'f', 't', 'f', 'GrantCahill', 'Grant', 'Cahill', 'Grant Cahill', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/943/profile/084_GrantCahill.jpg', '2014', 'SE', 'DM', 't', 'f', '2012-09-28 17:01:35.334318', 't', '', 'The Boeing Company', 'Software Engineer', 'Colorado Springs', 'Colorado', 'USA', '719-231-5303', 'grant.cahill80', null, 'gwcahill@gmail.com', 'Remote', '<p>I was born in Scotland and spent my childhood there until my family moved from our village of Luthermuir to Los Angeles, CA. We bounced around the country to various states including Maryland and Florida before finally settling down in Colorado. The one thing that helped me immensely during all of the moves was my love of sports (more specifically football.....er, soccer). I was able to meet a lot of great people through playing on various teams.</p>
<p>I received my B.S. in Computer Engineering with a minor in math from the University of Colorado in 2004 and went on to obtain my M.S. in Computer Science from CU as well. Professionally, I have been working for The Boeing Company since 2004. My career has been primarily in the software world and I have been fortunate to work on missile defense systems, R&amp;D, and satellites.</p>
<p>Lastly, I have been married to my high school sweetheart for 11 years and we have a beautiful little 20 month old that is hugely entertaining.</p>
<p>I look forward to working with everyone this semester!</p>', '<h2>About Me</h2>
<div>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:<ol>
<li>Complete an animation demo reel</li>
<li>Get to a niners game</li>
<li>Lead a team of engineers</li>
</ol></div>', null, null, 'Mobile', '', '', '', '', '', '', '812', '1', 'f', 'Kay-hill', '2012-07-17 18:11:39.516531', '2012-07-17 18:11:45.980038', null, null, '57', '2012-10-03 05:44:00.816964', '2012-10-02 03:26:52.36905', '12.46.49.130', '12.46.49.130', null, null, null, null, null, null, null, '084_GrantCahill.jpg', 'image/jpeg', 'gwcahill', null, '17LGLeActNMC4o23fwJu', '2012-10-03 05:44:00.803159', null, null);
