INSERT INTO "users" VALUES ('947', 'onn@andrew.cmu.edu', 'omar.naziry@sv.cmu.edu', '2012-07-24 21:55:32.165602', '2012-09-19 03:33:44.175', 'f', 't', 'f', 'OmarNaziry', 'Omar', 'Naziry', 'Omar Naziry', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/947/profile/024_OmarNaziry.jpg', '2014', 'SM', 'SM', 't', 'f', null, 't', '', 'Lockheed Martin Space Systems', 'TA to VP', 'Sunnyvale', 'Californica', 'USA', '4086477038', 'omar3550', null, 'omarnaziry@gmail.com', 'Local', '<p>I was born in Hamburg, Germany where I spent about 14 years of my life before moving to the United States. I lived in Nashville, TN and Orlando, FL before finally moving to silicon Valley. My academic background is in MIS. I have been working at Lockheed Martin in various roles for about 3 and half years and have graduated from their rotational leadership development program. My current role is Technical Assistant and Deputy to the VP and CIO of Space Systems Company. I have way too many hobbies to list but my major ones are reading, astronomy, neuroscience, soccer, cars, and more. My interests are startups, venture capital, entrepreneurship, technology and more. My goal is to eventuallly be a serial entrepreneur, starting with a software as a service startup and eventually "winning" my way into owning a hardware business.</p>
<p>More info here:</p>
<p>http://about.me/omarnaziry</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Start a Startup</li>
<li>Build a prototype</li>
<li>Get funding</li>
</ol>', null, null, 'Mobile', '', '', '', '', '', '', '947', '1', 'f', '', '2012-07-24 21:55:37.233815', '2012-07-24 21:55:46.358868', null, null, '9', '2012-09-19 03:33:44.170146', '2012-09-14 00:33:38.596375', '24.130.56.66', '209.129.244.250', null, null, null, null, null, null, null, '024_OmarNaziry.jpg', 'image/jpeg', '', null, 'TajmNyn83BCugVXcQV5s', '2012-09-19 03:33:44.146288', null, 'semester');
