INSERT INTO "users" VALUES ('948', 'hkrishna@andrew.cmu.edu', 'amy.krishnamohan@sv.cmu.edu', '2012-07-25 18:24:28.698497', '2012-10-02 01:55:09.462287', 'f', 't', 'f', 'AmyKrishnamohan', 'Amy', 'Krishnamohan', 'Amy Krishnamohan', 'http://s3.amazonaws.com/cmusv-rails-production/people/photo/948/profile/023_AmyKrishnamohan.jpg', '2014', 'SM', 'SM', 't', 'f', null, 't', 'Hyunmi', 'SAP', '', 'Palo Alto', 'CA', 'USA', '', '', null, 'l.hyunmi@gmail.com', 'Local', '<p>Amy has about five years of IT experience involved in E2E cycle of software development projects in various High-tech companies such as SAP, Accenture, Intuit and Cisco.&nbsp;She has rich experience in proven delivery methods and program management tools.</p>
<p>Previously, she was working as a consultant at Accenture leading the implementation of a Quoting and Ordering (Q2O) application across all the global sales channels in Cisco.</p>
<p>She also worked at SAP Governance Risk and Compliance (GRC) team where she was responsible for researching and developing content for financial regulation compliance such as Sarbanes Oxley Law and Foreign Corruption Practice Act.&nbsp;She worked closely with SAP Solution Management team to develop use case and system design for new products.</p>
<p>She is actively involved is community works such as Microcredit club and North Korean Human Right Organization.She is a self motivated and committed professional to deliver the IT projects exceeding the expectations of all stakeholders.</p>
<p>Amy is currently pursuing Masters in Software Management from Carengie Mellon University and received her Masters in Information Systems from Santa Clara University.</p>', '<h2>About Me</h2>
<p>I''d like to accomplish the following three goals (professional or personal) by the time I graduate:</p>
<ol>
<li>Goal 1</li>
<li>Goal 2</li>
<li>Goal 3</li>
</ol>', null, null, '', '', '', '', '', '', '', '812', '1', 'f', '', '2012-07-25 18:24:35.219269', '2012-07-25 18:24:42.886727', null, null, '13', '2012-10-02 01:55:09.458728', '2012-09-10 18:41:54.788607', '209.129.244.250', '169.145.3.20', null, null, null, null, null, null, null, '023_AmyKrishnamohan.jpg', 'image/jpeg', '', null, 'Cc7pXwc5CcyiT8RRciws', '2012-10-02 01:55:09.445208', null, null);
INSERT INTO "users" VALUES ('950', '1343353489.6417313', 'falk.howar@sv.cmu.edu', '2012-07-27 01:44:49.682655', '2012-07-29 19:48:08.876504', 't', 'f', 'f', 'FalkHowar', 'Falk', 'Howar', 'Falk Howar', '/images/mascot.jpg', '', '', '', 'f', 'f', null, 't', 'Falk', '', '', 'Mountain View', 'CA', 'USA', '+1 650 335 2826', 'alfredeneumann', null, 'falk.howar@sv.cmu.edu', null, '<p>I am a post-doc researcher. My work focuses on using active  	automata learning techniques for the ex post construction of models of software systems. 	This includes - but is not limited to - extending active automata learning techniques to deal with data  aspects of systems (instead of capturing control behavior only), and investigating connections between active learning and (model-based) testing and verification.</p>
<ul>
</ul>', '', '', '', 'Work', '+1 415 702 7846', 'Mobile', '', '', '', '', '950', '1', 'f', '', '2012-07-27 01:44:54.585824', '2012-07-27 01:45:03.030767', null, null, '1', '2012-07-29 19:27:33.040034', '2012-07-29 19:27:33.040034', '209.129.244.250', '209.129.244.250', null, null, null, null, null, null, null, null, null, '', null, 'zL8cy6ZR3x7jPEspRyqz', '2012-07-29 19:27:33.013329', null, null);
