INSERT INTO "users" VALUES ('1028', 'agampa@andrew.cmu.edu', 'alekhya.gampa@sv.cmu.edu', '2012-08-29 20:17:44.912746', '2012-10-03 20:08:29.120182', 'f', 't', 'f', 'AlekhyaGampa', 'Alekhya', 'Gampa', 'Alekhya Gampa', '/images/mascot.jpg', '', 'ECE', '', 'f', 'f', '2012-09-28 17:01:02.084672', 't', '', '', 'Electrical and Computer Engineer', 'Pittsburgh', 'PA', 'USA', '', '', null, 'agampa@andrew.cmu.edu', 'Unknown', '<p>I was born in India and moved to the US when I was six. Since then I have done all of my primary education in Fairfax, Virginia. My Interests in Math and Science have led me to do ECE at Carnegie Mellon University.</p>', '<h2>About Me</h2>
