INSERT INTO "users" VALUES ('1', 'at33@andrew.cmu.edu', 'todd.sedano@sv.cmu.edu', '2008-08-15 18:05:29', '2012-10-12 22:21:58.26941', 't', 'f', 't', 'ToddSedano', 'Todd', 'Sedano', 'Todd Sedano', '/images/staff/ToddSedano.jpg', '', '', '', 'f', 't', null, 't', '', 'Carnegie Mellon University', 'Director of Software Engineering', 'Mountain View', 'CA', 'USA', '650-335-2812', 'toddsedano', 'toddsedano', 'professor@gmail.com', 'Local', '<p>Todd Sedano is the Director of the Software Engineering Program for  Carnegie Mellon University''s Silicon Valley campus. He is responsible  for the day-to-day operations of the Software Engineering program and  teaches agile methodologies to graduate students. Todd enjoys programming in Ruby on Rails.</p>
<p>While working in the Artificial Intelligence group at the Jet  Propulsion Laboratory, Todd worked on planning and scheduling software  for the Deep Space Network antennas and space probes, image processing,  and system testing of the Remote Experiment Agent planning software on  the Deep Space 1 spacecraft. In Silicon Valley, Todd has worked with  both startup and established companies. Using J2EE technologies he has  worked on websites for Sega, Roxio, Target, Better Homes and Gardens,  and CustomerNation; integrated software with FedEx, UPS, and NetSuite  webservices; been in a few death marches; and managed several  development teams.</p>
<p>Todd earned both his M.S. in software engineering and his  undergraduate degree in mathematics and computer science from Carnegie  Mellon University.</p>', '', '', '', 'Work', '650-450-8633', 'Google Voice', '', '', '', '', '1', '566', 'f', 'Todd Say-DAWN-oh', null, null, null, null, '931', '2012-10-12 22:21:58.266991', '2012-10-12 21:03:55.837345', '127.0.0.1', '127.0.0.1', null, '10', '28', '29', '30', '19', '2011-12-15 17:05:28.520074', null, null, '', 'icons', 'ddUw6QzxcK4jWxGSjYVJ', '2012-10-12 22:21:58.252124', null, 'semester');
